(3, 'Harrison Ford', 'Harrison Ford es un actor estadounidense de cine y televisión.\n\nDebe su notoriedad a su colaboración con el guionista, productor y director George Lucas, que fue el primero en darle la posibilidad de consagrarse como actor. Sus papeles de Han Solo en la trilogía original de Star Wars y de Indiana Jones lo elevaron al nivel de estrella internacional. Aunque un fracaso inicial en taquilla, la película de Ridley Scott Blade Runner, donde desempeña el papel del cazador de replicantes Rick Deckard, t', 'Chicago, Illinois, USA', '1942-07-13', 'actualidad', 'Masculino', 40.027, 'https://image.tmdb.org/t/p/original/ActhM39LTxgx3tnJv3s5nM6hGD1.jpg'),
(4, 'Carrie Fisher', 'Carrie Frances Fisher nació el 21 de octubre de 1956 en Burbank, California, de los cantantes / actores Eddie Fisher y Debbie Reynolds. Fue actriz y escritora conocida por La guerra de las galaxias (1977), El imperio contraataca (1980) y El retorno del Jedi (1983). Fisher también es conocida por su libro, «Postales desde el borde», y escribió el guión de la película basado en su novela. Carrie Fisher y el agente de talentos Bryan Lourd tienen una hija, Billie Lourd (Billie Catherine Lourd), naci', 'Beverly Hills, Los Angeles, California, USA', '1956-10-21', '2016-12-27', 'Femenino', 19.103, 'https://image.tmdb.org/t/p/original/awb4UqzT6meD3JiQlraIzAqcRtH.jpg'),
