(62, 'Bruce Willis', 'Actor y productor germano-estadounidense, cuya trayectoria comenzó en la industria televisiva durante los años 80 y, desde entonces, ha aparecido en películas donde interpreta roles cómicos, dramáticos y de acción. Es conocido por su interpretación del oficial John McClane en la serie Die Hard, en la que obtuvo buenas críticas y una recaudación considerable a partir del estreno de la primera cinta en 1988.​ Asimismo, ha aparecido en más de 60 filmes, entre los que se incluyen éxitos de taquilla ', 'Idar-Oberstein, Germany', '1955-03-19', 'actualidad', 'Masculino', 52.842, 'https://image.tmdb.org/t/p/original/A1XBu3CffBpSK8HEIJM8q7Mn4lz.jpg'),
(63, 'Milla Jovovich', 'Milla Jovovich (nacida el 17 de diciembre de 1975) es una actriz, supermodelo, músico y diseñadora de moda estadounidense nacida en Ucrania. A lo largo de su carrera, ha aparecido en una serie de películas de ciencia ficción y de acción, por lo que el canal de música VH1 se ha referido a ella como la \"reina reinante del kick-butt\".\n\nHa aparecido en la portada de más de un centenar de revistas, y también ha protagonizado películas como The Fifth Element (1997), Ultraviolet (2006) y la franquicia ', 'Kiev, Ukraine', '1975-12-17', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/sDES3xDYZoDwsDxE4dd3IGMiQSn.jpg'),
