(109, 'Elijah Wood', 'Elijah Jordan Wood (nacido el 28 de enero de 1981) es un actor estadounidense. Hizo su debut cinematográfico con un papel menor en Back to the Future Part II (1989), luego consiguió una sucesión de papeles más importantes que lo convirtieron en un actor infantil aclamado por la crítica a los 9 años. Es mejor conocido por su papel de alto perfil como Frodo Bolsón en la aclamada trilogía de El señor de los anillos de Peter Jackson. Desde entonces, se ha resistido al encasillamiento eligiendo papel', 'Cedar Rapids, Iowa, USA', '1981-01-28', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/7UKRbJBNG7mxBl2QQc5XsAh6F8B.jpg'),
(110, 'Viggo Mortensen', 'Viggo Peter Mortensen (Nueva York, 20 de octubre de 1958) es un actor y director de cine estadounidense de ascendencia danesa. Por sus interpretaciones ha sido nominado en tres ocasiones a los Premios Óscar, en cuatro a los Premios Globo de Oro y una vez a los premios Goya. También ejerce como poeta, músico, fotógrafo y pintor.\n\nSu padre es danés y su madre estadounidense —su abuelo materno era de Nueva Escocia (Canadá) y su abuela materna de Nueva Inglaterra (Estados Unidos)—. La pareja se habí', 'Watertown, New York, USA', '1958-10-20', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/vH5gVSpHAMhDaFWfh0Q7BG61O1y.jpg'),
(112, 'Cate Blanchett', 'Cate Blanchett nació el 14 de mayo de 1969 en Melbourne, Victoria, Australia, a junio (Gamble), un maestro australiano y desarrollador de propiedades, y Robert DeWitt Blanchett, Jr., un ejecutivo de publicidad estadounidense, originario de Texas. Tiene un hermano mayor y una hermana menor. Cuando tenía diez años, su padre de 40 años murió de un ataque cardíaco repentino. Su madre nunca se volvió a casar, y su abuela se mudó para ayudarla.\n\nCate se graduó en el Instituto Nacional de Arte Dramátic', 'Melbourne, Victoria, Australia', '1969-05-14', 'actualidad', 'Femenino', 32.071, 'https://image.tmdb.org/t/p/original/9V83uemR0ra9Wd9iRXTMlfAQlTB.jpg'),
(113, 'Christopher Lee', 'Christopher Frank Carandini Lee (27 de mayo de 1922 - 7 de junio de 2015)​ fue un actor y músico inglés. Su gran afición al deporte, así como su altura (medía 1,96 metros), le dieron un físico muy reconocible. Interpretó sobre todo a villanos y participó en unas 250 producciones desde el año 1948. Estuvo encasillado varios años en películas de terror al interpretar al Conde Drácula. Continuó activo hasta el final de su vida, a pesar de la avanzada edad que alcanzó, e incluso durante su última dé', 'Westminster, London, England, UK', '1922-05-27', '2015-06-07', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/dA26fBr3t7mKqjn3OYW6kbD1LXM.jpg'),
(114, 'Orlando Bloom', 'Orlando Jonathan Blanchard Bloom (13 de enero de 1977), conocido habitualmente como Orlando Bloom, es un actor británico. Su salto a la fama se produjo con dos papeles protagonistas en grandes producciones: en 2001 el del príncipe elfo Legolas en El Señor de los Anillos: la Comunidad del Anillo, primera película de la trilogía basada en la novela de J. R. R. Tolkien;​ y en 2003 el del herrero Will Turner en Pirates of the Caribbean: The Curse of the Black Pearl.\n\nTras los éxitos mencionados se e', 'Canterbury, Kent, England, UK', '1977-01-13', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/lwQoA0qJTCZ6l2FH6PjmhRQjiaB.jpg'),
(116, 'Keira Knightley', 'Keira Knightley es una modelo y actriz inglesa de cine y televisión. Comenzó a actuar de niña en la televisión y debutó en el cine en 1995. Inicio con un papel secundario interpretando a Sabé en Star Wars: Episode I - The Phantom Menace 1999 y su primer papel importante llegó en la película de terror psicológico The Hole 2001.Ganó un amplio reconocimiento en 2002 después de ser la co-protagonista en la película Quiero ser como Beckham y la fama internacional en 2003 después de aparecer como Eliz', 'Teddington, London, England, UK', '1985-03-26', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/bRC1B2VwV0wK3ElciFAK6QZf2wD.jpg'),
(118, 'Geoffrey Rush', 'Geoffrey Roy Rush (Toowoomba, 6 de julio de 1951), conocido como Geoffrey Rush, es un actor australiano multipremiado.\n\nEs uno de las pocos intérpretes que han obtenido la «Triple corona de actuación». Ha sido galardonado con todos los premios importantes del cine, entre ellos: un Oscar, dos Globos de Oro, tres BAFTA, cuatro del Sindicato de Actores, un Emmy, un Tony y Premios AACTA. Es uno de los pocos actores que han ganado los seis premios más importantes de la interpretación y el primero de ', 'Toowoomba, Queensland, Australia', '1951-07-06', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/npXFjaFQzBNroCEPllGPTZ5IisA.jpg'),
