(1118, 'Rade Šerbedžija', 'Rade Šerbedžija (a veces aparece en los créditos como Rade Sherbedgia; nacido el 27 de julio de 1946) es un actor y director croata de origen serbio.\n\nFue uno de los más populares actores yugoslavos de las décadas de 1970 y 1980. En la actualidad, es internacionalmente conocido, principalmente por su papel como actor secundario en películas de Hollywood en las décadas de 1990 y de 2000. Recientemente, Šerbedžija destacó por su papel como el ex-general Dmitri Gredenko del Ejército Rojo de la Unió', 'Bunić, Croatia', '1946-07-27', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/eGK40yJnDCJOhtGXZrhkrkfVOwu.jpg'),
