(1125, 'Ewen Bremner', 'Ewen Bremner (23 de enero de 1972) es un actor escocés, cuyas interpretaciones más conocidas son: Red Winkle en la película Pearl Harbor, Spud en la película Trainspotting y en su secuela T2: Trainspotting y Shawn Nelson en la película Black Hawk Down.', 'Edinburgh, Scotland, UK', '1972-01-23', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/d8ZVdFiJHRl43tApt2w43Ha6prf.jpg'),
(1158, 'Al Pacino', 'Alfredo James Pacino, conocido como Al Pacino (Nueva York, 25 de abril de 1940), es un actor, guionista y director estadounidense de cine y teatro. Es considerado uno de los mejores actores de su generación2 y de la historia del cine.3 4 5 Es también uno de los actores de teatro y cine de fines del siglo xx que más reconocimientos recibió.6 Su carrera ha abarcado cincuenta años durante los cuales ha obtenido numerosos premios y honores, incluyendo los premios Óscar, Emmy, Globo de Oro, SAG, BAFT', 'New York City, New York, USA', '1940-04-25', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/2dGBb1fOcNdZjtQToVPFxXjm4ke.jpg'),
