(1162, 'Robert Loggia', 'Salvatore Loggia (3 de enero de 1930 - 4 de diciembre de 2015), más conocido como Robert Loggia, fue un actor y director de cine estadounidense, generalmente reconocido por sus papeles como secundario. Fue nominado en dos ocasiones al premio Emmy, en 1990 por la serie Mancuso, FBI y en 2001 por Malcolm in the Middle, y a un premio Óscar en la categoría de mejor actor de reparto por su trabajo en Al filo de la sospecha (1985).', 'Staten Island, New York, USA', '1930-01-03', '2015-12-04', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/mRSUgJnfprCNw83pyVfpfW7ryfK.jpg'),
