(1229, 'Jeff Bridges', 'Jeffrey Leon Bridges (4 de diciembre de 1949), mejor conocido como Jeff Bridges, es un actor, músico, productor, fotógrafo, dibujante, narrador y viticultor estadounidense ganador del premio Óscar, del Globo de Oro, del Premio del Sindicato de Actores y del Premio Cecil B. DeMille por su trayectoria profesional. Es hijo del legendario actor Lloyd Bridges.', 'Los Angeles, California, USA', '1949-12-04', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/xms1RAY6q7Lzp7wNeRCB0kzhucn.jpg'),
(1245, 'Scarlett Johansson', 'Scarlett Johansson, es una actriz, modelo y cantante estadounidense. Hizo su debut cinematográfico en North (1994) y más tarde fue nominada para el premio Independent Spirit a la mejor protagonista femenina por su actuación en Manny & Lo (1996), obteniendo más aclamación y prominencia con papeles en The Horse Whisperer (1998) y Ghost. Mundo (2001). Pasó a papeles adultos con sus actuaciones en Girl with a Pearl Earring (2003) y Lost in Translation (2003) de Sofia Coppola, por la que ganó un prem', 'New York City, New York, USA', '1984-11-22', 'actualidad', 'Femenino', 123.311, 'https://image.tmdb.org/t/p/original/6NsMbJXRlDZuDzatN2akFdGuTvx.jpg'),
