(1248, 'Brian Cox', 'Brian Denis Cox, CBE (Dundee, 1 de junio de 1946), es un actor escocés. Fue el primer actor en representar al personaje de Hannibal Lecter en cine, antes que Anthony Hopkins, en el film de suspenso Manhunter (1986).\n\nHa trabajado en películas como Troya, donde interpretó a Agamemnon, El caso Bourne, Rob Roy, Braveheart, Match Point y X-Men 2, en el rol de William Stryker (el creador de Wolverine). Debutó en el cine con Nicolás y Alejandra, en 1971. A principios de los años 1980 interpretó la pri', 'Dundee, Scotland, UK', '1946-06-01', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/scSjbFCTRngXlkJRoKptM5kQGw7.jpg'),
(1283, 'Helena Bonham Carter', 'Helena Bonham Carter CBE (nacida el 26 de mayo de 1966) es una actriz inglesa. Conocida por sus papeles en películas independientes y éxitos de taquilla, especialmente dramas de época, ha recibido varios galardones, incluido un premio de la Academia Británica de Cine y tres premios del Sindicato de Actores de la Pantalla, además de nominaciones para dos premios de la Academia, cuatro premios de la Academia Británica de Televisión, nueve Globos de Oro y cinco Premios Primetime Emmy. Bonham Carter', 'Golders Green, London, England, UK', '1966-05-26', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/hJMbNSPJ2PCahsP3rNEU39C8GWU.jpg');
