(1327, 'Ian McKellen', 'Sir Ian Murray McKellen (25 de mayo de 1939) es un actor británico de cine y teatro. Es ganador de seis premios Laurence Olivier, un Globo de Oro, un Tony, un premio del Sindicato de Actores, un BIF, y dos premios de la Crítica Cinematográfica; y candidato al Óscar, al BAFTA y al Emmy. Su labor interpretativa ha abarcado desde Shakespeare y el teatro popular contemporáneo hasta la fantasía y la ciencia ficción. La BBC declaró que «sus interpretaciones le han asegurado un nicho en el canon del te', 'Burnley, Lancashire, England, UK', '1939-05-25', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/5cnnnpnJG6TiYUSS7qgJheUZgnv.jpg'),
