(1331, 'Hugo Weaving', 'Hugo Wallace Weaving (4 de abril de 1960) es un actor anglo-australiano.\n\nEs conocido por sus papeles como el Agente Smith en la trilogía de Matrix, Elrond en las trilogías de El Señor de los Anillos y El hobbit, V en V for Vendetta, Mitzi en Las aventuras de Priscilla, reina del desierto, y como Johann Schmidt (Red Skull) en Capitán América: el primer vengador.', 'Ibadan, Nigeria', '1960-04-04', 'actualidad', 'Masculino', 33.287, 'https://image.tmdb.org/t/p/original/t4ScpYIHlXVD41scEyiGdQDYflX.jpg'),
