(1333, 'Andy Serkis', 'Andrew Clement «Andy» Serkis (20 de abril de 1964) es un actor, director de cine y escritor británico. Conocido por haber interpretado a Gollum en las trilogías cinematográficas de El Señor de los Anillos y El hobbit y a otros personajes a través de la técnica de captura de movimiento.', 'Ruislip, Middlesex, England, UK', '1964-04-20', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/eNGqhebQ4cDssjVeNFrKtUvweV5.jpg'),
