(1370, 'Brad Dourif', 'Bradford Dourif es un actor de cine y televisión estadounidense candidato a un premio Óscar y a un premio Emmy. Probablemente es más conocido por su papel en One Flew Over the Cuckoo\'s Nest, que le valió la citada candidatura al Óscar como mejor actor de reparto. También ha puesto su voz al personaje de Chucky en las películas del Muñeco diabólico (Child´s Play), ha interpretado a Lon Suder en Star Trek: Voyager, al doctor Gediman en Alien: Resurrección y a Gríma Lengua de Serpiente en la adapta', 'Huntington, West Virginia, USA', '1950-03-18', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/z2LYR7Ickql7g5hnWJSIAWMPD4o.jpg'),
(1371, 'David Wenham', 'David Wenham (Marrickville, Nueva Gales del Sur; 21 de septiembre de 1965) es un actor de cine y televisión australiano, que alcanzó la fama en su país con la película The Boys en 1998, y la internacional en 2002 por su papel de Faramir en la trilogía de El Señor de los Anillos de Peter Jackson.', 'Marrickville, Sydney, Australia', '1965-09-21', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/F7CWSqUE75HtrcdqIQ7UMZ9aTX.jpg'),
(1372, 'Karl Urban', 'Karl Heinz Urban (7 de junio de 1972) es un actor neozelandés, famoso por papeles cinematográficos como el de Éomer en la trilogía de El Señor de los Anillos o el de Pathfinder, u otros televisivos como el de Julio César en la serie de televisión Xena: la princesa guerrera; y más recientemente por encarnar al doctor Leonard McCoy en Star Trek y al juez Dredd en la película británica Dredd 3D (2012).', 'Wellington, New Zealand', '1972-06-07', 'actualidad', 'Masculino', 37.799, 'https://image.tmdb.org/t/p/original/aMkragCSEihmGhLp5xJ8Jnw2ZMY.jpg'),
(1381, 'John Noble', 'John Noble (nacido el 20 de agosto de 1948, altura 5\' 11¾\" (1,82 m)) es un actor de cine y televisión australiano, y director de teatro de más de 80 obras.  Nació en Port Pirie, Australia del Sur, Australia, y actualmente está protagonizando como científico Walter Bishop en la serie de televisión Fringe de J. J. Abrams.\n\nHizo apariciones ocasionales en la serie de televisión Todos los Santos.  Es conocido internacionalmente por su actuación como Denethor en la trilogía El Señor de los Anillos.  ', 'Port Pirie, South Australia, Australia', '1948-08-20', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/t9dB8uU27sQDaEEFMiQvp5sbrXU.jpg'),
