(1461, 'George Clooney', 'George Timothy Clooney (Lexington, Kentucky; 6 de mayo de 1961) es un actor, director, productor y guionista estadounidense. Ha sido galardonado con cuatro Globos de Oro, dos Óscar y un BAFTA. También es conocido por su activismo político, siendo Mensajero de la Paz de Naciones Unidas desde 2008, título al que renunció posteriormente.\n\nFue nominado dos veces para los premios Emmy por su interpretación del Dr. Doug Ross en la galardonada serie de televisión Urgencias. Gracias a ello, comenzó a in', 'Lexington, Kentucky, USA', '1961-05-06', 'actualidad', 'Masculino', 52.376, 'https://image.tmdb.org/t/p/original/4s3wI0bqOP7K3hhcmKqV6m3GYiQ.jpg'),
