(1532, 'Bill Murray', 'William James \"Bill\" Murray (21 de septiembre de 1950) es un actor y humorista estadounidense. Obtuvo reconocimiento en el programa de humor Saturday Night Live, actuación que le valió obtener un premio Emmy, y más tarde protagonizó películas cómicas como Caddyshack (1980), Los Cazafantasmas (1984) y Groundhog Day (1993). Obtuvo elogios de la crítica por su actuación en películas como Lost in Translation (2003), por la cual fue nominado al Óscar, y en producciones dirigidas por Wes Anderson como', 'Wilmette, Illinois, USA', '1950-09-21', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/nnCsJc9x3ZiG3AFyiyc3FPehppy.jpg'),
