(1646, 'Udo Kier', 'Udo Kier (Colonia, Alemania 10 de octubre de 1944) es un prolífico actor alemán que ha destacado por sus trabajos en películas de Terror y explotación, como Las torturas del Inquisición (Mark of the Devil), el binomio dirigido por Paul Morrissey de Carne para Frankestein (Flesh for Frankenstein) y Sangre para Drácula (Blood for Dracula) y recientemente por sus trabajos en las películas de Lars Von Trier y pequeños papeles en películas comerciales como Blade o No te preocupes, no llegará lejos a ', 'Cologne, Germany', '1944-10-14', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/lIOGDMvrVHMgPXdhicLI41tY1zf.jpg'),
