(2882, 'Diane Lane', 'Diane Colleen Lane (22 de enero de 1965) es una actriz estadounidense.\n\nHa sido nominada a los Óscar, Globos de Oro, Premios del Sindicato de Actores y Emmy.1​ Conocida por sus intervenciones en películas como Judge Dredd (1995), La tormenta perfecta (2000), Unfaithful (2002), Bajo el sol de la Toscana (2003), Hollywoodland (2006) y Nights in Rodanthe (2008).', 'New York City, New York, USA', '1965-01-22', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/tUPAKAtstqeQrAKhkQge9jV7Owz.jpg'),
