(2975, 'Laurence Fishburne', 'Laurence John Fishburne III, más conocido como Laurence Fishburne, (30 de julio de 1961) es un actor de cine estadounidense. Conocido principalmente por su rol como Morfeo en la película de ciencia ficción The Matrix y sus secuelas.  En 1993 fue nominado al premio Óscar al mejor actor por la película Tina, un biopic sobre la vida de la cantante Tina Turner en la que Fishburne interpretaba al marido de ésta. Ha participado también en la popular serie de CBS, CSI y representó a Perry White en la c', 'Augusta, Georgia, USA', '1961-07-30', 'actualidad', 'Masculino', 41.591, 'https://image.tmdb.org/t/p/original/iwx7h0AfWMm9K4sMmhru3ShSra.jpg'),
(3033, 'Wil Wheaton', 'Richard William \"Wil\" Wheaton III (29 de julio de 1972) es un escritor y actor estadounidense. Como actor, sus papeles más conocidos son el del alférez Wesley Crusher, de la serie de televisión Star Trek: The Next Generation, Gordie LaChance en la película Stand by Me, el adolescente rebelde Joseph “Joey” Trotta en Toy Soldiers, y participó en ocasiones en la serie The Big Bang Theory interpretándose a sí mismo.', 'Burbank, California, USA', '1972-07-29', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/yqEW17L7Fdg2RDRLLo4SqRHkjyw.jpg'),
