(3035, 'Jerry O\'Connell', 'Jeremiah O\'Connell (nacido el 17 de febrero de 1974) es un actor, director y personalidad televisiva estadounidense. Es conocido por sus papeles de Quinn Mallory en la serie de televisión Sliders, Andrew Clements en My Secret Identity, Vern Tessio en la película Stand by Me (1986), Joe en Joe\'s Apartment (1996), Frank Cushman en Jerry Maguire (1996) , Derek en Scream 2 (1997), Charlie Carbone en Kangaroo Jack (2003) y el detective Woody Hoyt en el drama Crossing Jordan.\n\nProtagonizó la comedia d', 'New York City, New York, USA', '1974-02-17', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/p2zcFeDIKUrPrbT5ODqoLifdN3Q.jpg'),
