(3063, 'Tilda Swinton', 'Katherine Matilda Swinton (5 de noviembre de 1960), conocida como Tilda Swinton, es una actriz y modelo británica de ascendencia escocesa. Aunque su carrera se ha centrado en el cine de autor y experimental, también ha aparecido en diversas películas populares y de éxito comercial como Only Lovers Left Alive, Constantine, La playa, The Chronicles of Narnia: The Lion, the Witch and the Wardrobe, El curioso caso de Benjamin Button, Doctor Strange y Avengers: Endgame.\n\nFue nominada al Globo de Oro ', 'London, England, UK', '1960-11-05', 'actualidad', 'Femenino', 30.898, 'https://image.tmdb.org/t/p/original/gWbX3a7V2MgRMRzekfITNcb27xV.jpg'),
(3084, 'Marlon Brando', 'Actor estadounidense, uno de los intérpretes más importantes de su generación y paradigma de la técnica de interpretación del Actor\'s Studio de Nueva York. Nació en Omaha, Nebraska, el 3 de abril de 1924 en el seno de una familia muy humilde. Debutó en Broadway en 1944. Fue descubierto gracias a su trabajo como Stanley Kowalski en Un tranvía llamado deseo (1947), de Tennessee Williams, personaje a medida para el estilo de interpretación naturalista del método de Lee Strasberg. Esta obra fue llev', 'Omaha, Nebraska, USA', '1924-04-03', '2004-07-01', 'Masculino', 25.136, 'https://image.tmdb.org/t/p/original/5o8whyfLBWXLODEcMP8K45lPTjT.jpg'),
(3085, 'James Caan', 'Actor estadounidense nacido en el Bronx (Nueva York). Desde finales de los años cincuenta trabaja como actor de teatro, primero en una compañía itinerante y más tarde en Broadway. Aunque llega al cine de la mano de Billy Wilder en Irma la Dulce (1963), será Howard Hawks quien le dé su primera gran oportunidad, primero en Peligro… Línea 7000 (1965), donde interpreta a un piloto de carreras y, sobre todo, en El Dorado (1967), enésima revisión del tema hawksiano de la redención de un grupo de hombr', 'The Bronx, New York, USA', '1940-03-26', '2022-07-06', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/v3flJtQEyczxENi29yJyvnN6LVt.jpg'),
