(3141, 'Marisa Tomei', 'Marisa Tomei (4 de diciembre de 1964) es una actriz de cine, teatro y televisión estadounidense. Tras su trabajo en As the World Turns, Tomei se hizo conocida como integrante del reparto de la secuela de The Cosby Show, A Different World, en 1987. Después de trabajar en un par de películas, su carrera se catapultó en 1992 con la comedia Mi primo Vinny, por la cual ganó el premio Óscar como mejor actriz de reparto.\n\nHabiendo actuado en varias películas a lo largo de los años, sus cintas más exito', 'Brooklyn, New York City, New York, USA', '1964-12-04', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/5w6qM8FWsl5SutKSpx6Va64eCTE.jpg'),
(3142, 'John Marley', 'John Marley (17 de octubre de 1907 - 22 de mayo de 1984) fue un actor estadounidense que fue conocido por su papel como Phil Cavalleri en Love Story (1971) y como Jack Woltz, magnate de la industria del cine que se encuentra la cabeza de su caballo en su cama en El Padrino (1972). También fue la iniciativa de John Cassavetes en Faces (1968).', 'New York City, New York, USA', '1907-10-17', '1984-05-22', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/anyn6VxuYreSRn2ggQiGIj2MOsm.jpg'),
