(3223, 'Robert Downey Jr.', 'Robert John Downey Jr. (4 de abril de 1965) es un actor, productor y cantante estadounidense, ganador de dos Globos de Oro y un BAFTA. Con cuatro décadas en el mundo del espectáculo, ha rodado más de 80 películas. Ha sido nominado dos veces a los Óscar: la primera en 1993 por su papel en Chaplin y la segunda en 2009 por Tropic Thunder.\n\nHa participado en películas tales como: Golpe al sueño americano (1987), Natural Born Killers (1994), Wonder Boys (2000), Kiss Kiss Bang Bang (2005), Fur: An Ima', 'New York City, New York, USA', '1965-04-04', 'actualidad', 'Masculino', 83.08, 'https://image.tmdb.org/t/p/original/5qHNjhtjMD4YWH3UP0rm4tKwxCL.jpg'),
