(3292, 'Nicholas Hoult', 'Nicholas Caradoc Hoult​ (7 de diciembre de 1989) es un actor y modelo británico.\n\nRealizó su debut profesional en el cine en 1996 con el filme Intimate Relations a la edad de 7 años, pero no fue hasta 2002 cuando ganó el reconocimiento internacional por la cinta About a Boy. Posteriormente realizó papeles más maduros en películas como la saga X-Men y Mad Max: Fury Road. También destaca su elogiada participación en la serie de televisión Skins, transmitida de 2007 a 2008.', 'Wokingham, England, UK', '1989-12-07', 'actualidad', 'Masculino', 35.566, 'https://image.tmdb.org/t/p/original/laeAYQVBV9U3DkJ1B4Cn1XhpT8P.jpg'),
(3293, 'Rachel Weisz', 'Rachel Weisz es una actriz y modelo inglesa, ganadora del Óscar, el Globo de Oro, el SAG, el Premio Laurence Olivier, el Independent Spirit Awards y otros premios cinematográficos. Ganó reconocimiento público por su interpretación de Evelyn «Evy» Carnahan-O’Connell en la serie cinematográfica La momia. En 2005 su actuación en El jardinero fiel (2005) le mereció el Premio Óscar de la Academia. Está considerada como una de las musas del cine independiente, trabajando en películas de reputados dire', 'Westminster, London, England, UK', '1970-03-07', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/msTqKPA33ryVtcVNgOdeaJGYq16.jpg'),
