(3381, 'Glenn Ford', 'Glenn Ford fue un actor canadiense de cine, ganador del premio Globo de Oro al mejor actor-Comedia o musical por Un gánster para un milagro (1961). Recordado por su actuación en la película Gilda (1946) junto a Rita Hayworth y en otros clásicos del cine estadounidense.\n\nHijo de un ejecutivo ferroviario canadiense, su familia se trasladó cuando él contaba con ocho años de edad a California. Con 19 años debuta como actor de teatro. Rueda su primera película con la 20th Century Fox, pero luego firm', ' Quebec City, Quebec, Canada ', '1916-05-01', '2006-08-30', 'Masculino', 25.051, 'https://image.tmdb.org/t/p/original/d6Vk69m5NAgMSgo4LmDm748wwm7.jpg'),
