(3623, 'Elena Anaya', 'Elena Anaya (nacida el 17 de julio de 1975) es una actriz española cuya carrera se remonta a 1995. Anaya nació en Palencia, España, el 17 de julio de 1975. Es la menor de 5 hijos. Recibió atención internacional por primera vez en 2001 por su papel en el drama sexualmente explícito Lucía y el sexo (Sex and Lucía) y también apareció en Hable con ella (Hable con ella) de Pedro Almodóvar. Su papel más conocido en la película de Hollywood fue como vampiro en 2004 en Van Helsing, interpretando a la no', 'Palencia, Palencia, Castilla y León, Spain', '1975-07-17', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/vZ5ewGX4mzwERL7MCFthRBcq2jz.jpg');
