(3810, 'Javier Bardem', 'Javier Ángel Encinas Bardem (Las Palmas de Gran Canaria, 1 de marzo de 1969), más conocido como Javier Bardem, es un actor español, hijo de la actriz española Pilar Bardem y proveniente de una familia de grandes actores españoles. En 2007, ganó el Premio Óscar al Mejor Actor de reparto por su papel como el psicópata asesino Anton Chigurh en No Country for Old Men (2007). También ha cosechado elogios de la crítica por papeles en películas tales como Jamón, jamón, Carne trémula, Boca a boca, Los l', 'Las Palmas de Gran Canaria, Gran Canaria, Canary Islands, Spain', '1969-03-01', 'actualidad', 'Masculino', 41.277, 'https://image.tmdb.org/t/p/original/IShnFg6ijWhpbu29dFBd9PtqQg.jpg'),
(3895, 'Michael Caine', 'Maurice Joseph Micklewhite​ (14 de marzo de 1933), más conocido como Michael Caine, es un prolífico actor británico. Famoso por su particular acento inglés de East End, Caine ha aparecido en más de 154 películas a lo largo de su carrera y es considerado un icono de la industria cinematográfica británica.\n\nLogró el reconocimiento del público en los sesenta con las cintas inglesas Zulu de 1964, Archivo confidencial de 1965, Alfie de 1966, por la cual aspiró al Óscar, The Italian Job de 1969 y La b', 'Rotherhithe, London, England, UK', '1933-03-14', 'actualidad', 'Masculino', 46.082, 'https://image.tmdb.org/t/p/original/hZruclwEPCKw3e83rnFSIH5sRFZ.jpg'),
