(9642, 'Jude Law', 'David Jude Heyworth Law (nacido en Lewisham, Londres, el 29 de diciembre de 1972), más conocido como Jude Law, es un actor de cine y teatro británico.\n\nDespués de una breve carrera en el teatro y la televisión, como en la serie Families (1990) que lo lanzó a la fama en su país natal, Jude Law se inicia en la gran pantalla en 1994 con el filme de ciencia ficción Shopping (1994), dirigido por Paul W.S. Anderson. Pero no fue hasta tres años más tarde, con la película Gattaca (1997) de Andrew Niccol', 'Lewisham, London, England, UK', '1972-12-29', 'actualidad', 'Masculino', 41.486, 'https://image.tmdb.org/t/p/original/6E8ixknAt2RD6ZmdZVNY8w6oRqJ.jpg'),
