(10205, 'Sigourney Weaver', 'Susan Alexandra Weaver, más conocida como Sigourney Weaver (8 de octubre de 1949), es una actriz y productora estadounidense de cine, televisión y teatro. Ha sido candidata a los Premios Óscar y a los Premios del Sindicato de Actores.​ Ha sido ganadora de dos Globo de Oro en las categorías de mejor actriz en drama y mejor actriz de reparto, y de un BAFTA a la mejor actriz de reparto.​ Es conocida por sus intervenciones como la teniente Ripley en varias películas de la saga de Alien: Alien, el oc', 'Manhattan, New York City, New York, USA', '1949-10-08', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/wTSnfktNBLd6kwQxgvkqYw6vEon.jpg'),
