(10990, 'Emma Watson', 'Emma Charlotte Duerre Watson​ (París, 15 de abril de 1990) es una actriz, modelo y activista británica nacida en Francia, conocida principalmente por haber interpretado el personaje de Hermione Granger en la saga de películas de Harry Potter.\n\nFue elegida para interpretar a Hermione a la edad de nueve años, después de haber participado anteriormente solo en obras de teatro escolares.2​ Protagonizó, junto con Daniel Radcliffe y Rupert Grint, las ocho películas de la serie cinematográfica.3​ Debid', 'Paris, France', '1990-04-15', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/tvPPRGzAzdQFhlKzLbMO1EpuTJI.jpg'),
(10993, 'Tom Felton', 'Thomas Andrew Felton​ (22 de septiembre de 1987) es un actor y músico británico, conocido por interpretar a Draco Malfoy en la serie de películas de Harry Potter. Antes de ser elegido para interpretar a Draco Malfoy, participó (con resultados negativos) en los cástines para Harry Potter y para Ron Weasley.  Fue elegido para interpretar a Draco a la edad de once años, luego de haber participado en The Borrowers (1997), y Anna and the King (1999).2​Apareció en las ocho películas de la serie cinema', 'Kensington, London, England, UK', '1987-09-22', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/etmtUBzJ1i1XJTLS6MkotJFE1se.jpg'),
