(11107, 'Ben Foster', 'Ben Foster (nacido el 29 de octubre de 1980) es un actor estadounidense. Sus papeles cinematográficos incluyen The Laramie Project, Liberty Heights, Get Over It, Hostage, X-Men: The Last Stand, Alpha Dog, 30 Days of Night, The Messenger, Bang Bang You\'re Dead y Pandorum. Recibió nominaciones a mejor actor de reparto de los premios Saturn y Satellite por su papel del 2007 en la película 3:10 to Yuma.', 'Boston, Massachusetts, USA', '1980-10-29', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/4le1PMWTGp7y2IBmZEIOHfE3HAB.jpg'),
(11111, 'Lucy Davis', 'Lucy Davis (2 de enero de 1973) es una actriz británica.\n\nEs conocida por interpretar a Dawn Tinsley en la serie de televisión de comedia The Office, transmitida por la BBC. También interpretó a Dianne en la película Shaun of the Dead, a Etta Candy en Wonder Woman, y a Hilda Spellman en la serie de Netflix Chilling Adventures of Sabrina.​', 'Solihull, West Midlands, England, UK', '1973-02-17', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/A1ymILbxQA5w5TduCNaU0xD9C5a.jpg'),
(11150, 'Gina Gershon', 'Es una actriz estadounidense que alcanzó fama internacional por su papel en Showgirls (1995). Estudió en el Emerson College de Boston, en la Tisch School of the Arts y en el Circle in the Square Theatre también de New York.\n\nDebutó en 1984, en el vídeo \"Hello Again\" de Andy Warhol. En 1988 encadenó papeles en dos películas de éxito comercial: Cocktail, uno de los primeros taquillazos de Tom Cruise, y Red Heat (Danko: calor rojo), uno de los filmes más populares de Arnold Schwarzenegger.\n\nSu gran', 'San Fernando Valley, California, USA', '1962-06-10', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/c9PpXfQ5XN5IYISUTexXMF19cax.jpg'),
