(11160, 'Danny Trejo', 'Dan \"Danny\" Trejo (Echo Park, Los Ángeles, 16 de mayo de 1944) es un actor estadounidense de origen mexicano. Ha trabajado en múltiples películas de Hollywood, en general haciendo papeles secundarios como antagonista o antihéroe y es conocido por películas como Heat, Con Air, Desperado, Animal Factory, Predators, From Dusk Till Dawn, la tetralogía de Spy Kids y como protagonista en Machete.\n\nHa desarrollado una carrera en el negocio cinematográfico a través de un camino poco común. Desde estar e', 'Los Angeles, California, USA', '1944-05-16', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/7JrUkRGBscZ1Hy5JinaaXjjzSCF.jpg'),
