(11181, 'Kenneth Branagh', 'Actor, director y productor británico, considerado internacionalmente como uno de los actores/directores más relevantes de su generación. Nacido en Belfast, su familia se trasladó a Reading, en Berkshire, cuando él tenía diez años. Estudió en la Royal Academy of Dramatic Arts (RADA) hasta 1981. Su primer compromiso profesional fue para actuar en la obra de Julian Mitchell Another country (Otro país) en el Queen\'s Theatre, Londres, actuación por la que recibió el premio de la Sociedad de teatros ', 'Belfast, Northern Ireland, UK', '1960-12-10', 'actualidad', 'Masculino', 31.151, 'https://image.tmdb.org/t/p/original/AbCqqFxNi5w3nDUFdQt0DGMFh5H.jpg'),
(11207, 'David Thewlis', 'David Wheeler (20 de marzo de 1963), conocido artísticamente como David Thewlis, es un actor británico de cine, televisión y teatro.\n\nEs conocido por su papel de Remus Lupin​ en las películas de Harry Potter y por su participación en películas como: Naked de Mike Leigh, Total Eclipse de Agnieszka Holland, La isla del doctor Moreau de John Frankenheimer, Siete años en el Tíbet de Jean-Jacques Annaud, War Horse de Steven Spielberg y Wonder Woman de Patty Jenkins. En 2017 desempeñó un papel protago', 'Blackpool, Lancashire, England, UK', '1963-03-20', 'actualidad', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/sNuYyT8ocLlQr3TdAW9CoKVbCU8.jpg'),
