(18182, 'Olga Kurylenko', 'Olga Kurylenko nació el 14 de noviembre de 1979 en Berdyansk, Ucrania, Unión Soviética. Su madre, Marina Alyabysheva, se divorció de su padre, Konstantin Kurylenko, poco después de su nacimiento. Después del divorcio, su madre luchó por sobrevivir como profesora de arte. La joven Olga Kurylenko fue criada por su madre y su abuela, Raisa. Durante su juventud, Olga tuvo la humillante experiencia de vivir en la pobreza; no tuvo más remedio que usar harapos y tuvo que zurcir los agujeros de su suéte', 'Berdiansk, Ukrainian SSR, USSR [now Zaporizhzhia Oblast, Ukraine]', '1979-11-14', 'actualidad', 'Femenino', 1.4, 'https://image.tmdb.org/t/p/original/wsg2PEspkTzaOJUxz6RCjrqO4Qy.jpg'),
