(44860, 'Franco Citti', 'Franco Citti  fue un actor italiano. \n\nEs conocido por su participación a los 26 años en Accattone (1961) de Pier Paolo Pasolini. Siguió colaborando con Pasolini en varias películas más.\n\nSiempre con Pasolini en 1968 protagonizó la versión Edipo Rey y en uno de los cuentos de Il Decameron (1971). También es conocido por su participación en El padrino (1972) como uno de los guardaespaldas de Michael Corleone en Sicilia y en El padrino III (1990).', 'Roma, Lazio, Italia', '1935-04-23', '2016-01-14', 'Masculino', 1.4, 'https://image.tmdb.org/t/p/original/mttQPjOHaql4RKsfYriUA7HuROE.jpg'),
