INSERT INTO `pelicula` (`id`, `titulo`, `sinopsis`, `duracion`, `presupuesto`, `ganancias`, `fecha_estreno`, `pais_origen`, `web`, `popularidad`, `valoracion`, `total_votos`, `fondo`, `poster`, `adulto`) VALUES
(11, 'La guerra de las galaxias', 'La princesa Leia, líder del movimiento rebelde que desea reinstaurar la República en la galaxia en los tiempos ominosos del Imperio, es capturada por las malévolas Fuerzas Imperiales, capitaneadas por el implacable Darth Vader, el sirviente más fiel del emperador. El intrépido Luke Skywalker, ayudado por Han Solo, capitán de la nave espacial \"El Halcón Milenario\", y los androides, R2D2 y C3PO, serán los encargados de luchar contra el enemigo y rescatar a la princesa para volver a instaurar la justicia en el seno de la Galaxia.', 121, 11000000, 775398000, '1977-05-25', 'US', '', 415.891, 8.203, 19977, 'https://image.tmdb.org/t/p/original/4qCqAdHcNKeAHcK8tJ8wNJZa9cx.jpg', 'https://image.tmdb.org/t/p/original/ahT4ObS7XKedQkOSpGr1wQ97aKA.jpg', ''),
(13, 'Forrest Gump', 'Forrest Gump es un chico con deficiencias mentales no muy profundas y con alguna incapacidad motora que, a pesar de todo, llegará a convertirse, entre otras cosas, en un héroe durante la Guerra del Vietnam. Su persistencia y bondad le llevarán a conseguir una gran fortuna, ser objeto del clamor popular y a codearse con las más altas esferas sociales y políticas del país. Siempre sin olvidar a Jenny, su gran amor desde que era niño.', 142, 55000000, 677388000, '1994-06-23', 'US', '', 234.257, 8.476, 26584, 'https://image.tmdb.org/t/p/original/qdIMHd4sEfJSckfVJfKQvisL02a.jpg', 'https://image.tmdb.org/t/p/original/oiqKEhEfxl9knzWXvWecJKN3aj6.jpg', ''),
(14, 'American Beauty', 'Divertida, inquietante y sorprendente incursión en la América suburbana a través de las vidas de Lester y Carolyn, una pareja perteneciente a la clase medio-alta cuyo matrimonio -y cuyas vidas- lentamente se deshacen. Carolyn odia a su marido, su hija lo desprecia y su jefe está a punto de despedirlo. Así que Lester decide cambiar algunas cosas en su vida; a medida que va siendo más libre, consigue ser más feliz, lo que enfurece más a su esposa y a su hija.', 122, 15000000, 356297000, '1999-09-15', 'US', '', 227.294, 8.019, 11698, 'https://image.tmdb.org/t/p/original/DztBnZaqmla2sGUW9s8AyOmskT.jpg', 'https://image.tmdb.org/t/p/original/yx9JwYPVSEP1bFGpG3FeGPgOKoK.jpg', ''),
(15, 'Ciudadano Kane', 'Un importante financiero estadounidense, Charles Foster Kane, dueño de una importante cadena de periódicos, de una red de emisoras, de dos sindicatos y de una inimaginable colección de obras de arte, muere en su fabuloso castillo de estilo oriental, Xanadú. La última palabra que pronuncia al expirar es Rosebud. El país entero y la prensa en general quedan intrigados por saber el significado de esta palabra. Para descubrirlo, un grupo de periodistas se pone a investigar.', 119, 839727, 23218000, '1941-04-17', 'US', 'http://diskokosmiko.mx/PukinG/peliculas-antiguas-4-42339/ciudadano-kane-1941,497724.mp4', 337.336, 8.009, 5297, 'https://image.tmdb.org/t/p/original/ruF3Lmd4A8MHbnEBE6lxPMbsHGL.jpg', 'https://image.tmdb.org/t/p/original/w7V0bv38Z0q0DgHmMfcGM4WRNTv.jpg', ''),
(18, 'El quinto elemento', 'Cada 5.000 años se abre una puerta entre las dimensiones. En una dimensión existe el Universo y la vida. En la otra dimensión existe un elemento que no está hecho ni de tierra, ni de fuego, ni de aire, ni de agua, sino que es una anti-energía, la anti-vida: es el quinto elemento.', 127, 90000000, 263920000, '1997-05-02', 'FR', '', 167.894, 7.546, 10393, 'https://image.tmdb.org/t/p/original/gEFe2joIQUopBmMPXOHPxuX2f4u.jpg', 'https://image.tmdb.org/t/p/original/4IgMSK6ehZcfniZoWFRLSxEPcHS.jpg', ''),
(19, 'Metrópolis', 'En una megalópolis del año 2000, los obreros están condenados a vivir recluidos en un gueto subterráneo, donde se encuentra el corazón industrial de la ciudad. Sin embargo, incitados por un robot, se rebelan contra la clase dominante y amenazan con destruir la ciudad exterior. Freder (Gustav Frölich), el hijo del soberano de Metrópolis, y María, una muchacha de origen humilde, intentarán evitar la destrucción apelando a los sentimientos y al amor.', 153, 1300000, 650422, '1927-02-06', 'DE', '', 250.534, 8.1, 2605, 'https://image.tmdb.org/t/p/original/rnN9yJfwso6JA64wIPqK1m6K6e1.jpg', 'https://image.tmdb.org/t/p/original/fCWd45ybxghuvaeSMcBsLFKY6PG.jpg', ''),
(22, 'Piratas del Caribe: La maldición de la Perla Negra', 'El aventurero capitán Jack Sparrow recorre las aguas caribeñas. Pero su andanzas terminan cuando su enemigo, el capitán Barbossa le roba su barco, la Perla Negra, y ataca la ciudad de Port Royal, secuestrando a Elizabeth Swann, hija del gobernador. Will Turner, el amigo de la infancia de Elizabeth, se une a Jack para rescatarla y recuperar la Perla Negra. Pero el prometido de Elizabeth, comodoro Norrington, les persigue a bordo del HMS Impávido. Además, Barbossa y su tripulación son víctimas de un conjuro por el que están condenados a vivir eternamente, y a transformarse cada noche en esqueletos vivientes, en fantasmas guerreros.', 143, 140000000, 655011000, '2003-07-09', 'US', '', 135.208, 7.8, 19972, 'https://image.tmdb.org/t/p/original/wW7Wt5bXzPy4VOEE4LTIUDyDgBo.jpg', 'https://image.tmdb.org/t/p/original/8zHnkTGyAImBcI49a1xFJHUjbaK.jpg', ''),
(62, '2001: Una odisea del espacio', 'Hace millones de años, en los albores del nacimiento del homo sapiens, unos simios descubren un monolito que les lleva a un estadio de inteligencia superior. Otro monolito vuelve a aparecer, millones de años después, enterrado en una luna, lo que provoca el interés de los científicos humanos. Por último, HAL 9000, una máquina de inteligencia artificial, es la encargada de todos los sistemas de una nave espacial tripulada durante una misión de la NASA.', 141, 12000000, 71923600, '1968-04-02', 'US', '', 387.269, 8.078, 11078, 'https://image.tmdb.org/t/p/original/w5IDXtifKntw0ajv2co7jFlTQDM.jpg', 'https://image.tmdb.org/t/p/original/sln50uQYigvu5AvN72JfYfu1ckq.jpg', ''),
(103, 'Taxi Driver', 'Para sobrellevar el insomnio crónico que sufre después de su regreso de Vietnam, Travis decide trabajar como taxista nocturno. Como individuo tiene poco contacto con la gente, pero observa la violencia y desolación en la que se hunde la ciudad de Nueva York. Travis anota en su diario todas sus impresiones, hasta que un día decide pasar a la acción.', 113, 1900000, 28600000, '1976-02-09', 'US', '', 343.8, 8.152, 11761, 'https://image.tmdb.org/t/p/original/6aoyUbvu0419XLKLIMoH0TkEicH.jpg', 'https://image.tmdb.org/t/p/original/9G26DnAeMbA4sp58Gi0Vze6eQv4.jpg', ''),
(106, 'Depredador', 'Un comando de mercenarios es contratados por la CIA para rescatar a unos pilotos apresados por las guerrillas en la selva Centroamericana. La misión resulta satisfactoria, pero durante su viaje de regreso se dan cuenta de que algo está dándoles caza uno a uno, ese algo resulta ser un cazador alienígena que se queda con las calaveras de sus víctimas como trofeos', 102, 15000000, 98267600, '1987-06-12', 'US', '', 378.224, 7.525, 7705, 'https://image.tmdb.org/t/p/original/YL3GPOiDcNraIJOVDCZsoOBoDy.jpg', 'https://image.tmdb.org/t/p/original/bzLLeqhNBNmO6WImHrrmLNyhMxi.jpg', ''),
(111, 'El precio del poder', 'Un emigrante cubano frío y sanguinario, Tony Montana, llega de Cuba para instalarse en Miami, donde se propone hacerse con un nombre dentro del crimen organizado de Florida. Junto a su amigo, Manny Rivera, inicia una ascendente carrera delictiva.', 170, 25000000, 66023300, '1983-12-09', 'US', '', 349.351, 8.169, 11338, 'https://image.tmdb.org/t/p/original/sctvs9cUwJD15qlTlrsh2BXsK75.jpg', 'https://image.tmdb.org/t/p/original/iDABT5GD9OQmFiXM3wR0DJIxtkY.jpg', ''),
(120, 'El señor de los anillos: La comunidad del anillo', 'En la Tierra Media, el Señor Oscuro Saurón creó los Grandes Anillos de Poder, forjados por los herreros Elfos. Tres para los reyes Elfos, siete para los Señores Enanos, y nueve para los Hombres Mortales. Secretamente, Saurón también forjó un anillo maestro, el Anillo Único, que contiene en sí el poder para esclavizar a toda la Tierra Media. Con la ayuda de un grupo de amigos y de valientes aliados, Frodo emprende un peligroso viaje con la misión de destruir el Anillo Único. Pero el Señor Oscuro Sauron, quien creara el Anillo, envía a sus servidores para perseguir al grupo. Si Sauron lograra recuperar el Anillo, sería el final de la Tierra Media.', 179, 93000000, 871368000, '2001-12-18', 'US', '', 138.047, 8.412, 24315, 'https://image.tmdb.org/t/p/original/x2RS3uTcsJJ9IfjNPcgDmukoEcQ.jpg', 'https://image.tmdb.org/t/p/original/9xtH1RmAzQ0rrMBNUMXstb2s3er.jpg', ''),
(122, 'El señor de los anillos: El retorno del rey', 'Las fuerzas de Saruman han sido destruidas, y su fortaleza sitiada. Ha llegado el momento de que se decida el destino de la Tierra Media, y por primera vez en mucho tiempo, parece que hay una pequeña esperanza. La atención del señor oscuro Sauron se centra ahora en Gondor, el último reducto de los hombres, y del cual Aragorn tendrá que reclamar el trono para ocupar su puesto de rey. Pero las fuerzas de Sauron ya se preparan para lanzar el último y definitivo ataque contra el reino de Gondor, la batalla que decidirá el destino de todos. Mientras tanto, Frodo y Sam continuan su camino hacia Mordor, a la espera de que Sauron no repare en que dos pequeños Hobbits se acercan cada día más al final de su camino, el Monte del Destino.', 202, 94000000, 1118890000, '2003-12-01', 'US', '', 110.736, 8.479, 23371, 'https://image.tmdb.org/t/p/original/2u7zbn8EudG6kLlBzUYqP8RyFU4.jpg', 'https://image.tmdb.org/t/p/original/mWuFbQrXyLk2kMBKF9TUPtDwuPx.jpg', ''),
(141, 'Donnie Darko', 'Donnie es un chico americano dotado de gran inteligencia e imaginación. Tras escapar milagrosamente de una muerte casi segura, comienza a sufrir alucinaciones que lo llevan a actuar como nunca hubiera imaginado y a descubrir un mundo insólito a su alrededor, pues en sus visiones un gran conejito lo manipula para cometer una serie de crímenes.', 113, 4500000, 7500000, '2001-01-19', 'US', '', 361.095, 7.779, 12006, 'https://image.tmdb.org/t/p/original/8eLXy49T36e0e1YhYvUQOCXNRhm.jpg', 'https://image.tmdb.org/t/p/original/1YjDHBC4v2O7IQDKYAiM8fOxzf3.jpg', ''),
(213, 'Con la muerte en los talones', 'Debido a un malentendido, a Roger O. Thornhill, un ejecutivo del mundo de la publicidad, unos espías lo confunden con un agente del gobierno llamado George Kaplan. Secuestrado por tres individuos y llevado a una mansión en la que es interrogado, consigue huir antes de que lo maten. Cuando al día siguiente regresa a la casa acompañado de la policía, no hay rastro de las personas que había descrito.', 136, 4000000, 13275000, '1959-07-08', 'US', '', 147.719, 7.985, 3920, 'https://image.tmdb.org/t/p/original/OR8oloCZ3klJtB7Y0i8pSqWw5a.jpg', 'https://image.tmdb.org/t/p/original/8r81l0fxwB5uxlAHzVXZ6IhO0o9.jpg', ''),
(218, 'Terminator', 'Un cyborg ha sido enviado desde el futuro en una misión mortal: eliminar a Sarah Connor, una joven cuya vida tendrá una gran importancia en los próximos años. Sarah tiene sólo un protector —Kyle Reese— también enviado desde el futuro. El Terminator utiliza su inteligencia excepcional y fuerza para encontrar a Sarah, pero ¿hay alguna forma de detener al cyborg aparentemente indestructible?', 108, 6400000, 78371200, '1984-10-26', 'US', '', 407.719, 7.663, 12518, 'https://image.tmdb.org/t/p/original/6dpnthrofbqWmvapUyvqCrkdHG.jpg', 'https://image.tmdb.org/t/p/original/kbPqRWsGS1siVUeEFVtLKloTG0Y.jpg', ''),
(235, 'Cuenta conmigo', 'En un pequeño pueblo de Oregon, cuatro jóvenes amigos salen de la ciudad en busca de un chico desaparecido: el sentimental Geordie, el rudo Chris, el extravagante Teddy y el miedosa Vern. Deseando ser vistos como héroes ante ellos mismos y ante los ojos del pueblo, emprenden una inolvidable excursión de dos días que se convierte en una aventura increíble. Fuman a escondidas, cuentan historias, sueltan tacos porque les gusta y hacen causa común cuando las cosas se ponen difíciles. Cuando se encuentran con los matones del pueblo, que armados de cuchillos también buscan el cuerpo, los chicos descubren una fuerza que nunca supieron que tenían.', 89, 8000000, 52300000, '1986-08-08', 'US', '', 301.049, 7.852, 5619, 'https://image.tmdb.org/t/p/original/yjGllQUm28R4X9xD9T5xMszirgw.jpg', 'https://image.tmdb.org/t/p/original/1J6shezdRbtdeoYHSYmi4oUIWkD.jpg', ''),
(238, 'El padrino', 'Don Vito Corleone, conocido dentro de los círculos del hampa como \'El Padrino\', es el patriarca de una de las cinco familias que ejercen el mando de la Cosa Nostra en Nueva York en los años cuarenta. Don Corleone tiene cuatro hijos: una chica, Connie, y tres varones; Sonny, Michael y Fredo. Cuando el Padrino reclina intervenir en el negocio de estupefacientes, empieza una cruenta lucha de violentos episodios entre las distintas familias del crimen organizado.', 175, 6000000, 245066000, '1972-03-14', 'US', '', 136.675, 8.696, 19812, 'https://image.tmdb.org/t/p/original/tmU7GeKVybMWFButWEGl2M4GeiP.jpg', 'https://image.tmdb.org/t/p/original/5HlLUsmsv60cZVTzVns9ICZD6zU.jpg', ''),
(240, 'El padrino. Parte II', 'Continuación de la saga de los Corleone con dos historias paralelas: la elección de Michael Corleone como jefe de los negocios familiares y los orígenes del patriarca, el ya fallecido Don Vito, primero en Sicilia y luego en Estados Unidos, donde, empezando desde abajo, llegó a ser un poderosísimo jefe de la mafia de Nueva York.', 200, 13000000, 102600000, '1974-12-20', 'US', '', 150.787, 8.578, 11960, 'https://image.tmdb.org/t/p/original/kGzFbGhp99zva6oZODW5atUtnqi.jpg', 'https://image.tmdb.org/t/p/original/mbry0W5PRylSUHsYzdiY2FSJwze.jpg', ''),
(242, 'El padrino. Parte III', 'Michael Corleone, heredero del imperio de don Vito Corleone, intenta rehabilitarse socialmente y legitimar todas las posesiones de la familia negociando con el Vaticano. Después de luchar toda su vida se encuentra cansado y centra todas sus esperanzas en encontrar un sucesor que se haga cargo de los negocios. Vincent, el hijo ilegítimo de su hermano Sonny, parece ser el elegido.', 162, 54000000, 136766000, '1990-12-25', 'US', '', 165.138, 7.425, 5947, 'https://image.tmdb.org/t/p/original/zNnjHLDtV8Ti3aworltaeaLMov4.jpg', 'https://image.tmdb.org/t/p/original/l2D8Gzuzw8hN41UthdqM9Osu9I3.jpg', ''),
(272, 'Batman Begins', '¿Cómo cambia un hombre el mundo? Es una pregunta que obsesiona a Bruce Wayne al igual que el fantasma de sus padres, muertos a tiros ante sus ojos en las calles de Gotham una noche que cambió su vida para siempre. Atormentado por la culpa y la ira, el desilusionado heredero industrial desaparece de Gotham y viaja en secreto por el mundo, buscando los medios de luchar contra la injusticia y utilizar el miedo contra los que se aprovechan de los que tienen miedo. Con la ayuda de su leal mayordomo Alfred, el detective Jim Gordon - uno de los pocos buenos policías de las fuerzas del orden público de Gotham - y Lucius Fox, su aliado en la división de Ciencias Aplicadas de Wayne Enterprises, Bruce Wayne libera a su imponente alter ego: Batman, un justiciero enmascarado que utiliza la fuerza, la inteligencia y un despliegue de artefactos de alta tecnología para combatir las fuerzas siniestras que amenazan con destruir la ciudad.', 140, 150000000, 374219000, '2005-06-10', 'US', '', 184.736, 7.705, 20353, 'https://image.tmdb.org/t/p/original/lh5lbisD4oDbEKgUxoRaZU8HVrk.jpg', 'https://image.tmdb.org/t/p/original/6yMWU1vWkOBbNRIwOxhetd2aHhO.jpg', ''),
(278, 'Cadena perpetua', 'Acusado del asesinato de su mujer, Andrew Dufresne, tras ser condenado a cadena perpetua, es enviado a la prisión de Shawshank. Con el paso de los años conseguirá ganarse la confianza del director del centro y el respeto de sus compañeros presidiarios, especialmente de Red, el jefe de la mafia de los sobornos.', 143, 25000000, 28341500, '1994-09-23', 'US', '', 136.444, 8.704, 26128, 'https://image.tmdb.org/t/p/original/kXfqcdQKsToO0OUXHcrrNCHDBzO.jpg', 'https://image.tmdb.org/t/p/original/uRRTV7p6l2ivtODWJVVAMRrwTn2.jpg', ''),
(289, 'Casablanca', 'Durante la Segunda Guerra Mundial, Casablanca era una ciudad a la que llegaban huyendo del nazismo gentes de todas partes: llegar era fácil, pero salir era casi imposible, especialmente si el nombre del fugitivo figuraba en las listas de la Gestapo. En esta ocasión el principal objetivo de la policía secreta alemana es el líder checo y héroe de la resistencia Victor Laszlo, cuya única esperanza es Rick Blaine, propietario del \'Rick’s Café\' y antiguo amante de su mujer, Ilsa. Cuando Ilsa se ofrece a quedarse a cambio de un visado para sacar a Laszlo del país, Rick deberá elegir entre su propia felicidad o el idealismo que rigió su vida en el pasado.', 102, 878000, 10462500, '1943-01-15', 'US', '', 167.56, 8.16, 5201, 'https://image.tmdb.org/t/p/original/87wqeMeUeMRLjsE1IWNKJcPlpuC.jpg', 'https://image.tmdb.org/t/p/original/tLAJvphWBn5tbm8uehlfXcuBnTz.jpg', ''),
(345, 'Eyes Wide Shut', 'William Harford es un respetable médico neoyorquino cuya vida parece ir muy bien: está casado con una preciosa mujer, tiene una hija y tiene un trabajo que le gusta. Pero, al día siguiente de asistir a una fiesta, su esposa Alice le habla de unas fantasías eróticas y de cómo estuvo a punto de romper su matrimonio por un desconocido. Abrumado por esta confesión, acaba entrando en un local, donde un antiguo compañero le habla de una congregación secreta dedicada al hedonismo y al placer sin límites. A partir de entonces un mundo dominado por el sexo y el erotismo se abre ante él.', 159, 65000000, 162100000, '1999-07-16', 'GB', '', 227.35, 7.5, 5897, 'https://image.tmdb.org/t/p/original/vYA4qUPWY0EbjpcIXAL4h4pVmTC.jpg', 'https://image.tmdb.org/t/p/original/a0YOhU3zq0RkOYrVlPXCeE1oFkR.jpg', ''),
(348, 'Alien, el octavo pasajero', 'De regreso a la Tierra, la nave de carga Nostromo interrumpe su viaje y despierta a sus siete tripulantes. El ordenador central, MADRE, ha detectado la misteriosa transmisión de una forma de vida desconocida, procedente de un planeta cercano aparentemente deshabitado. La nave se dirige entonces al extraño planeta para investigar el origen de la comunicación.', 117, 11000000, 104932000, '1979-05-25', 'GB', '', 404.432, 8.152, 13925, 'https://image.tmdb.org/t/p/original/AmR3JG1VQVxU8TfAvljUhfSFUOx.jpg', 'https://image.tmdb.org/t/p/original/pZ9cAe5FxexJjpCaeiETbXzz3Fs.jpg', ''),
(411, 'Las crónicas de Narnia: El león, la bruja y el armario', 'La historia narra las aventuras de cuatro hermanos: Lucy, Edmund, Susan y Peter, que durante la Segunda Guerra Mundial descubren el mundo de Narnia, al que acceden a través de un armario mágico mientras juegan al escondite en la casa de campo de un viejo profesor. En Narnia descubrirán un mundo increíble habitado por animales que hablan, duendes, faunos, centauros y gigantes al que la Bruja Blanca- Jadis- ha condenado al invierno eterno. Con la ayuda del león Aslan, el noble soberano, los niños lucharán para vencer el poder que la Bruja Blanca ejerce sobre Narnia en una espectacular batalla y conseguir así liberarle de la maldición del frío.', 143, 180000000, 745013000, '2005-12-07', 'US', '', 161.775, 7.134, 10266, 'https://image.tmdb.org/t/p/original/9iRRfMZbnpgHDdKi2lczGGYZXDo.jpg', 'https://image.tmdb.org/t/p/original/vnyDtI6aMZ2TtAjrmNsKBIeoea9.jpg', ''),
(414, 'Batman Forever', 'La ciudad de Gotham está amenazada de nuevo. Esta vez, se trata de una maligna pareja compuesta por Dos Caras y Enigma, que procurarán alterar la paz de sus conciudadanos y del mundo entero para siempre. Por este motivo, Bruce Wayne deberá enfundarse otra vez el traje de Batman y luchar contra ellos; pero esta vez no estará solo, ya que será acompañado por el joven Robin.', 121, 100000000, 336529000, '1995-06-16', 'US', '', 159.973, 5.423, 4975, 'https://image.tmdb.org/t/p/original/snlu32RmjldF9b068UURJg8sQtn.jpg', 'https://image.tmdb.org/t/p/original/wg6BN76E9iIEtiawMJnCecY0zgY.jpg', ''),
(415, 'Batman y Robin', 'Unos experimentos de criogenia han convertido al Dr. Victor Fries en el malvado Mr. Freeze, un villano que necesita mantener su cuerpo a temperaturas gélidas y que, por ello, intentará congelar a todos los habitantes de la ciudad de Gotham. Por otro lado, la tímida botánica Pamela Isley se transformará en el transcurso de un experimento en la terrible Hiedra Venenosa, que querrá asesinar a todos los seres humanos de la tierra, para que las plantas recuperen su hegemonía sobre el planeta. Por este motivo, Batman y Robin deberán enfrentarse a ellos y detener sus siniestros planes.', 125, 125000000, 238207000, '1997-06-20', 'US', '', 165.134, 4.353, 4824, 'https://image.tmdb.org/t/p/original/tgPFZxhDuxWd4VXYaz8eAUznGTF.jpg', 'https://image.tmdb.org/t/p/original/gJAvyXHdIjeKHS07Dlim7LETBEK.jpg', ''),
(489, 'El indomable Will Hunting', 'Will es un joven rebelde con una inteligencia asombrosa, especialmente con las matemáticas. El descubrimiento de su talento por parte de los académicos le obligará a elegir entre seguir con su vida de siempre -un trabajo fácil, buenos amigos, muchas cervezas y alguna bronca- o aprovechar sus grandes cualidades intelectuales en alguna universidad. Sólo los consejos de un solitario y bohemio profesor le ayudará a decidirse.', 126, 10000000, 225900000, '1997-12-05', 'US', '', 256.066, 8.155, 11827, 'https://image.tmdb.org/t/p/original/bpV8wn48s82au37QyUJ51S7X2Vf.jpg', 'https://image.tmdb.org/t/p/original/4Yy63A10sPQZ9kd2kWj13S4WUkn.jpg', ''),
(509, 'Notting Hill', 'La historia se centra en William, propietario de una tienda de libros en el popular barrio londinense de Notting Hill, y Anna Scott, la estrella más rutilante del firmamento cinematográfico. Desde el momento en que la actriz entra en la tienda, William se embarca en un cortejo complicado, para el cual cuenta con la inestimable ayuda de sus inseparables amigos, entre los que destaca su compañero de piso el singular Spike, que observa con asombro e incredulidad cómo el bueno de William tiene un romance con una mujer inalcanzable para cualquier otro ser humano.', 124, 42000000, 363890000, '1999-05-21', 'GB', '', 147.601, 7.262, 5819, 'https://image.tmdb.org/t/p/original/mqcqAE8yefvezVJ78FINJCiV6n3.jpg', 'https://image.tmdb.org/t/p/original/8JBfE9HYudCyosnchh1aZqj0xcM.jpg', ''),
(525, 'Granujas a todo ritmo (The Blues Brothers)', 'Tras pasar años en la cárcel por robo a mano armada, Jake Blues es puesto en libertad por buen comportamiento. Sale de prisión vestido de la misma forma en la que entró: traje y sombrero negro y gafas oscuras. En la puerta le espera su hermano Elwood vestido de idéntica manera. Ahora, el único hogar que conocieron está en peligro. El orfelinato de Santa Elena necesita una gran cantidad de dinero. Los hermanos se ponen manos a la obra.', 133, 27000000, 115200000, '1980-06-16', 'US', '', 244.073, 7.741, 4020, 'https://image.tmdb.org/t/p/original/bk2fTuIhQIvdAA3RbnrnvLvuaTc.jpg', 'https://image.tmdb.org/t/p/original/TtkkCYdchVH162OdWenl3SnxZp.jpg', ''),
(550, 'El club de la lucha', 'Un joven sin ilusiones lucha contra su insomnio, consecuencia quizás de su hastío por su gris y rutinaria vida. En un viaje en avión conoce a Tyler Durden, un carismático vendedor de jabón que sostiene una filosofía muy particular: el perfeccionismo es cosa de gentes débiles; en cambio, la autodestrucción es lo único que hace que realmente la vida merezca la pena. Ambos deciden entonces formar un club secreto de lucha donde descargar sus frustaciones y su ira que tendrá un éxito arrollador.', 139, 63000000, 100854000, '1999-10-15', 'US', '', 250.297, 8.441, 28492, 'https://image.tmdb.org/t/p/original/hZkgoQYus5vegHoetLkCJzb17zJ.jpg', 'https://image.tmdb.org/t/p/original/sgTAWJFaB2kBvdQxRGabYFiQqEK.jpg', ''),
(578, 'Tiburón', 'En la costa de un pequeño pueblo del Este de Estados Unidos, un enorme tiburón ataca a varias personas. Temiendo las fatales consecuencias que esto puede provocar en el negocio turístico, el alcalde se niega a cerrar las playas y a difundir la noticia. Pero un nuevo ataque del tiburón, en la propia playa, termina con la vida de otro bañista. El terror se ha hecho público, así que un veterano cazador de tiburones, un científico y el jefe de la policía local se unen para dar caza al temible escualo...', 124, 7000000, 470653000, '1975-06-20', 'US', '', 295.757, 7.661, 9995, 'https://image.tmdb.org/t/p/original/3nYlM34QhzdtAvWRV5bN4nLtnTc.jpg', 'https://image.tmdb.org/t/p/original/aCqHb3eFQV8raX30OfGurqPlpjh.jpg', ''),
(585, 'Monstruos, S.A.', 'Monsters Inc. es la mayor empresa de miedo del mundo, y James P. Sullivan es uno de sus mejores empleados. Asustar a los niños no es un trabajo fácil, ya que todos creen que los niños son tóxicos y no pueden tener contacto con ellos. Pero un día una niña se cuela sin querer en la empresa, provocando el caos.', 88, 115000000, 579700000, '2001-11-01', 'US', '', 139.531, 7.842, 17883, 'https://image.tmdb.org/t/p/original/puo6orN2BjQt1g4K0umVlooVff9.jpg', 'https://image.tmdb.org/t/p/original/g3SgHEb5ej2MioGfYLrZVshF909.jpg', ''),
(597, 'Titanic', 'Durante las labores de recuperación de los restos del famoso Titanic, una anciana norteamericana se pone en contacto con la expedición para acudir a una plataforma flotante instalada en el Mar del Norte y asistir \'in situ\' a la recuperación de sus recuerdos. A través de su memoria reviviremos los acontecimientos que marcaron el siniestro más famoso del siglo XX: el hundimiento del trasatlántico más lujoso del mundo, la máquina más sofisticada de su tiempo, considerada «insumergible», que sucumbió a las heladas aguas del Atlántico en abril de 1912, llevándose consigo la vida de mil quinientas personas, más de la mitad del pasaje. En los recueros de la anciana hay cabida para algo más que la tragedia, la historia de amor que vivió con un joven pasajero de tercera clase, un pintor aficionado que había ganado su pasaje en una partida las cartas en una taberna de Southampton.', 195, 200000000, 2264160000, '1997-11-18', 'US', '', 147.511, 7.905, 24624, 'https://image.tmdb.org/t/p/original/sCzcYW9h55WcesOqA12cgEr9Exw.jpg', 'https://image.tmdb.org/t/p/original/VMOt5scbGmBKDvkfHjZN6Ki54i.jpg', ''),
(603, 'Matrix', 'Thomas Anderson lleva una doble vida: por el día es programador en una importante empresa de software, y por la noche un hacker informático llamado Neo. Su vida no volverá a ser igual cuando unos misteriosos personajes le inviten a descubrir la respuesta a la pregunta que no le deja dormir: ¿qué es Matrix?', 138, 63000000, 463517000, '1999-03-31', 'US', '', 435.552, 8.215, 24850, 'https://image.tmdb.org/t/p/original/icmmSD4vTTDKOq2vvdulafOGw93.jpg', 'https://image.tmdb.org/t/p/original/qK76PKQLd6zlMn0u83Ej9YQOqPL.jpg', ''),
(620, 'Los cazafantasmas', 'Los Drs. Venkman, Stantz y Epengler, son tres doctores en parapsicología que se quedan sin empleo tras quedar excluidos de una beca universitaria de investigación. Entonces deciden formar la empresa \"Los Cazafantasmas\", dedicada a limpiar Nueva York de ectoplasmas. El aumento repentino de apariciones espectrales en la Gran Manzana será el presagio de la llegada de un peligroso y poderoso demonio.', 107, 30000000, 296187000, '1984-06-08', 'US', '', 308.2, 7.5, 8608, 'https://image.tmdb.org/t/p/original/c6yfABGVKuB5cjoOwdX4AJMlzUz.jpg', 'https://image.tmdb.org/t/p/original/6gzodU7MbxcgsOCa0LFZScFkyvK.jpg', ''),
(621, 'Grease', 'Sandy y Danny han pasado un romántico y maravilloso verano juntos, pero las vacaciones se acabaron y sus caminos se separaron. Al regresar al instituto Rydell, ambos vuelven a encontrarse de manera sorpresiva, pero el problema es que la imagen y actitud de Danny no es la misma que durante el verano: ya no es el encantador y atento chico que encandiló a Sandy, sino alguien engreído e insensible que sólo quiere presumir de duro delante de sus amigos.', 110, 6000000, 396300000, '1978-07-07', 'US', '', 293.588, 7.4, 6990, 'https://image.tmdb.org/t/p/original/pdhDFmVQSA0f5i5IL0gpWROjgZ5.jpg', 'https://image.tmdb.org/t/p/original/flSy0dexE82TiS6Si2FtulSHk8o.jpg', ''),
(635, 'El corazón del ángel', 'A Harry Angel, detective privado en horas bajas de la ciudad de Nueva Orleans, lo contrata en Nueva York un misterioso personaje llamado Louis Cyphre para que encuentre a un hombre desaparecido. Conforme avanza la investigación y conoce a Epiphany Proudfoot, hija de un sacerdote vudú, se suceden extrañas muertes, que parecen estar relacionadas con la magia negra y el vudú, y que implican a Harry de una manera cada vez más personal.', 113, 17000000, 17200000, '1987-03-06', 'US', '', 311.141, 7.129, 1448, 'https://image.tmdb.org/t/p/original/mg08WeXL6GWEJHUPAf6p9RD7Z1.jpg', 'https://image.tmdb.org/t/p/original/c46aCm8HWL87c3QUdZ4v5mxqvta.jpg', ''),
(664, 'Twister', 'Dos grupos de científicos persiguen a las tormentas en busca de conseguir estudiar los comportamientos de los tornados. Ambos compiten por ser los primeros en analizar estos peculiares fenómenos meteorológicos desde dentro de un tornado. Su objetivo es analizar en profundidad la mayor tormenta que caerá sobre Oklahoma en el último medio siglo. En uno de los grupos está Jo Harding, una mujer que, con escasos medios y a punto de divorciarse, tendrá que pedir ayuda a su todavía marido Bill. Éste se la da, pero se presenta acompañado de su nueva amante, Melissa. El otro equipo, con mejor equipamiento, está dirigido por el doctor Miller..', 113, 92000000, 494472000, '1996-05-10', 'US', '', 148.7, 6.487, 3078, 'https://image.tmdb.org/t/p/original/o1djbehesYSVlmvGxeqqTaRVCyS.jpg', 'https://image.tmdb.org/t/p/original/sqGlDmGDNv8jtUQkPiZx83WbaUd.jpg', ''),
(671, 'Harry Potter y la piedra filosofal', 'Harry Potter es un huérfano que vive con sus desagradables tíos, los Dursley, y su repelente primo Dudley. Se acerca su undécimo cumpleaños y tiene pocas esperanzas de recibir algún regalo, ya que nunca nadie se acuerda de él. Sin embargo, pocos días antes de su cumpleaños, una serie de misteriosas cartas dirigidas a él y escritas con una estridente tinta verde rompen la monotonía de su vida: Harry es un mago y sus padres también lo eran.', 152, 125000000, 976476000, '2001-11-16', 'GB', '', 171.604, 7.914, 26528, 'https://image.tmdb.org/t/p/original/hziiv14OpD73u9gAak4XDDfBKa2.jpg', 'https://image.tmdb.org/t/p/original/7xXJ15VEf7G9GdAuV1dO769yC73.jpg', ''),
(672, 'Harry Potter y la cámara secreta', 'Harry regresa a su segundo año a Hogwarts, pero descubre que cosas malas ocurren debido a que un sitio llamado la Cámara de los Secretos ha sido abierto por el heredero de Slytherin y hará que los hijos de muggles, los impuros, aparezcan petrificados misteriosamente por un animal monstruoso.', 150, 100000000, 876689000, '2002-11-13', 'GB', '', 137.834, 7.72, 21284, 'https://image.tmdb.org/t/p/original/1stUIsjawROZxjiCMtqqXqgfZWC.jpg', 'https://image.tmdb.org/t/p/original/bhCfAzeMMg7GyLDT11yVM2i1NPh.jpg', ''),
(680, 'Pulp Fiction', 'Jules y Vincent, dos asesinos a sueldo con muy pocas luces, trabajan para Marsellus Wallace. Vincent le confiesa a Jules que Marsellus le ha pedido que cuide de Mia, su mujer. Jules le recomienda prudencia porque es muy peligroso sobrepasarse con la novia del jefe. Cuando llega la hora de trabajar, ambos deben ponerse manos a la obra. Su misión: recuperar un misterioso maletín.', 154, 8500000, 213900000, '1994-09-10', 'US', '', 386.433, 8.489, 27053, 'https://image.tmdb.org/t/p/original/suaEOtk1N1sgg2MTM7oZd2cfVp3.jpg', 'https://image.tmdb.org/t/p/original/hNcQAuquJxTxl2fJFs1R42DrWcf.jpg', ''),
(694, 'El resplandor', 'Jack Torrance se traslada, junto a su mujer y a su hijo, al impresionante hotel Overlook, en Colorado, para encargarse del mantenimiento del mismo durante la temporada invernal, en la que permanece cerrado y aislado por la nieve. Su idea es escribir su novela al tiempo que cuida de las instalaciones durante esos largos y solitarios meses de invierno, pero desde su llegada al hotel, Jack comienza a padecer inquietantes transtornos de personalidad, al mismo tiempo que en el lugar comienzan a suceder diversos fenómenos paranormales.', 146, 19000000, 44781700, '1980-05-23', 'US', '', 104.989, 8.216, 16906, 'https://image.tmdb.org/t/p/original/mmd1HnuvAzFc4iuVJcnBrhDNEKr.jpg', 'https://image.tmdb.org/t/p/original/mm003Mj2e9kJRsrxiVdPn2BSBPh.jpg', ''),
(696, 'Manhattan', 'Podría decirse que Isaac Davis, un neoyorquino de mediana edad, lo tiene todo, si por todo entendemos un trabajo que odia, una novia de 17 años a la que no ama y una ex-esposa lesbiana a la que desearía estrangular, porque está escribiendo un libro en el que cuenta las intimidades de su matrimonio. Pero su vida cambia cuando conoce a Mary, la sexy e inteligente amante de su mejor amigo, y se enamora perdidamente de ella. Dejar a su novia, acostarse con Mary y abandonar su trabajo no es más que el comienzo de la búsqueda de sí mismo.', 96, 9000000, 40194100, '1979-04-25', 'US', '', 238.41, 7.742, 2294, 'https://image.tmdb.org/t/p/original/odXPsc6GyLlAHa64orhAkpmYNLU.jpg', 'https://image.tmdb.org/t/p/original/k4eT3EvfxW1L9Wmt04UqJqCvCR6.jpg', ''),
(708, 'Alta tensión', 'El agente 007 se enfrenta a una nueva misión en Bratislava: ha sido designado expresamente por el general Koskov para que lo proteja al desertar de la KGB. Tras escapar hacia Austria, Koskov se reúne con la organización de Bond en Londres para ponerlos al corriente de los planes de general Puskin, que tiene la intención de asesinar a una serie de agentes británicos. Bond no cree la historia de Koskov, más aún cuando éste es capturado de nuevo por la KGB. Para dar con el paradero de Koskov, Bond regresa a Bratislav, donde encuentra a la novia del general, que también corre peligro. La ayuda a escapar, y descubre que Koskov se halla en Tanger junto al general Whitaker, traficante de armas.', 131, 40000000, 191186000, '1987-06-29', 'US', '', 122.504, 6.513, 1676, 'https://image.tmdb.org/t/p/original/ebaq0ecL1Tu39rIExfHwE4ToFl2.jpg', 'https://image.tmdb.org/t/p/original/gwJV5Vr4XbLWfPqYUTCJwTEhZUq.jpg', ''),
(765, 'Terroríficamente muertos', 'El bueno de Ash se dispone a pasar un fin de semana en el bosque con su novia. Pero todo se va al traste cuando repoducen una cinta en la que un profesor había grabado varios pasajes del Necronomicom, el Libro de los Muertos. El hechizo convoca a una fuerza demoniaca que convierte a la compañera de Ash en un monstruo ávido de carne. Ahora él y varios compañeros se disponen a pasar una noche en una cabaña en medio del bosque, con un demonio en casa.', 84, 3500000, 10900000, '1987-03-13', 'US', '', 241.65, 7.547, 2965, 'https://image.tmdb.org/t/p/original/jyRk8ykqLOXaVadZ0aWRDd89gMP.jpg', 'https://image.tmdb.org/t/p/original/d4o4F8n0brc2vrpZBTvVFgB2Kk8.jpg', ''),
(767, 'Harry Potter y el misterio del príncipe', 'En medio de los desastres que azotan a Inglaterra, Harry y sus compañeros vuelven a Hogwarts para cursar su sexto año de estudios; y aunque las medidas de seguridad han convertido al colegio en una fortaleza, algunos estudiantes son víctimas de ataques inexplicables. Harry sospecha que Draco Malfoy es el responsable de los mismos y decide averiguar la razón. Mientras tanto, Albus Dumbledore y el protagonista exploran el pasado de Lord Voldemort mediante recuerdos que el director ha recolectado. Con esto, Dumbledore planea preparar al muchacho para el día de la batalla final.', 153, 250000000, 933959000, '2009-07-15', 'GB', '', 132.865, 7.693, 18847, 'https://image.tmdb.org/t/p/original/r5xT55Era1XrpAq6XNsrPpozNjM.jpg', 'https://image.tmdb.org/t/p/original/vvb9r7ZH4Zn35sXIwFTb08lMGaU.jpg', ''),
(769, 'Uno de los nuestros', 'Henry, un niño de trece años de Brooklyn, vive fascinado con el mundo de los gángsters. Su sueño se hace realidad cuando entra a formar parte de la familia Pauline, dueña absoluta de la zona, que lo educan como un miembro más de la banda convirtiéndole en un destacado mafioso.', 146, 25000000, 46800000, '1990-09-12', 'US', '', 257.704, 8.465, 12379, 'https://image.tmdb.org/t/p/original/sw7mordbZxgITU877yTpZCud90M.jpg', 'https://image.tmdb.org/t/p/original/3Yy0zBO9AlyAZH1cTI8Ko2ouCi.jpg', ''),
(782, 'Gattaca', 'En un futuro cercano, en La Tierra la perfección genética impera. Los seres inferiores, como Vincent Freeman, cuyo ADN es fruto de una relación natural y no de laboratorio, están condenados al fracaso. Pero Vincent quiere triunfar, y conseguirá esconder su verdadera condición para conseguir su objetivo más ansiado: ser piloto espacial.', 106, 36000000, 12532800, '1997-09-07', 'US', '', 135.914, 7.557, 6079, 'https://image.tmdb.org/t/p/original/hPsCR1ny6GnctJkWqeJwihTDD7T.jpg', 'https://image.tmdb.org/t/p/original/1gXcEISnpV8IXCylhGI4eyBKjM.jpg', ''),
(794, 'La profecía', 'Cuando Kathy Thorn da a luz a un bebé muerto, su esposo Robert le oculta la verdad y sustituye a su hijo por un niño huérfano, ignorando su origen satánico. El horror empieza cuando, en el quinto cumpleaños de Damien, inesperadamente, su niñera se suicida. Un sacerdote que trata de advertir a Robert del peligro que corre, muere en un inesperado accidente. El creciente número de muertes hace que Robert, por fin, se dé cuenta de que el niño que han adoptado es el Anticristo, y que hay que matarlo para impedir que se cumpla una terrible profecia.', 111, 2800000, 60923000, '1976-06-25', 'GB', '', 296.544, 7.399, 1967, 'https://image.tmdb.org/t/p/original/3RkYyseo8OduQpdndyPPCMiJfuC.jpg', 'https://image.tmdb.org/t/p/original/iWyb6PKnl7lp0ytK8ZG7vJloGxc.jpg', ''),
(807, 'Seven', 'El teniente Somerset, del departamento de homicidios, está a punto de jubilarse y ser reemplazado por el ambicioso y brillante detective David Mills. Ambos tendrán que colaborar en la resolución de una serie de asesinatos cometidos por un psicópata que toma como base la relación de los siete pecados capitales: gula, pereza, soberbia, avaricia, envidia, lujuria e ira. Los cuerpos de las víctimas, sobre los que el asesino se ensaña de manera impúdica, se convertirán para los policías en un enigma que les obligará a viajar al horror y la barbarie más absoluta.', 127, 33000000, 327312000, '1995-09-22', 'US', '', 287.017, 8.4, 20314, 'https://image.tmdb.org/t/p/original/iwgl8zlrrfvfWp9k9Paj8lvFEvS.jpg', 'https://image.tmdb.org/t/p/original/8xYdzKvvmtY6UyHiBtvhO53zZ3h.jpg', ''),
(808, 'Shrek', 'Hace mucho, mucho tiempo, en una lejanísima ciénaga vivía un intratable ogro llamado Shrek. Pero de repente, un día, su absoluta soledad se ve interrumpida por una invasión de sorprendentes personajes de cuento. Hay ratoncitos ciegos en su comida, un enorme y malísimo lobo en su cama, tres cerditos sin hogar y otros muchos seres increíbles que han sido deportados de su reino por el malvado Lord Farquaad. Para conseguir salvar su terreno, y de paso a sí mismo, Shrek hace un pacto con Farquaad y emprende viaje para conseguir que la preciosa princesa Fiona sea la novia del Lord. En tan importante misión le acompañan un burro chistoso, dispuesto a hacer cualquier cosa por Shrek. Todo, menos estarse calladito. Rescatar a la princesa de una dragona enamoradiza que suelta fuego al respirar va a resultar una tontería comparado con lo que ocurre cuando el oscuro secreto que la joven guardaba es revelado.', 92, 60000000, 488628000, '2001-05-18', 'US', '', 145.862, 7.741, 16538, 'https://image.tmdb.org/t/p/original/sRvXNDItGlWCqtO3j6wks52FmbD.jpg', 'https://image.tmdb.org/t/p/original/jTQONM7jt1yv2lL972TtmWO0UIZ.jpg', ''),
(829, 'Chinatown', 'Los Ángeles, 1937. El detective Gittes, especializado en divorcios, recibe la visita de la esposa de Mulwray, el jefe del Servicio de Aguas de la ciudad, que sospecha que su marido la engaña. Al mismo tiempo, Gittes descubre que los agricultores acusan a Mulwray de corrupción por su negativa a construir un pantano que paliaría la sequía que sufren. Poco después, el escándalo salta a la prensa, pero la cosa se complica cuando una mujer se presenta en el despacho de Gittes con una sorprendente revelación.', 130, 6000000, 30000000, '1974-06-20', 'US', '', 278.291, 7.915, 3641, 'https://image.tmdb.org/t/p/original/bsoAg22remHKL5O0xJH0m9DX6Pu.jpg', 'https://image.tmdb.org/t/p/original/1wO2OmUCWButQyVPGWQEZn5twca.jpg', ''),
(855, 'Black Hawk derribado', 'Octubre de 1993. Soldados americanos de élite son enviados a Mogadiscio (Somalia) en una misión de paz de las Naciones Unidas. El fin se supone que es salvar vidas, no segarlas. Pero resulta que el principal objetivo de la misión es capturar al caudillo Aidid y acabar de raíz con la guerra. Al principio, todo parece ir bien, hasta que dos helicópteros Black Hawk, aparentemente invencibles, son derribados. Entonces la misión se convierte en una desesperada carrera para rescatar a la tripulación y a los soldados de tierra que han quedado atrapados o han resultado heridos en el accidente.', 145, 92000000, 172990000, '2001-12-28', 'US', '', 145.52, 7.374, 5490, 'https://image.tmdb.org/t/p/original/7jaNOECZG8uS1tlq69HsY5xY8P9.jpg', 'https://image.tmdb.org/t/p/original/4uxu51U2wNuEnuQtlyDbCgS4IPI.jpg', ''),
(861, 'Desafío total', 'Tierra, año 2084. Doug Quaid, un hombre normal con una vida tranquila, está atormentado por una pesadilla que le lleva todas las noches hasta Marte. Decide entonces recurrir al laboratorio Memory-call, una empresa de vacaciones virtuales que le ofrece la oportunidad de materializar su sueño gracias a un fuerte alucinógeno. Sin embargo, su intento resulta en fracaso. La droga resucita de su memoria una estancia verdadera en Marte cuando era el más temido agente del cruel Coohagen.', 113, 65000000, 261318000, '1990-06-01', 'US', '', 229.205, 7.301, 5540, 'https://image.tmdb.org/t/p/original/x2wOlXuK4NzPDQ0OBZiJjNNOp6Y.jpg', 'https://image.tmdb.org/t/p/original/eWNa6zObciJBTEAMDohkKH2Na2J.jpg', ''),
(862, 'Toy Story (Juguetes)', 'Los juguetes de Andy, un niño de seis años, temen que haya llegado su hora y que un nuevo regalo de cumpleaños les sustituya en el corazón de su dueño. Woody, un vaquero que ha sido hasta ahora el juguete favorito de Andy, trata de tranquilizarlos hasta que aparece Buzz Lightyear, un héroe espacial dotado de todo tipo de avances tecnológicos. Woody es relegado a un segundo plano., pero su constante rivalidad se transformará en una gran amistad cuando ambos se pierden en la ciudad sin saber cómo volver a casa.', 77, 30000000, 394437000, '1995-10-30', 'US', '', 243.222, 7.971, 17844, 'https://image.tmdb.org/t/p/original/lxD5ak7BOoinRNehOCA85CQ8ubr.jpg', 'https://image.tmdb.org/t/p/original/jvn7wy3RSNEXnFSXLpH2of2LcV6.jpg', ''),
(869, 'El planeta de los simios', 'Año 2029. En una misión rutinaria, el astronauta Leo Davidson (Mark Wahlberg) pierde el control de su nave y aterriza en un extraño planeta, habitado por una raza de simios de inteligencia similar a la de los humanos y que tratan a éstos como a animales. Con la ayuda de una chimpancé llamada Ari (Helena Bonham-Carter) y de una pequeña banda de humanos rebeldes, Leo encabeza el enfrentamineto contra el terrible ejército dirigido por el general Thade (Tim Roth) y su hombre de confianza, el guerrero Attar (Michael Clarke Duncan). La clave es llegar a un templo sagrado que se encuentra en la zona prohibida del planeta, en el que podrán descubrir los sorprendentes secretos del pasado de la humanidad y la clave para su futuro.', 119, 100000000, 362212000, '2001-07-25', 'US', '', 462.264, 5.7, 3868, 'https://image.tmdb.org/t/p/original/rF0Y0fYVsNFEvGve8Nq0Ij9EDCM.jpg', 'https://image.tmdb.org/t/p/original/rRvUkYCByrlVMy4GMME3iDAe6er.jpg', ''),
(877, 'Scarface, el terror del Hampa', 'Tony Camonte (Paul Muni), un pistolero de origen italiano, ignorante y sin escrúpulos, es el lugarteniente de Johnny Lovo (Osgood Perkins), el hampón más poderoso del South End de Chicago. Ambicioso y cruel, Camonte, que por una cicatriz que le cruza el rostro recibe el apelativo de Cara cortada, elimina poco a poco a los rivales de su jefe hasta que, con la ayuda de su amigo Gino Rinaldo (George Raft), le arrebata el poder también a él y se convierte en el amo de la ciudad. Tras un mes de vacaciones en Florida, descubre que su hermana Cesca (Ann Dvorak), por la que siente un amor confuso y arrebatado, es la amante de Gino.', 93, 0, 600000, '1932-04-09', 'US', '', 155.183, 7.454, 569, 'https://image.tmdb.org/t/p/original/fX1DFPMZYsRG17BmMPJAKUaBZEz.jpg', 'https://image.tmdb.org/t/p/original/6KonNRkcdOKkvnAQgzBMRzJHZNA.jpg', ''),
(926, 'Héroes fuera de órbita', 'Galaxy Quest es el título de una serie de televisión que se ha emitido con gran éxito durante treinta años. Una vez que deja de emitirse, sus protagonistas se dedican a pasear sus antiguos uniformes por convenciones y programas especiales. Lo que no saben es que una raza alienígena del espacio exterior, los Thermians, captaban la serie creyendo que se trataba de un documento histórico. En su lucha contra el perverso Roth\'h\'ar Sarris, deciden secuestrar a los protagonistas para que les ayuden a combatirlo.', 102, 45000000, 90683900, '1999-12-25', 'US', '', 132.243, 7.06, 2124, 'https://image.tmdb.org/t/p/original/sh77GKl39mNwsGClpLxjErJk3Hj.jpg', 'https://image.tmdb.org/t/p/original/baZFHHGuy08feYHrJM1fmayiVLd.jpg', ''),
(948, 'La noche de Halloween', 'Durante la noche de Halloween, Michael, un niño de seis años, asesina a su familia con un cuchillo de cocina. Es internado en un psiquiátrico del que huye quince años más tarde, precisamente la víspera de Halloween. El psicópata vuelve a su pueblo y comete una serie de asesinatos. Mientras, uno de los médicos del psiquiátrico le sigue la pista.', 91, 325000, 70300000, '1978-10-24', 'US', '', 295.284, 7.554, 5324, 'https://image.tmdb.org/t/p/original/aRka9neADW1M0Zf9lF8kW2jEgXe.jpg', 'https://image.tmdb.org/t/p/original/6bsDpDL312h6vEGPOPWoweaZWUG.jpg', ''),
(981, 'Historias de Filadelfia', 'Historias de Filadelfia es una comedia protagonizada por Cary Grant, Katherine Hepburn y James Stewart. Tracy Lord (Katherine Hepburn) es idolatrada por todo el mundo y debe mantener a su siniestro ex-marido, un periodista alcohólico, y su futuro marido contentos.', 112, 0, 0, '1940-12-05', 'US', '', 135.109, 7.618, 815, 'https://image.tmdb.org/t/p/original/obXJDyy5gORwabqBkadEU0cxlqd.jpg', 'https://image.tmdb.org/t/p/original/lsVyk2qzL6snKpAtrvZU2DfGar3.jpg', ''),
(1366, 'Rocky', 'Rocky Balboa es un desconocido boxeador a quien se le ofrece la posibilidad de pelear por el título mundial de los pesos pesados. Con mucha fuerza de voluntad, Rocky se preparará concienzudamente para este combate, y también para los cambios que producirá en su vida.', 119, 1000000, 225300000, '1976-11-21', 'US', 'https://sylvesterstallone.com/the-official-rocky-site/', 374.799, 7.787, 7526, 'https://image.tmdb.org/t/p/original/kK9v1wclQxug6ZUJucD4DTaHgVF.jpg', 'https://image.tmdb.org/t/p/original/zxctX2pCucniDkS83TTCqRnKS9e.jpg', ''),
(1374, 'Rocky IV', 'Nuevas aventuras tanto personales como deportivas del boxeador Rocky Balboa, que en esta ocasión debe enfrentarse a un duro y frío boxeador soviético, llamado Ivan Drago.', 91, 31000000, 300500000, '1985-11-21', 'US', '', 234.602, 7.1, 4224, 'https://image.tmdb.org/t/p/original/ufUdEHvs31M8yw3HMFjhTaVJIVp.jpg', 'https://image.tmdb.org/t/p/original/2MHUit4H6OK5adcOjnCN6suCKOl.jpg', ''),
(1375, 'Rocky V', 'Rocky vuelve de Rusia tras su pelea contra Ivan Drago para encontrarse con que ha perdido casi toda su fortuna. Además, el boxeo le ha dejado ciertas secuelas que fuerzan su retiro. Para lograr salir de la bancarrota Rocky subasta sus cosas y le jura a su hijo que lo va a recuperar todo. Sin más opciones, los Balboa vuelven a su antiguo barrio y a vivir de nuevo en la antigua casa de su mujer con pocos recursos. Un boxeador, llamado Union Cane, gana el título vacante.', 105, 42000000, 120000000, '1990-11-16', 'US', '', 218.55, 5.769, 3045, 'https://image.tmdb.org/t/p/original/ne1ivJv3lGGUvZ9F72P0r2xpksB.jpg', 'https://image.tmdb.org/t/p/original/o1nY37L6HC9hwlLSH5sHVzvXt1P.jpg', ''),
(1417, 'El laberinto del fauno', 'En la España falangista de 1944, una joven aficionada a los libros e hijastra de un sádico oficial del ejército huye a un misterioso pero cautivador mundo de fantasía.', 112, 19000000, 83258200, '2006-10-10', 'ES', '', 155.944, 7.76, 10201, 'https://image.tmdb.org/t/p/original/o0IWa75BXyXryNDVqw0xoXZzy1J.jpg', 'https://image.tmdb.org/t/p/original/Ao83nMqYIYUsD2Q3lNsz6176MlC.jpg', ''),
(1422, 'Infiltrados', 'El Departamento de Policía de Massachussets se enfrenta a la mayor banda de crimen organizado de la ciudad de Boston. La estrategia consiste en acabar desde dentro con Frank Costello, el poderoso jefe de la mafia irlandesa. El encargado de infiltrarse en la banda es un joven novato, Billy Costigan. Mientras Billy intenta ganarse la confianza de Costello, otro joven policía, Colin Sullivan, sube rápidamente de categoría y ocupa un puesto en la unidad de Investigaciones Especiales, grupo de élite cuya misión también es acabar con Costello. Lo que nadie sabe es que Colin es un topo infiltrado en la policía por el propio Costello.', 149, 90000000, 291465000, '2006-10-04', 'US', '', 222.657, 8.168, 14408, 'https://image.tmdb.org/t/p/original/6WRrGYalXXveItfpnipYdayFkQB.jpg', 'https://image.tmdb.org/t/p/original/mupWl1yjc7S8nvce6KpYksZdlTy.jpg', ''),
(1685, 'Regreso al planeta de los simios', 'Una nueva nave procedente del espacio y del tiempo aterriza al mando del astronauta Brent, que acude en busca del desaparecido George Taylor. Vuelve a encontrarse con los simios que dominan el mundo, relegando a los humanos a la esclavitud. Sin embargo, con la ayuda de la doctora Zira seguirá las huellas de Taylor hasta la Zona Prohibida, en cuyas catacumbas, lo que son las ruinas del metro de Nueva York, encuentra a una raza humana mutante con poderes telepáticos.', 95, 3000000, 18999700, '1970-04-23', 'US', '', 132.38, 6.2, 1233, 'https://image.tmdb.org/t/p/original/e5MlN03JvbpTqq2dsW3H2VUTU4s.jpg', 'https://image.tmdb.org/t/p/original/wNh22vYIfd2Xr6zBoh8ZQGivt1L.jpg', '');
INSERT INTO `pelicula` (`id`, `titulo`, `sinopsis`, `duracion`, `presupuesto`, `ganancias`, `fecha_estreno`, `pais_origen`, `web`, `popularidad`, `valoracion`, `total_votos`, `fondo`, `poster`, `adulto`) VALUES
(1700, 'Misery', 'Un escritor llamado Paul Sheldon (James Caan) lleva años malgastando su talento con unas románticas historias, de gran éxito comercial, cuya protagonista es una mujer llamada Misery. Decidido a acabar con esta situación, mata al personaje y se refugia en Colorado para escribir una novela seria. Terminado su trabajo, emprende el regreso, pero en una carretera de montaña, pierde el control de su coche y sufre un grave accidente. Annie Wilkes (Kathy Bates), una brusca e impetuosa mujer, gran admiradora suya, lo rescata, se lo lleva a su casa y lo cuida con esmero. Obsesionada con el personaje de Misery, retiene a Sheldon para obligarlo a escribir una nueva historia en la que resucite al personaje.', 107, 20000000, 61300000, '1990-11-30', 'US', '', 353.924, 7.756, 4430, 'https://image.tmdb.org/t/p/original/cgo3OmF84touDrrLkQ1DQ3MRFyO.jpg', 'https://image.tmdb.org/t/p/original/gAELWNF6ViSF5OG1fibPvUbtnZn.jpg', ''),
(1701, 'Con Air (Convictos en el aire)', 'Un grupo de presos considerados muy peligrosos son trasladados a un nuevo centro penitenciario. En el avión viaja también Cameron Poe, que acaba de conseguir la libertad condicional y cuyo único deseo es reunirse de nuevo con su esposa y su hija. Sin embargo, durante el trayecto, Poe se ve envuelto en un secuestro aéreo urdido meticulosamente por Cyrus Grissom. Mientras que Cameron intenta evitar que Cyrus y sus secuaces masacren a toda la tripulacion y que el avión se estrelle contra la ciudad de Las Vegas, Vince Larkin, de la policia judicial, tiene que convencer a sus superiores para que no hagan explotar al avion con todos sus pasajeros.', 116, 75000000, 224012000, '1997-06-05', 'US', '', 352.418, 6.747, 3984, 'https://image.tmdb.org/t/p/original/1fldJZ43ftMj3gKbhf8idjI7fWO.jpg', 'https://image.tmdb.org/t/p/original/mZv1XUFAzhVvyTwrtjclzbtW4HJ.jpg', ''),
(1705, 'La conquista del planeta de los simios', 'César, el simio que capitaneó la revuelta contra la raza humana, es un benévolo gobernante que fomenta la convivencia con los hombres, a pesar de la oposición del general Aldo, jefe militar de los simios. No obstante, los hombres que han sobrevivido al holocausto nuclear son considerados ciudadanos de segunda clase. César decide realizar un viaje a la \"Ciudad Prohibida\" con MacDonald y el sabio Virgil, en busca de unas cintas en las que estaría grabada la muerte de sus padres. Durante el viaje, es observado por un grupo de hombres mutantes que viven en la devastada zona de guerra. Éste es el motivo por el que el General Aldo desafiará la autoridad de César y, además, provocará un enfrentamiento entre simios y hombres, para dirimir quién gobernará el planeta.', 93, 1700000, 8844600, '1973-06-15', 'US', '', 136.937, 5.7, 861, 'https://image.tmdb.org/t/p/original/3ap6vhJN7q87mziDP6EltPGQ0hW.jpg', 'https://image.tmdb.org/t/p/original/9kQ0wmBzoL4EZEF2jTft58AhBuv.jpg', ''),
(1726, 'Iron Man', 'El multimillonario fabricante de armas Tony Stark debe enfrentarse a su turbio pasado después de sufrir un accidente con una de sus armas. Equipado con una armadura de última generación tecnológica, se convierte en \'El hombre de hierro\' para combatir el mal a escala global.', 126, 140000000, 585174000, '2008-04-30', 'US', '', 153.134, 7.643, 25722, 'https://image.tmdb.org/t/p/original/cyecB7godJ6kNHGONFjUyVN9OX5.jpg', 'https://image.tmdb.org/t/p/original/tFCTNx7foAsUQpgu2x1KjAJD1wT.jpg', ''),
(1730, 'Inland Empire', 'La percepción de la realidad de una actriz (Laura Dern) se va distorsionando cada vez más. Al mismo tiempo descubre que, quizá, se está enamorando de su partenaire (Justin Theroux) en un remake polaco inconcluso y supuestamente maldito.', 180, 15000000, 4304160, '2006-12-06', 'US', '', 134.266, 7.021, 1021, 'https://image.tmdb.org/t/p/original/qyePa65qZVnuYWivTBXkHV9aI3A.jpg', 'https://image.tmdb.org/t/p/original/7mP7TUoS5MQjPfjmfYMYYvlsbUy.jpg', ''),
(1924, 'Superman', 'Desde una galaxia remota, un recién nacido es enviado por sus padres al espacio debido a la inminente destrucción del planeta donde viven. La nave aterriza en la Tierra, y el niño es adoptado por unos granjeros que le inculcan los mejores valores humanos. Con los años el joven se irá a Metrópolis y allí usará sus poderes sobrenaturales para luchar contra el mal...', 143, 55000000, 300500000, '1978-12-14', 'US', '', 337.331, 7.137, 3647, 'https://image.tmdb.org/t/p/original/v6MVBFnQOscITvmAy5N5ras2JKZ.jpg', 'https://image.tmdb.org/t/p/original/pS4i2L1kUERAd6bm8j14uke7Apx.jpg', ''),
(2142, 'Copland', 'Freddy Heflin es el sheriff de un lugar que todos llaman \"Cop Land\", un pueblo pequeño y aparentemente tranquilo poblado por los policías de la gran ciudad que siempre ha admirado. Sin embargo, algo feo está ocurriendo detrás de la tranquila fachada de la ciudad. Y cuando Freddy descubre una conspiración masiva y mortal entre estos residentes locales, se ve obligado a tomar medidas y tomar una decisión peligrosa entre proteger a sus ídolos y hacer cumplir la ley.', 105, 15000000, 44862200, '1997-08-15', 'US', '', 231.601, 6.787, 1490, 'https://image.tmdb.org/t/p/original/cnD5ygO97xFY8wQPwLP5v9saus7.jpg', 'https://image.tmdb.org/t/p/original/dWTq9bYtxaqwJfyNahzhXlw3Fbc.jpg', ''),
(2246, 'Malicia', 'Endy (Bill Pullman) y Tracy (Nicole Kidman), un joven matrimonio de recién casados, lleva una vida aparentemente cómoda y feliz. Ambos entablan amistad con Jed (Alec Baldwin), un joven y atractivo cirujano recién llegado a la ciudad, que fue compañero de colegio de Endy. Una noche, una alumna del instituto donde trabaja Endy sufre una agresion sexual. Poco después, otra alumna aparece asesinada...', 120, 20000000, 46405300, '1993-09-29', 'US', '', 118.255, 6.244, 427, 'https://image.tmdb.org/t/p/original/oBFoH4TozWBAxkHMBsQBBK5ONd8.jpg', 'https://image.tmdb.org/t/p/original/x7ynnBvJMXLIWtzg6cihIxFC95n.jpg', ''),
(2362, 'Almas De Metal', 'En un futuro próximo existe un gigantesco parque de vacaciones dividido en tres zonas: la Roma Imperial, el Oeste americano y la Europa Medieval. Cada una de ellas reproduce con total fidelidad las características de cada época. Existe, además, la posibilidad de que quien pueda permitírse el lujo viva sus propias aventuras en la época elegida. Al parque han ido de vacaciones un par de amigos, Peter Martin (Richard Benjamin) y John Blane (James Brolin). Todo está perfectamente controlado hasta que los robots que hacen de figurantes empiezan a fallar, en concreto un implacable pistolero (Yul Brynner) diseñado para perseguir sin descanso a sus víctimas.', 88, 1200000, 10000000, '1973-08-15', 'US', '', 172.266, 6.8, 1231, 'https://image.tmdb.org/t/p/original/iYGAJjtSBIhJodgvZ9k28rGtgyj.jpg', 'https://image.tmdb.org/t/p/original/wSk1lLjY479xtTC9GXCBb5ljZb.jpg', ''),
(2640, 'Escuela de jóvenes asesinos', 'Un grupo de cuatro estudiantes, consideradas como las chicas más populares de su escuela secundaria, cometen todo tipo de crueldades con sus compañeras y compañeros. Una de estas chicas, Verónica Sawyer (Winona Ryder), empieza a darse cuenta de que lo que hacen no es bueno, pero le resulta difícil salir del grupo. Aliada con un nuevo chico que ha llegado a la escuela, logran matar a tres alumnos molestos, aunque en todos los casos aparecen como suicidas. Pronto, Verónica comprobará que su amigo es un psicópata.', 105, 3000000, 1100000, '1989-03-31', 'US', '', 152.055, 7.3, 1605, 'https://image.tmdb.org/t/p/original/5pLaYZGbweHYULiNiRehPxYuUnn.jpg', 'https://image.tmdb.org/t/p/original/9ASp83nXqK6Vf6XiAKZYSpxAiOJ.jpg', ''),
(2666, 'Dark City', 'John Murdoch se despierta solo en un extraño hotel y comprueba que ha perdido la memoria y es perseguido como el autor de una serie de sádicos y brutales asesinatos. Mientras intenta juntar las piezas que componen el puzle de su pasado, descubre un submundo habitado por unos seres conocidos como \"los ocultos\" que tienen la habilidad de adormecer a las personas y alterar a la ciudad y a sus habitantes.', 100, 27000000, 27200000, '1998-02-27', 'AU', '', 333.909, 7.323, 2679, 'https://image.tmdb.org/t/p/original/bmAzESah8IUNRQX5MqeyUrhE5Pr.jpg', 'https://image.tmdb.org/t/p/original/xZiUwgdXMUMY8vEpMylOahUIDzL.jpg', ''),
(2667, 'El proyecto de la bruja de Blair', 'Durante el octubre de 1994, tres estudiantes de cine en el Montgomery College, Heather Donahue, Joshua Leonard y Michael Williams realizaron la propuesta de crear un proyecto para presentarla en la clase de cine, el proyecto llamado por Heather \"El Proyecto de la Bruja de Blair\" contaba de entrevistas con los residentes del pueblo de Burkittsville, Maryland, sobre la bruja local.', 81, 60000, 248639000, '1999-07-14', 'US', '', 147.801, 6.332, 4604, 'https://image.tmdb.org/t/p/original/hSLJKdgzRRvVTOHTwr1qafHpw4n.jpg', 'https://image.tmdb.org/t/p/original/47yiAtiDbsmDGoKznWVP2YglUZr.jpg', ''),
(2756, 'Abyss', 'Un equipo de científicos de una instalación petrolífera es contratado por la marina norteamericana para llevar a cabo la operación de rescate de un submarino nuclear atrapado, en extrañas circunstancias, en el fondo del mar, justamente al borde de una grieta abisal de varios kilómetros de profundidad. Un grupo de las fuerzas especiales del ejército acompañará a los científicos. Muy pronto estos últimos empiezan a sospechar que lo que está sucediendo en las profundidades abisales es algo tan extraño que, en principio, escapa a su comprensión.', 140, 70000000, 90000100, '1989-08-09', 'US', '', 259.84, 7.347, 2831, 'https://image.tmdb.org/t/p/original/xLzkWj2C6zCWyFT8Z7tKKtfrwcR.jpg', 'https://image.tmdb.org/t/p/original/A7sk3kwiaUCJFNHOphN8O0LMMmS.jpg', ''),
(3080, 'Sombrero de copa', 'Jerry Travers, un astro de la comedia musical americana, llega a Londres y se instala en la habitación del productor de su obra, Horace Hardwick. El azar le hace conocer a la bella modelo Dale Tremont, que se aloja en la habitación de abajo. Ella le toma, erróneamente, por Hardwick y, al enterarse que está casado (en realidad, y aunque no lo sabe, con una amiga suya, Madge), le rechaza y viaja con su jefe, el modisto Alberto Beddini, a Venecia, donde, por despecho, se casará con él.', 105, 609000, 3202000, '1935-08-29', 'US', '', 144.903, 7.3, 277, 'https://image.tmdb.org/t/p/original/tnPgH5j3rPRajvF1iUqLH9WgWqz.jpg', 'https://image.tmdb.org/t/p/original/ljT8X75UuihrQJgxDRvQ5fRejz4.jpg', ''),
(3767, 'Gilda', 'Johnny Farrell, un aventurero que vive de hacer trampas en el juego, recala en Buenos Aires. Allí le saca de un apuro un hombre llamado Ballin Mundson, propietario de un lujoso casino. El recién llegado termina convirtiéndose en el individuo de confianza de su anfitrión. Un día, su superior le presenta a su esposa, Gilda. Él reacciona con perplejidad, ya que ella lo convirtió en el ser amargado y cínico que es ahora.', 110, 2000000, 6000000, '1946-04-25', 'US', '', 176.094, 7.524, 549, 'https://image.tmdb.org/t/p/original/mvddOYK8TAuSVbZissvU5FLcHMb.jpg', 'https://image.tmdb.org/t/p/original/zTYrR5zXBCtWPsBLg8QU1rSp1ii.jpg', ''),
(4032, 'Mi chica', 'Vada Sultenfuss es una niña obsesionada con la muerte. Su madre ha muerto y su padre dirige una funeraria. Además está enamorada de su profesor de inglés y se apunta a unos cursos de poesía en verano sólo para impresionarle. Thomas J., su mejor amigo, es alérgico a todo. Cuando el padre de Vada contrata a Shelly -una experta maquilladora- para su negocio, comienza a enamorarse de ella. Pero Vada se enfada e intentará hacer todo lo posible por torpedear la relación.', 102, 17000000, 59490000, '1991-11-27', 'US', '', 143.12, 7.38, 1991, 'https://image.tmdb.org/t/p/original/xhhIh0Vzs2GH4f3tX35YM2FMjLv.jpg', 'https://image.tmdb.org/t/p/original/6iYlGQ82uM2l5Jjor0axXB30J3J.jpg', ''),
(4233, 'Scream 2', 'La universidad de Windsor ofrece una variada opción de materias para sus estudiantes, justo lo que Sidney Prescott necesita. Es primavera, dos años después de los asesinatos en Woodsboro, California, y el año escolar está llegando a su fin. Sid tiene una compañera de habitación, un novio y es la elegida para encabezar el reparto de la obra que se representa en la universidad este curso. Randy, otro de los supervivientes de los asesinatos de Woodsboro, estudia cine en Windsor. También es feliz, como Sid. Pero el pasado nunca queda atrás. De hecho, vuelve y alguien es asesinado mientras ve la película \"Stab\" (Puñalada) en el cine del campus, el día del estreno nacional. Stab, basada en la novela superventas escrita por la periodista Gale Weathers, describe los asesinatos de Woodsboro. El libro no sólo se vendió como rosquillas, además ayudó a salir de la prisión a Cotton Weary, el hombre acusado por Sidney de la muerte de su madre.', 122, 24000000, 172400000, '1997-12-12', 'US', '', 240.435, 6.489, 3955, 'https://image.tmdb.org/t/p/original/5QRRdnMWtAeu8Zgje2Gdwuo7gd6.jpg', 'https://image.tmdb.org/t/p/original/hMDrWCUqxc7BfQcseT427znCDta.jpg', ''),
(4488, 'Viernes 13', 'Varios jóvenes pasan sus vacaciones en un campamento de verano, reabierto recientemente, y en el que unos años antes murió un joven ahogado en el lago. En poco tiempo, algunos de ellos son encontrados sin vida.', 95, 550000, 59800000, '1980-05-09', 'US', '', 138.819, 6.39, 2773, 'https://image.tmdb.org/t/p/original/8uYbexsonCUDsfFLNyXkMhV3qfe.jpg', 'https://image.tmdb.org/t/p/original/wLdUNsyeSd9OvKmM0CeXF6n13IL.jpg', ''),
(5548, 'RoboCop', 'Parte del cuerpo de un policía asesinado, es utilizado para crear un «superpolicía» con cuerpo mecánico y cerebro humano. Aunque los científicos aseguran que el robot no tendrá remordimientos, éstos acabarán apareciendo en la memoria del humanoide.', 102, 13000000, 53424700, '1987-07-17', 'US', '', 345.063, 7.314, 4880, 'https://image.tmdb.org/t/p/original/pRSTtNlcADoQkfeBGtFQNE1FDpb.jpg', 'https://image.tmdb.org/t/p/original/fnFqGOKi3oxiIuWffSrGGRPG9qu.jpg', ''),
(5876, 'La niebla', 'En un pequeño pueblo de Maine, estalla de repente una violenta tormenta que termina tan bruscamente como comenzó. Entonces surge una espesa niebla que va entrando en casas y supermercados, atrapando y matando a todos los que se ven envueltos por la oscuridad.', 124, 18000000, 57470200, '2007-11-21', 'US', '', 173.314, 6.921, 4937, 'https://image.tmdb.org/t/p/original/3WrR2rYX7nHWnBhWHLZptsJ2bEj.jpg', 'https://image.tmdb.org/t/p/original/1xBYpcEHJzu5vmXmdDmySZ9herF.jpg', ''),
(7451, 'xXx', 'Xander Cage es XXX, un antiguo ganador de X-Games y atleta profesional de deportes de extremo, que sobrevive vendiendo videos de sus increíbles hazañas, las cuales hacen emitir adrenalina por todo el cuerpo. Pero después de incontables encuentros con la ley, su mundo está a punto de tomar un rumbo aún más extremo... Porque Xander no sabe que ha sido \"espiado\" por Augustus Gibbons, un agente veterano de la Agencia Nacional de Seguridad que se encuentra en una desesperada situación en la distante ciudad de Praga, en donde su operativo secreto ha sido asesinado por una pandilla de mafiosos con un estilo muy propio, que se llaman así mismos Anarchy 99, encabezados por el brutal ex-Comandante del Ejército Ruso Yorgi.', 124, 70000000, 277500000, '2002-08-09', 'US', '', 808.102, 5.931, 4037, 'https://image.tmdb.org/t/p/original/qwK9soQmmJ7kRdjLZVXblw3g7AQ.jpg', 'https://image.tmdb.org/t/p/original/ewGhwS8dbAfFDJBEpbsWOuwS4Ov.jpg', ''),
(8009, 'Los inmortales', 'Son Inmortales, destinados a vivir eternamente. Deben retarse a duelos a través de los tiempos hasta que sólo quede uno. Sólo decapitados por la hoja de una espada pueden liberarse de su eterna lucha y conseguir el Premio: un poder inimaginable. Desde las tierras altas de Escocia del siglo XVI hasta el Nueva York de nuestros días, los Inmortales luchan por su recompensa, mientras el destino de los mortales se sostiene en un frágil equilibrio.', 110, 19000000, 12900000, '1986-03-07', 'GB', '', 165.252, 6.899, 2487, 'https://image.tmdb.org/t/p/original/1S7uCBV4rvQR24kh0TldWhjLV3F.jpg', 'https://image.tmdb.org/t/p/original/8af3tPdbKd9iDUqWb8R5dOXShtH.jpg', ''),
(8077, 'Alien³', 'Tras conseguir escapar con Newt y Bishop de un planeta alienígena, la teniente Ellen Ripley (Sigourney Weaver) recala accidentalmente en Fiorna 161, una remota cárcel galáctica cuyos peligrosos reclusos están absolutamente abandonados a su suerte.', 114, 50000000, 159774000, '1992-05-22', 'US', '', 132.231, 6.358, 5333, 'https://image.tmdb.org/t/p/original/owiT3FUjdQ2LEj4YxiT6vjPVcS4.jpg', 'https://image.tmdb.org/t/p/original/7W0QB3IgbKyXSyKvGrSu6uu7YWg.jpg', ''),
(8587, 'El rey león', 'La sabana africana es el escenario en el que tienen lugar las aventuras de Simba, un pequeño león que es el heredero del trono. Sin embargo, se ve forzado a exiliarse al ser injustamente acusado de la muerte de su padre. Durante su destierro, hará buenas amistades y, finalmente, regresará para recuperar lo que legítimamente le corresponde.', 85, 45000000, 763456000, '1994-06-24', 'US', '', 132.046, 8.3, 17674, 'https://image.tmdb.org/t/p/original/wXsQvli6tWqja51pYxXNG1LFIGV.jpg', 'https://image.tmdb.org/t/p/original/b0MxU37dNmMwKtoPVYPKOZSIrIn.jpg', ''),
(8920, 'Garfield: La película', 'La vida no podría ser más dulce para Garfield, el gato al que todos adoran. Apalancado es un confortable sofá delante de la televisión, zampándose un buen trozo de lasaña (su comida favorita) y lanzando pullas a su angustiado dueño, Jon, Garfield se siente el dueño de su mundo. Cuando Jon lleva a Garfield a la consulta de la guapa veterinaria Liz Wilson, ésta le endosa a Jon una entusiasta y jadeante criatura que menea animosamente la cola, y representa todo lo que Garfield odia en la vida. Garfield conoce así a Odie, un perro adorable y no demasiado inteligente.', 80, 50000000, 200800000, '2004-06-10', 'US', '', 322.915, 5.699, 3828, 'https://image.tmdb.org/t/p/original/6SSEa1OfqrHGg7XTLNTxbyyioRB.jpg', 'https://image.tmdb.org/t/p/original/pMQKL3Dx40au9e172ARVUWsT4qH.jpg', ''),
(9303, 'Lazos ardientes', 'Corky, una dura expresidiaria que trabaja en la renovación de un apartamento en un edificio de Chicago, conoce a la pareja que vive al lado, Caesar, un mafioso paranoico, y Violet, su seductora novia, que se siente inmediatamente atraída por ella…', 105, 4500000, 7011320, '1996-09-13', 'US', '', 146.185, 7.2, 876, 'https://image.tmdb.org/t/p/original/mSIwogX33Hp09JEnahn5IbAODG.jpg', 'https://image.tmdb.org/t/p/original/umrpj8XNAzvePGRXvTIh4x5TvxP.jpg', ''),
(9348, 'Species (Especie mortal)', 'Cuando una bella hembra resultante del cruce de un ser humano y un alienígena se escapa de un laboratorio de observación, el científico Javier Fich envía a un asesino del gobierno, a un psíquiatra, a una bióloga y a un antropólogo en su búsqueda. Mientras siguen su pista por Los Ángeles, el equipo descubre cuál es su plan; aparearse con hombres para producir crías que puedan destruir a la raza humana. Mientras su mortal reloj biológico avanza con rapidez, Fitch y su equipo se lanzan a una inquietante persecución de la que depende el destino de la humanidad.', 108, 35000000, 113400000, '1995-07-07', 'US', '', 271.484, 5.96, 1556, 'https://image.tmdb.org/t/p/original/5ccklJJR9McV3nzAgurdbc5nAlz.jpg', 'https://image.tmdb.org/t/p/original/5Lg9kkaKc53vZd1tqiuc2lmf0bp.jpg', ''),
(9480, 'Daredevil', 'Adaptación del legendario héroe de cómic de Marvel -conocido como el Hombre sin Miedo-. El abogado Matt Murdock es ciego a causa de un residuo radioactivo, pero sus otros cuatro sentidos están especialmente agudizados. De día, Murdock representa a los oprimidos. Por la noche, es Daredevil, un vigilante enmascarado que acecha las oscuras calles de la ciudad, un implacable vengador de justicia.', 103, 78000000, 179180000, '2003-02-14', 'US', '', 175.342, 5.261, 4884, 'https://image.tmdb.org/t/p/original/4telFYUn73bXqLL5JRv6jolySj7.jpg', 'https://image.tmdb.org/t/p/original/jH3EQ7bzb0kFLYRaMb0YNmTs8Iu.jpg', ''),
(9482, 'Juez Dredd', 'En el año 2139, la humanidad vive envuelta en una permanente violencia. Sin embargo, en MegaCity Uno, una de las tres megaciudades que existen en Estados Unidos, hay un hombre dispuesto a luchar contra el crimen: el impacable Juez Dredd.', 96, 90000000, 113493000, '1995-06-30', 'US', '', 331.648, 5.8, 2310, 'https://image.tmdb.org/t/p/original/baJHUXBcoaHnMf2sjwegbuhIjEV.jpg', 'https://image.tmdb.org/t/p/original/9sw2Z9V0E0NxRvJY3cRxF5jQtko.jpg', ''),
(9602, 'El príncipe de Zamunda', 'El principe Akeen del africano reino de Zamunda cumple veintiún años. Su futura esposa ya ha sido elegida por el rey y es presentada en la corte. Akeen decide ir a Norteamérica para buscar novia de su gusto. Un barrio marginal de Nueva York será su morada.', 116, 30000000, 288752000, '1988-06-29', 'US', '', 139.962, 6.882, 4168, 'https://image.tmdb.org/t/p/original/hP4PMoQfaofHbLDPIAXrirR7wSF.jpg', 'https://image.tmdb.org/t/p/original/i9YDwvJpQ1aAwuAY66nbe94DDKY.jpg', ''),
(9603, 'Clueless (Fuera de onda)', 'Clueless cuenta las desventuras de una chica popular y entrometida de un instituto de Beverly Hill, Cher, que recibe más de lo que esperaba cuando decide darle un cambio de imagen a una estudiante nueva.', 97, 12000000, 56631600, '1995-07-19', 'US', '', 130.303, 7.3, 4212, 'https://image.tmdb.org/t/p/original/2FonLz0RPxbBriOlZ9mWhYdlqCp.jpg', 'https://image.tmdb.org/t/p/original/7uU4tvfeDNCpjiRuoM6kReQ57Pb.jpg', ''),
(9802, 'La roca', 'Un grupo de soldados renegados roba un arma química y toma la antigua cárcel de Alcatraz con 81 turistas como rehenes. Su líder, un general del ejército muy condecorado, pide 100 millones de dólares para entregárselos a las familias de los soldados muertos en operaciones secretas llevadas a cabo por el ejército. Un equipo de élite y un recluso, que en su día pudo huir de Alcatraz, y que conoce los pasadizos que pueblan la prisión, tratarán de evitar que una gran catástrofe se produzca.', 136, 75000000, 335063000, '1996-06-07', 'US', '', 228.995, 7.126, 4477, 'https://image.tmdb.org/t/p/original/uUCij548JeREaZeWQ9HX4IlK8sE.jpg', 'https://image.tmdb.org/t/p/original/wtCpQc9SP6fB7EVSmE36G0pCK1r.jpg', ''),
(10138, 'Iron Man 2', 'El mundo sabe que el multimillonario Tony Stark es Iron Man, el superhéroe enmascarado. Sometido a presiones por parte del gobierno, la prensa y la opinión pública para que comparta su tecnología con el ejército, Tony es reacio a desvelar los secretos de la armadura de Iron Man porque teme que esa información pueda caer en manos indeseables.', 125, 200000000, 623933000, '2010-04-28', 'US', '', 419.874, 6.839, 20428, 'https://image.tmdb.org/t/p/original/7lmBufEG7P7Y1HClYK3gCxYrkgS.jpg', 'https://image.tmdb.org/t/p/original/ayyJVOV5I4MGjti7nIHC3mVCagR.jpg', ''),
(10155, 'Giro al infierno', 'Después de un accidente de coche en el desierto de Arizona, Bobby Cooper consigue llegar a un pequeño pueblo habitado por gentes muy extrañas. Allí conoce a una pareja formada por un hombre maduro y una atractiva joven. Pronto, el marido le propondrá matar a su esposa. Poco después, ella le propondrá matar a su marido.', 118, 19000000, 6682100, '1997-10-03', 'US', '', 275.684, 6.635, 695, 'https://image.tmdb.org/t/p/original/rq6duKhgffOtMs9LqgyhrJ9Y8EX.jpg', 'https://image.tmdb.org/t/p/original/qDoyBFRshXXGo0JCKWu3V4cHXJ1.jpg', ''),
(10576, 'Psicosis II: El regreso de Norman', 'Después de veintidós años encerrado en un psiquiátrico y, aparentemente curado, Norman Bates (Anthony Perkins) queda en libertad pese a las protestas de Lila, la hermana de Marion Crane (Vera Miles) y viuda de Sam Loomis, el antiguo novio de su hermana. Acompañado por su psiquiatra, el doctor Raymond, Norman regresa al motel Bates y se hace cargo de él. Tras hacer amistad con una joven, empiezan a ocurrir hechos extraños y crímenes inexplicables...', 115, 5000000, 34725000, '1983-06-03', 'US', '', 159.01, 6.45, 603, 'https://image.tmdb.org/t/p/original/pSXP7pa8mgOjrh8GbKnXArLXmL7.jpg', 'https://image.tmdb.org/t/p/original/m4PRC48MuDaOddqNJVgBWgOb5MA.jpg', ''),
(11324, 'Shutter Island', 'Verano de 1954. Los agentes judiciales Teddy Daniels y Chuck Aule son destinados a una remota isla del puerto de Boston para investigar la desaparición de una peligrosa asesina recluida en el hospital psiquiátrico Ashecliffe, un centro penitenciario para criminales perturbados dirigido por el siniestro doctor John Cawley. Pronto descubrirán que el centro guarda muchos secretos, y que la isla esconde algo más peligroso que los pacientes.', 138, 80000000, 294800000, '2010-02-14', 'US', '', 133.056, 8.203, 23273, 'https://image.tmdb.org/t/p/original/ecvy2kMxsJ60ej52beZ0F8EOGkL.jpg', 'https://image.tmdb.org/t/p/original/56utveUWJwmG12YU7c2zKw6pbRZ.jpg', ''),
(11974, 'No matarás... al vecino', 'En un típico vecindario norteamericano de los suburbios llegan unos vecinos nuevos a instalarse al lado de la casa de Ray Peterson. Pero estos nuevos vecinos son realmente extraños: nadie los ha visto y por la noche se pueden escuchar extraños sonidos provenientes del sótano. Lo único que conocen es su apellido: los Klopeks. Un día Walter, un anciano del vecindario, desaparece y todos comienzan a sospechar de ellos.', 105, 18000000, 49100000, '1989-02-17', 'US', '', 187.399, 6.747, 1157, 'https://image.tmdb.org/t/p/original/pyeknyOKRLBd4ROOeYL6kV103ov.jpg', 'https://image.tmdb.org/t/p/original/tRPXllE8ktssheL8yEAKwTGRDMk.jpg', ''),
(12444, 'Harry Potter y las Reliquias de la Muerte - Parte 1', 'Una tarea casi imposible cae sobre los hombros de Harry: deberá encontrar y destruir los horrocruxes restantes para dar fin al reinado de Lord Voldemort. En el episodio final de la saga, el hechicero de 17 años parte junto con sus amigos Hermione Granger y Ron Weasley en un peligroso viaje por Inglaterra para encontrar los objetos que contienen los fragmentos del alma del Señor Tenebroso, los cuales garantizan su longevidad. Pero el camino no será fácil pues el lado oscuro adquiere más poder con cada minuto que pasa y las lealtades serán puestas a prueba. Harry deberá usar todos los conocimientos que gracias a Dumbledore ha adquirido sobre su enemigo para poder encontrar la forma de sobrevivir a esta última aventura.', 146, 250000000, 954306000, '2010-11-17', 'GB', '', 132.628, 7.755, 18507, 'https://image.tmdb.org/t/p/original/AqLcLsGGTzAjm3pCCq0CZCQrp6m.jpg', 'https://image.tmdb.org/t/p/original/fYyoJ4Yadk0MCBHZPFrgvMDl50o.jpg', ''),
(12445, 'Harry Potter y las Reliquias de la Muerte - Parte 2', 'La segunda parte de la batalla final entre las fuerzas del bien y el mal. El juego nunca ha sido tan peligroso y nadie está a salvo. Se acerca el momento de la confrontación final entre Harry Potter y Lord Voldemort. Todo termina aquí…', 130, 125000000, 1341510000, '2011-07-12', 'GB', '', 150.113, 8.098, 19956, 'https://image.tmdb.org/t/p/original/n5A7brJCjejceZmHyujwUTVgQNC.jpg', 'https://image.tmdb.org/t/p/original/aM1TuUiPtV8OAZyu61CTdy9Ymtk.jpg', ''),
(13597, 'Dentro del laberinto', 'Sarah debe atravesar un laberinto para rescatar a su hermano pequeño, que ha sido secuestrado por los duendes y está en manos del poderoso rey Jareth. La niña descubre que ha llegado a un lugar donde las cosas no son siempre lo que parecen.', 101, 25000000, 12729900, '1986-06-27', 'GB', '', 168.972, 7.277, 2305, 'https://image.tmdb.org/t/p/original/92tb8mgjgL1S2KwrZezyPHPkQ3R.jpg', 'https://image.tmdb.org/t/p/original/AhRH7qhyRWGOfr88UKLfSUEm7A0.jpg', ''),
(13765, 'Muchas gracias, Mr. Scrooge', 'En 1860, un personaje tacaño y malhumorado que odia la Navidad, Ebenezer Scrooge, detesta a la gente, explota en su banco a su empleado Bob Cratchit y a sus clientes, y tiene un áspero tratamiento hacia su propio sobrino y conocidos. En la víspera de Navidad es visitado por el fantasma de su antiguo socio, Jacob Marley, quien le dice que tres espíritus lo visitarán a lo largo de la noche.  Fue nominada en 1971 a cuatro premios Óscar: a la mejor dirección de arte, al mejor diseño de vestuario, a la mejor canción original (por la canción «Thank You Very Much», de Leslie Bricusse) y a la mejor banda sonora. Albert Finney (el protagonista) ganó el Globo de oro al mejor actor de Comedia o musical en 1971.', 113, 0, 0, '1970-11-05', 'US', '', 246.446, 6.902, 127, 'https://image.tmdb.org/t/p/original/i3iaSaSjXWC4bnlrk30B9vwmjMZ.jpg', 'https://image.tmdb.org/t/p/original/eadjJGFdbZdhXSjtokmay7NjVHi.jpg', ''),
(14160, 'Up', 'Tras atar miles de globos a su casa, Carl Fredricksen, un vendedor de globos jubilado, se embarca en el mundo de los sueños de la infancia. Pero sin que Carl lo sepa, Russell, un explorador de 8 años, se encuentra en el lugar equivocado en el momento equivocado: el porche delantero de la casa. El dúo más improbable conoce a fantásticos amigos como Dug, un perro con un collar especial que le permite hablar, y Kevin, un pájaro de cuatro metros de altura que no vuela. Atrapados en la selva, Carl se da cuenta de que a veces las mayores aventuras de la vida son las que menos esperabas.', 96, 175000000, 735099000, '2009-05-28', 'US', '', 170.851, 7.958, 19606, 'https://image.tmdb.org/t/p/original/hGGC9gKo7CFE3fW07RA587e5kol.jpg', 'https://image.tmdb.org/t/p/original/cy6TJ97pUgjM0I4yhF53duTjvWY.jpg', ''),
(14564, 'Rings', 'Precuela de \'The Ring\', que contará como una joven mujer se preocupa por su novio cuando él decide explorar una oscura subcultura cuyo centro de atención es una misteriosa cinta de video que, aparentemente, mata al observador siete días después de que éste la ha visto. La joven se sacrifica para salvar a su novio y al mismo tiempo hace un terrible descubrimiento: hay una \"película dentro de la película\" que nadie ha visto antes', 117, 25000000, 83080900, '2017-02-01', 'US', '', 284.067, 5, 2419, 'https://image.tmdb.org/t/p/original/a4r8xcRwTgKIUKdWtxFXyxTZLeN.jpg', 'https://image.tmdb.org/t/p/original/bZupM9fOGUYssKzhLeZCmWIjJ3f.jpg', ''),
(14836, 'Los mundos de Coraline', 'Película de animación en la que se nos cuenta la historia de Coraline, una jovencita que descubre en su nueva casa una puerta secreta y decide abrirla. Al hacerlo, descubre una segunda versión de su vida, una vida paralela a la que ella tiene. A primera vista, la realidad paralela es curiosamente parecida a su vida de verdad, aunque mucho mejor. Pero cuando su increíble y maravillosa aventura empieza a tomar un cariz peligroso y su otra madre intenta mantenerla a su lado para siempre, Coraline deberá recurrir a su determinación y coraje, a la ayuda de los vecinos y a un gato negro con el don del habla para salvar a sus auténticos padres, a unos niños fantasmas y regresar a casa.', 101, 60000000, 131800000, '2009-02-05', 'US', '', 139.764, 7.87, 7498, 'https://image.tmdb.org/t/p/original/8GHxjXlI5rqyTBuVNekGTPjG5T6.jpg', 'https://image.tmdb.org/t/p/original/sYXXUeSrx9TBbFpbgtLklW5kmVR.jpg', ''),
(15739, 'Annie', 'Annie, una inquieta niña huérfana, ha sido seleccionada entre sus compañeras para vivir unos días en casa de un multimillonario. Aunque, en un principio, el único objetivo de éste era montar una campaña publicitaria para mejorar su imagen, inesperadamente acaba encariñándose con la niña y decide ayudarla a encontrar a sus verdaderos padres.', 127, 35000000, 57100000, '1982-05-21', 'US', '', 165.654, 6.51, 665, 'https://image.tmdb.org/t/p/original/omvnhpsp7nmW2HUgmrPrFcmUWIk.jpg', 'https://image.tmdb.org/t/p/original/fhYytFSwdmLJmiqG3eg4p81rmaY.jpg', ''),
(16281, 'Creepshow', 'Cinco historias de terror creadas por Stephen King, enmarcadas dentro de las páginas de un cómic que un insensible padre le ha tirado a su hijo a la basura.', 120, 8000000, 21028800, '1982-11-10', 'US', '', 311.898, 6.93, 960, 'https://image.tmdb.org/t/p/original/8aqTmCHLkktH7RZNALeaOMneHSl.jpg', 'https://image.tmdb.org/t/p/original/5ELCQTrBI2KdbgMiJUwWAT1VauY.jpg', ''),
(16320, 'Serenity', 'Siglo XXVI. Tras ganar la guerra Civil Galáctica, las dos grandes potencias mundiales, EE.UU. y China, se unen para formar un gobierno totalitario llamado Alianza Universal. El Capitán Malcolm Reynolds es un curtido veterano de la guerra que se gana la vida alquilando su nave, la Serenity y buscando trabajos al margen de la ley. Su única familia es una pequeña y leal tripulación de disidentes y rebeldes. Cuando Malcom embarca a dos nuevos pasajeros, un médico y su inestable hermana, que está dotada de poderes telepáticos, enseguida descubre que ambos son fugitivos de la Alianza y que ésta no se detendrá hasta dar con la chica. Y, en efecto, la tripulación de la Serenity se verá atrapada entre el poderoso ejército de la Alianza y los Ravers, salvajes bárbaros que vagan por los confines del espacio. Así las cosas, empiezan a darse cuenta de que quizá el mayor peligro se encuentra a bordo de la Serenity.', 119, 39000000, 38869500, '2005-09-25', 'US', '', 365.862, 7.379, 3350, 'https://image.tmdb.org/t/p/original/csGprKcRxt7SDpsrKiwxpgLdEsx.jpg', 'https://image.tmdb.org/t/p/original/zD81lzAEsTeEDl8f1C6t4USRihg.jpg', ''),
(19959, 'Los sustitutos', 'Ambientada en un mundo futurista donde los humanos viven aislados en interacción con robots, un policía (Willis) se verá forzado a abandonar su hogar por primera vez en años para una investigación. Todo comienza cuando dos agentes del FBI (Willis y Radha Mitchell) son asignados para investigar el misterioso asesinato de un estudiante universitario relacionado con el hombre que participó en la creación del fenómeno high-tech de los sustitutos, que permiten a la gente comprar versiones perfectas de sí mismos -en buena forma, guapos, y controlados por control remoto-. Estas máquinas perfectas acaban asumiendo sus roles vitales, de modo que la gente puede experimentar la vida a través de otro cómodamente sentados en el sofá de su casa. El asesinato pone de manifiesto una cuestión: en un mundo de máscaras ¿quién es real y en quién se puede confiar?', 88, 80000000, 122400000, '2009-09-24', 'US', '', 186.092, 6.108, 3041, 'https://image.tmdb.org/t/p/original/cCjzu6OZIUDWowadzexCHNBTmjH.jpg', 'https://image.tmdb.org/t/p/original/rg96JWGgjI3KPCJRczfvH51bmyl.jpg', ''),
(20766, 'The Road (La carretera)', 'En un futuro quizá no lejano, en un sombrío mundo post-apocalíptico, un padre (Viggo Mortensen) trata de poner en lugar seguro a su hijo (Kodi Smit-McPhee). El planeta ha sido arrasado por un misterioso cataclismo, y en medio de la desolación un padre y su hijo viajan hacia la costa para buscar un lugar seguro donde asentarse. Durante su travesía se cruzarán con los pocos seres humanos que quedan, los cuales o bien se han vuelto locos, o se han convertido en caníbales...', 112, 32000000, 27635300, '2009-11-25', 'US', '', 167.768, 7.005, 3664, 'https://image.tmdb.org/t/p/original/6188iOmUAitGThYUjyx20fO4LJd.jpg', 'https://image.tmdb.org/t/p/original/7mToUxySqVqQerBAXs84J0wkxsF.jpg', ''),
(24032, 'Oh, God!', 'Cuando Dios se le aparece a un subgerente de una tienda de comestibles como un anciano afable, el Todopoderoso lo selecciona como su mensajero para el mundo moderno.', 98, 0, 41687200, '1977-10-07', 'US', '', 157.827, 6.429, 113, 'https://image.tmdb.org/t/p/original/8slb6g36eKuMWl2jbLQJjSoqTE7.jpg', 'https://image.tmdb.org/t/p/original/5Wud2TaMbN8cxRNUXO4vPirdlEd.jpg', ''),
(24428, 'Los Vengadores', 'Cuando un enemigo inesperado surge como una gran amenaza para la seguridad mundial, Nick Fury, director de la Agencia SHIELD, decide reclutar a un equipo para salvar al mundo de un desastre casi seguro.', 143, 220000000, 1518820000, '2012-04-25', 'US', 'http://marvel.com/avengers_movie/', 170.658, 7.713, 30012, 'https://image.tmdb.org/t/p/original/9BBTo63ANSmhC4e6r62OJFuK2GL.jpg', 'https://image.tmdb.org/t/p/original/ugX4WZJO3jEvTOerctAWJLinujo.jpg', ''),
(25199, 'Una disparatada bruja en la universidad', 'Louise, de quince años, sueña con convertirse en la chica más popular del curso y conquistar el corazón de Brad, el guapísimo capitán del equipo de fútbol. Parece imposible que sus deseos se hagan realidad, pero Madame Serena, adivinadora del futuro, descubre que Louise fue una de las brujas de Salem en otra vida, y que el día que cumpla dieciséis años, obtendrá el poder de conseguir todo aquello que desee.', 90, 0, 27843, '1989-04-28', 'US', '', 114.861, 6.079, 164, 'https://image.tmdb.org/t/p/original/vRfo7aDU9k10G1FUSixOCPbcBmr.jpg', 'https://image.tmdb.org/t/p/original/3quG4zYlD8dDs98UqTIXH8kQkFz.jpg', ''),
(27205, 'Origen', 'Dom Cobb es un ladrón hábil, el mejor de todos, especializado en el peligroso arte de extracción: el robo de secretos valiosos desde las profundidades del subconsciente durante el estado de sueño cuando la mente está más vulnerable. Esta habilidad excepcional de Cobb le ha hecho un jugador codiciado en el traicionero nuevo mundo de espionaje corporativo, pero al mismo tiempo, le ha convertido en un fugitivo internacional y ha tenido que sacrificar todo que le importaba. Ahora a Cobb se le ofrece una oportunidad para redimirse. Con un último trabajo podría recuperar su vida anterior, pero solamente si logra lo imposible.', 148, 160000000, 825533000, '2010-07-15', 'US', '', 385.533, 8.368, 35686, 'https://image.tmdb.org/t/p/original/8ZTVqvKDQ8emSGUEMjsS4yHAwrp.jpg', 'https://image.tmdb.org/t/p/original/tXQvtRWfkUUnWJAn2tN3jERIUG.jpg', ''),
(27579, 'El americano', 'Jack es un mercenario solitario, un auténtico maestro entre asesinos. Pero, cuando un trabajo en Suecia no acaba tan bien como estaba previsto para este estadounidense en el extranjero, Jack le deja claro a su contacto que su próxima misión será la última. Se traslada entonces a Italia, donde se refugia en un pueblecito y empieza a disfrutar lejos de la muerte. Una mujer belga, Mathilde, le comunica que su próxima misión tiene que ver con la fabricación de un arma. Jack se sorprende a sí mismo trabando amistad con el párroco del pueblo y teniendo un romance. Pero al salir de las sombras, puede que Jack esté tentando al destino.', 105, 20000000, 67900000, '2010-08-31', 'GB', '', 264.423, 5.9, 1292, 'https://image.tmdb.org/t/p/original/hxWcdGQ1YOnnTa4BMC8XQmDBt7x.jpg', 'https://image.tmdb.org/t/p/original/1LF6NQG6CI7nY3sB5b0pygfUkkC.jpg', ''),
(34152, 'Crooklyn', 'Comedia dramática que muestra la vida de una familia negra de clase media de Brooklyn a través de un niña de 10 años.', 132, 14000000, 0, '1994-05-13', 'US', '', 273.02, 6.8, 130, 'https://image.tmdb.org/t/p/original/mIKuvEhBvDf9LGxE9x6m0hDR9Au.jpg', 'https://image.tmdb.org/t/p/original/iFqe07F78SO0SIBzWcK4I5MwNvP.jpg', ''),
(34851, 'Predators', 'Royce es un mercenario que, a regañadientes, encabeza a un grupo de guerreros de élite que acaban dándose cuenta de que los han llevado juntos a otro planeta… para servir de presa. Con la excepción de un médico desprestigiado, todos ellos son unos desalmados asesinos —mercenarios, yakuzas, presidiarios, miembros de escuadrones de la muerte—, “depredadores” humanos que ahora están siendo cazados y eliminados sistemáticamente por una nueva raza de Depredadores extraterrestres.', 107, 40000000, 127200000, '2010-07-03', 'US', '', 238.982, 6.251, 3917, 'https://image.tmdb.org/t/p/original/A49CBR0TUdVrHdSI9YcMjbyV4q9.jpg', 'https://image.tmdb.org/t/p/original/wNfucvF5YByebBVVuT0280D3VFb.jpg', ''),
(36647, 'Blade', 'En un mundo cohabitado en guerra por hombres y vampiros Blade es un vampiro que, al contrario que el resto, no se alimenta de humanos, y que pretende acabar con la raza de \"seres superiores\" que mordieron a su madre cuando estaba embarazada.', 120, 45000000, 131184000, '1998-08-21', 'US', '', 267.337, 6.783, 5736, 'https://image.tmdb.org/t/p/original/hZnnUq0mrUQ3e54SJVca4mf2oAQ.jpg', 'https://image.tmdb.org/t/p/original/dCsTsFX4PT9wewpKYaddwPHYI3A.jpg', ''),
(36669, 'Muere otro día', 'El agente 007 investiga secretamente los planes de Zao, el hijo del pacifista coronel Moon del ejército de Corea del Norte. El MI6 sospecha que Zao pueda tener planes ambiciosos que pongan en peligro la estabilidad mundial y esas sospechas se confirman cuando 007 descubre que Zao planea, efectivamente, unificar los ejércitos de las dos Coreas, atacar Japón y posteriormente, enfrentarse a los Estados Unidos. Antes de que pueda escapar Bond es descubierto por Zao quien le apresa y tortura. En su camino se cruza Jinx y Miranda Frost, quienes jugarán papeles vitales en su última aventura.', 128, 140000000, 431971000, '2002-11-17', 'US', '', 168.954, 5.981, 3353, 'https://image.tmdb.org/t/p/original/ykFpThRWBJFFouxcroZGLiNJoF6.jpg', 'https://image.tmdb.org/t/p/original/tmpgo09w8qQ8rhbA3q22PYpJcmz.jpg', ''),
(38147, 'Piensa en Dios', 'Dios se aparece ante Tracy Richards, de 11 años, para pedirle ayuda para difundir su palabra e influencia sobre el mundo, lo que sugiere el eslogan \'Piensa en Dios\'. Naturalmente, los padres divorciados de Tracy piensan que Tracy está loca y conspiran para detener su misión \'enviada del cielo\' de difundir la palabra de Dios.', 94, 0, 0, '1980-10-03', 'US', '', 234.016, 5.167, 39, 'https://image.tmdb.org/t/p/original/anqF4leHwJ9mEoPXUJTpzPjTNd3.jpg', 'https://image.tmdb.org/t/p/original/x73T2sO9vTfTI3fDoEgSmxNWIuz.jpg', ''),
(41025, 'Gargoyles', '', 74, 0, 0, '1972-11-21', 'US', '', 135.993, 5.7, 46, 'https://image.tmdb.org/t/p/original/xJeQY8MFLPMjtMcCxQKL2jC7Sfw.jpg', 'https://image.tmdb.org/t/p/original/74x0yhrNGUsAvggdE8beIEOnQrJ.jpg', ''),
(43074, 'Cazafantasmas', 'Manhattan, Nueva York. Después de casi treinta años sin saber de ellos, los fantasmas y demonios se han vuelto a escapar de los infiernos para destruir la ciudad. Esta vez un nuevo equipo de Cazafantasmas, formado por un grupo de cuatro mujeres, está dispuesto a terminar con cualquier amenaza espectral.', 116, 144000000, 229148000, '2016-07-14', 'US', '', 438.292, 5.4, 6208, 'https://image.tmdb.org/t/p/original/3RWsSQlqzRjsuqSRmoyggy74UA7.jpg', 'https://image.tmdb.org/t/p/original/gG8Tv060zoUwmeGEk8lGBULO9hw.jpg', ''),
(49047, 'Gravity', 'Durante un paseo espacial rutinario, dos astronautas sufren un grave accidente y quedan flotando en el espacio. Una es la doctora Ryan Stone, una brillante ingeniera en su primera misión espacial en la Shuttle. Su acompañante es el veterano astronauta Matt Kowalsky. Durante el paseo algo sale mal y ocurre el desastre: el shuttle queda destrozado, dejando a Ryan y Matt completamente solos, momento a partir del cual intentarán por todos los medios volver a la Tierra.', 93, 105000000, 723193000, '2013-10-03', 'US', 'http://gravitymovie.warnerbros.com', 341.505, 7.164, 14916, 'https://image.tmdb.org/t/p/original/a2n6bKD7qhCPCAEALgsAhWOAQcc.jpg', 'https://image.tmdb.org/t/p/original/3CKbEXrw88LNvBU3baISh1I7JP4.jpg', ''),
(49863, 'Dominique', 'Una joven monja (Debbie Reynolds) alcanza los primeros puestos de las listas de éxitos musicales. Además, el reencuentro con un viejo amor pone en peligro su fe. (FILMAFFINITY)', 97, 0, 0, '1966-03-17', 'US', '', 147.549, 5.5, 17, 'https://image.tmdb.org/t/p/original/qLsoHP5ri2xnOxZMp8PBf82rgkY.jpg', 'https://image.tmdb.org/t/p/original/8chyct2Uzh8nIUEIFHMZEf2stN1.jpg', ''),
(50014, 'Criadas y señoras', 'Mississippi, años 60. Skeeter es una joven sureña que regresa de la universidad decidida a convertirse en escritora. Su llegada altera la vida de la ciudad e incluso la de sus amigos porque se ha propuesto entrevistar a las mujeres negras que se han pasado la vida al servicio de las grandes familias sufriendo todas las formas de discriminación racial.', 146, 25000000, 216600000, '2011-08-09', 'US', '', 160.59, 8.205, 7920, 'https://image.tmdb.org/t/p/original/wyvUmyzqGOBDyqLHRSukGDjI7bH.jpg', 'https://image.tmdb.org/t/p/original/7V5sfN6fNNXvDdr9BPIIIOtPWOp.jpg', ''),
(50124, 'Monella', 'Una joven muy sensual que está a punto de casarse con un hombre tan tradicional que quiere que ella llegue virgen al matrimonio, siente una gran atracción sexual hacia el amante de su madre', 105, 2400000, 0, '1998-06-01', 'IT', '', 136.597, 5.02, 205, 'https://image.tmdb.org/t/p/original/a7tqHJyxQ0RpJqhG5j1ss1acukL.jpg', 'https://image.tmdb.org/t/p/original/wPmemzuBkZzyTZ8PBad1ow0Bvgw.jpg', ''),
(59053, 'La rifa', 'La bella y joven Francesca se ha quedado viuda con una hija pequeña. Para pagar las deudas de su marido, ha de vender todos los objetos de valor que posee. Tanto esfuerzo es para poder pagar el piso en el que vive y el colegio de la niña. Sin embargo, dado que sus problemas económicos no acaban ahí, decide rifarse como amante entre los hombres más ricos que la desean.', 93, 0, 0, '1991-11-15', 'IT', '', 148.365, 6.7, 136, 'https://image.tmdb.org/t/p/original/xGhwfRxTsP9VhDSNsfHqBcRvWKY.jpg', 'https://image.tmdb.org/t/p/original/1hgVccRxrDJWbraDwPDNXas0yVj.jpg', ''),
(61791, 'El origen del planeta de los simios', 'Precuela del ya mítico largometraje \"El planeta de los simios\". Will Rodman (James Franco) es un joven científico que está investigando con monos para obtener un tratamiento contra el alzheimer, una enfermedad que afecta a su padre (John Lithgow). Uno de esos primates, al que llaman César (Andy Serkis), experimenta una evolución en su inteligencia tan notable que el protagonista decide llevárselo a su casa para protegerlo. Le ayudará una bella primatóloga llamada Caroline (Freida Pinto).', 105, 93000000, 482900000, '2011-08-03', 'US', 'http://www.elorigendelplanetadelossimios.es/', 496.325, 7.307, 11299, 'https://image.tmdb.org/t/p/original/v7JTQy194gRbljdlK4OJhwnOypQ.jpg', 'https://image.tmdb.org/t/p/original/kyCXO8lTKs62V5A4IsdNLjvskWM.jpg', ''),
(62215, 'Melancolía', 'Justine y Michael celebran su boda con una suntuosa fiesta en casa de su hermana y su cuñado. Mientras tanto, el planeta Melancolía se dirige hacia la Tierra...', 129, 7400000, 15946300, '2011-05-26', 'DK', '', 269.634, 7.194, 3369, 'https://image.tmdb.org/t/p/original/cRR7N8WzOkby776y6I4vW0GQXrJ.jpg', 'https://image.tmdb.org/t/p/original/lQw4dItPPGqGChYi1Xm5eBvcBs9.jpg', ''),
(64635, 'Desafío total', 'Rekall es una empresa que puede convertir los sueños en recuerdos reales, haciendo que la frontera entre realidad y memoria se difumine. Para Douglas Quaid la idea de hacer un viaje mental que le proporcione recuerdos de una vida como superespía puede ser la solución perfecta para contrarrestar su frustrante vida. Lo malo es que el proceso sale mal, y Quaid se convierte en un hombre perseguido por los agentes de un estado totalitario. En su huida, se asocia con una combatiente rebelde con el fin de encontrar al cabecilla de la resistencia clandestina. Mientras el destino del mundo pende de un hilo, Quaid descubre su verdadera identidad y su verdadero destino. Se inspira en el cuento \"Podemos recordar por usted al por mayor\" de Philip K. Dick.', 121, 125000000, 198800000, '2012-08-02', 'US', '', 309.706, 6.012, 5300, 'https://image.tmdb.org/t/p/original/uBHeAB2Ug9ELBzkMyls8CUjzn4i.jpg', 'https://image.tmdb.org/t/p/original/vX5aHvyyRgyjrSNnBRWuSfPcjOQ.jpg', ''),
(68718, 'Django desencadenado', 'Dos años antes de estallar la Guerra Civil (1861-1865), Schultz, un cazarrecompensas alemán que le sigue la pista a unos asesinos, le promete al esclavo Django dejarlo en libertad si le ayuda a atraparlos. Terminado con éxito el trabajo, Django prefiere seguir al lado del alemán y ayudarle a capturar a los delincuentes más buscados del Sur. Se convierte así en un experto cazador de recompensas, pero su único objetivo es rescatar a su esposa Broomhilda, a la que perdió por culpa del tráfico de esclavos. La búsqueda llevará a Django y a Schultz hasta Calvin Candie, el malvado propietario de la plantación \"Candyland\". La presencia de ambos en los alrededores de la propiedad, despierta las sospechas de Stephen, el esclavo de confianza de Candie.', 165, 100000000, 425368000, '2012-12-25', 'US', '', 174.909, 8.178, 25553, 'https://image.tmdb.org/t/p/original/w6Fs4bIje1naeILo9KwAc1Y6bvP.jpg', 'https://image.tmdb.org/t/p/original/naaYX64yMGzEFsATOFQDaxxQWbJ.jpg', ''),
(68721, 'Iron Man 3', 'El descarado y brillante empresario Tony Stark/Iron Man se enfrentará a un enemigo cuyo poder no conoce límites. Cuando Stark comprende que su enemigo ha destruido su universo personal, se embarca en una angustiosa búsqueda para encontrar a los responsables. Este viaje pondrá a prueba su entereza una y otra vez. Acorralado, Stark tendrá que sobrevivir por sus propios medios, confiando en su ingenio y su instinto para proteger a las personas que quiere.', 130, 200000000, 1215580000, '2013-04-18', 'US', '', 254.379, 6.9, 21665, 'https://image.tmdb.org/t/p/original/aFTYFqrWp4RS46Twm87l5e0ItYb.jpg', 'https://image.tmdb.org/t/p/original/cW0fOIZONkgeiMJDYzqUcgl4MUn.jpg', ''),
(68730, 'Silencio', 'Dos sacerdotes jesuitas, Sebastião Rodrigues y Francisco Garupe, viajan al Japón del siglo XVII que, bajo el shogunato Tokugawa, prohibió el catolicismo y casi todos los contactos extranjeros. Allí son testigos de la persecución de los cristianos japoneses a manos de su propio gobierno, que desea purgar Japón de toda influencia occidental. Eventualmente los sacerdotes se separan y Rodrigues viaja por el campo, preguntándose por qué Dios permanece en silencio mientras sus hijos sufren.', 159, 46000000, 23700000, '2016-12-22', 'TW', '', 330.345, 7.124, 2958, 'https://image.tmdb.org/t/p/original/2tE0A6WjLowwQOUY8se1Xlf3O6U.jpg', 'https://image.tmdb.org/t/p/original/jZxSqam9PImEIDXtD3HIKPwmd9K.jpg', '');
INSERT INTO `pelicula` (`id`, `titulo`, `sinopsis`, `duracion`, `presupuesto`, `ganancias`, `fecha_estreno`, `pais_origen`, `web`, `popularidad`, `valoracion`, `total_votos`, `fondo`, `poster`, `adulto`) VALUES
(79474, 'Más que amor, frenesí', 'Max vive de las mujeres pero... ¿Es cierto que las mata después de hacer el amor con ellas? Mónica oculta en su bolso: sus bragas, una pistola y una cinta de video donde hace el amor con Max. \"Más que amor frenesí\" es la historia de un crimen sexual, de jóvenes que juegan con fuego, que disfrazan la verdad convirtiéndola en lo que ellos quieren que sea. Es una película de sentimientos donde se confunde el amor con el deseo y con el miedo a la sociedad. Reencuentros, secretos, confesiones, locuras, sueños, arrebatos, decepciones y evasión. Personajes que buscan en el sexo la amistad, el cariño, su propia identidad o simplemente dinero. Entre todos ellos hay tres puntos en común: su juventud, la música y el delirio furioso que es \"Más que amor frenesí\".', 100, 0, 0, '1996-11-15', 'ES', '', 384.592, 5.5, 17, 'https://image.tmdb.org/t/p/original/cEcG1Z32NWJrRKmhmEh13VyPRfk.jpg', 'https://image.tmdb.org/t/p/original/e843ZAdn3f5R7SFTRIqoV7Ttk91.jpg', ''),
(85350, 'Boyhood (Momentos de una vida)', 'Es la historia de Mason desde los seis años y durante una década poblada de cambios: mudanzas y controversias, relaciones que se tambalean, bodas, diferentes colegios, primeros amores, también desilusiones, momentos maravillosos, de miedo y de una constante mezcla de desgarro y sorpresa. Un viaje íntimo y épico por la euforia de la niñez, los sísmicos cambios de una familia moderna y el paso del tiempo.', 164, 4000000, 48137700, '2014-06-05', 'US', 'http://www.imdb.com/offsite/?page-action=imdb&token=BCYhbsrgRSyKxzXYjWIpwyjEZCO2NOMbgBWXantNgd-f5tWGbqFDG5y1EWmem2N7bdgKSlOfon8o%0D%0A2fN47W5Qnj1EUjjjZdnokn5tvuIEin8mUvjktjbVoTXm1LsAPOZyyKIHjZK893qdmr', 176.693, 7.506, 4997, 'https://image.tmdb.org/t/p/original/qRwkMMZhQRKM4uDaXpd2XbZZmkE.jpg', 'https://image.tmdb.org/t/p/original/7wB1OG7YrJRolO74PhvzikeWVCv.jpg', ''),
(86829, 'A propósito de Llewyn Davis', 'La vida de un joven cantante de folk en el universo de Greenwich Village en 1961. Llewyn Davis está en una encrucijada. Con su guitarra a cuestas acurrucado contra el frio de un invierno implacable en Nueva York, el joven lucha por ganarse la vida como músico y hace frente a obstáculos que parecen insuperables – comenzando por aquellos creados por él mismo. Sobrevive gracias a la ayuda de sus amigos o de desconocidos a cambio de pequeños trabajos. De los cafés del Village a un club desierto de Chicago, sus desventuras lo llevan a una audición para el gigante de la música Bud Grossman – antes de volver al lugar de donde viene...', 104, 11000000, 32935300, '2013-10-18', 'US', '', 145.212, 7.197, 2597, 'https://image.tmdb.org/t/p/original/6QOZ7RGucRJLGvm7TH5k2BN0xSp.jpg', 'https://image.tmdb.org/t/p/original/iQLwlcN6IyvWR50HJfmh6ClZKab.jpg', ''),
(87101, 'Terminator Génesis', 'Año 2032. La guerra del futuro se está librando y un grupo de rebeldes humanos tiene el sistema de inteligencia artificial Skynet contra las cuerdas. John Connor es el líder de la resistencia, y Kyle Reese es su fiel soldado, criado en las ruinas de una postapocalíptica California. Para salvaguardar el futuro, Connor envía a Reese a 1984 para salvar a su madre, Sarah de un Terminator programado para matarla con el fin de que no llegue a dar a luz a John. Pero lo que Reese encuentra en el otro lado no es como él esperaba.', 126, 155000000, 440604000, '2015-06-23', 'US', '', 179.635, 5.94, 8147, 'https://image.tmdb.org/t/p/original/g4a5YLWwi6OCp8TcvxsUNrXMbN5.jpg', 'https://image.tmdb.org/t/p/original/5N5PnUoywvOduFb4Qw6HD2LkMtu.jpg', ''),
(87818, 'Movie 43', 'Serie de sketches cómicos que cuentan 14 disparatadas historias, dirigidas entre otros por los Hermanos Farrelly y con un reparto coral espectacular, todas conectadas entre sí y cada cual más hilarante que la anterior. Desde cómo fracasa una cita de dos jóvenes cuando la chica se convierte en “mujer” hasta la cita rápida de un superhéroe.', 90, 6000000, 32400000, '2013-01-24', 'US', '', 115.043, 4.58, 2219, 'https://image.tmdb.org/t/p/original/kjTGuAeMsTTRxiHFSzj2T1zyUwH.jpg', 'https://image.tmdb.org/t/p/original/rWvr31yNd9VZ1VVk6sd3iWw8mua.jpg', ''),
(109428, 'Posesión infernal (Evil Dead)', 'Cinco amigos se alojan en una cabaña de Tenessee para así poder ayudar a una de los jóvenes, que se encuentra en rehabilitación por drogas. Estar sin sus drogas convierte a la chica en una persona agresiva, lo que llevará a sus amigos a no darse cuenta de que en realidad esta poseída por demonios que fueron desatados al leer el Necromicon... Remake del clásico de Raimi.', 90, 17000000, 97543000, '2013-04-05', 'US', '', 141.614, 6.534, 4415, 'https://image.tmdb.org/t/p/original/6RDgtEBzjuF7W25DVziXRABchpX.jpg', 'https://image.tmdb.org/t/p/original/oyQQOW3Be36MRRC3Rwd7Qubugxj.jpg', ''),
(119450, 'El amanecer del planeta de los simios', 'Un grupo de simios con grandes cualidades para la supervivencia toma las calles, liderado por César, un simio dotado de una inteligencia y unos instintos superiores para cualquier primate. Ante la necesidad de libertad, esta raza animal decide no doblegarse ante los humanos. Tendrá que luchar contra un grupo de humanos que han sobrevivido a una fuerte epidemia, desatada en la década anterior. Ambas partes han establecido una tregua, pero se verá interrumpida.', 130, 170000000, 710600000, '2014-07-08', 'US', '', 686.977, 7.314, 10802, 'https://image.tmdb.org/t/p/original/4TFCA5Lm5miseV3Wy02yxurEQL9.jpg', 'https://image.tmdb.org/t/p/original/qNu2N4a9nuGWgkeg3NzdRTDOz5N.jpg', ''),
(122917, 'El hobbit: La batalla de los cinco ejércitos', 'Después de haber recuperado el reino del Dragón Smaug, la Compañía ha desencadenado, sin querer, una potencia maligna. Un Smaug enfurecido vuela hacia la Ciudad del Lago para acabar con cualquier resto de vida. Obsesionado sobre todo con el reino recuperado, Thorin sacrifica la amistad y el honor para mantenerlo mientras que Bilbo intenta frenéticamente hacerle ver la razón por la que el hobbit toma una decisión desesperada y peligrosa. Pero hay aún mayores peligros por delante. Sin la ayuda aparente del mago Gandalf, su gran enemigo Sauron ha enviado legiones de orcos hacia la Montaña Solitaria en un ataque furtivo. Cuando la oscuridad se cierna sobre ellos, las razas de los Enanos, Elfos y Hombres deben decidir si unirse o ser destruidos. Bilbo se encontrará así en la batalla épica de los Cinco Ejércitos, donde el futuro de la Tierra Media está en juego.', 144, 250000000, 956020000, '2014-12-10', 'US', '', 154.612, 7.317, 13815, 'https://image.tmdb.org/t/p/original/bVmSXNgH1gpHYTDyF9Q826YwJT5.jpg', 'https://image.tmdb.org/t/p/original/6OiNSLcRKJsBLXwb6DEi6IQ0JFk.jpg', ''),
(124905, 'Godzilla', 'Gareth Edwards dirige este \"reboot\", que se sitúa antes en el tiempo que la película de 1998 dirigida por Roland Emmerich, que nos llevará a conocer los orígenes del famoso monstruo japonés gigante Godzilla.  Protagonizada por Bryan Cranston, ganador del Globo de Oro por Breaking Bad, que da vida a Joe Brody un científico que descubre que algo terrible está a punto de suceder cuando una serie de tsunamis comienzan a llegar a las costas, anticipando la llegada de numerosos monstruos de gran tamaño mientras el ejército intenta defenderse en vano.', 123, 160000000, 529100000, '2014-05-14', 'US', '', 141.785, 6.326, 8826, 'https://image.tmdb.org/t/p/original/zCjZfevPFBbOh2SAx2syIBHSqEI.jpg', 'https://image.tmdb.org/t/p/original/1t0FcqSsBs51PDhDkFd7EiEytU6.jpg', ''),
(126889, 'Alien: Covenant', 'Rumbo a un remoto planeta al otro lado de la galaxia, la tripulación de la nave colonial Covenant descubre lo que creen que es un paraíso inexplorado, pero resulta tratarse de un mundo oscuro y hostil cuyo único habitante es un \"sintético\" llamado David (Michael Fassbender), superviviente de la malograda expedición Prometheus.  Secuela de \"Prometheus\" (2012), a su vez precuela de \"Alien, el octavo pasajero\" (1979).', 122, 97000000, 240892000, '2017-05-09', 'US', '', 357.362, 6.105, 8179, 'https://image.tmdb.org/t/p/original/2qluV8y79LnBBHaMpwewCjQ1Htk.jpg', 'https://image.tmdb.org/t/p/original/245tgZ3mTHWs0NRiPSwPjKobKHf.jpg', ''),
(138843, 'Expediente Warren: The Conjuring', 'Basada en una historia real documentada por los reputados demonólogos Ed y Lorraine Warren. Narra los encuentros sobrenaturales que vivió la familia Perron en su casa de Rhode Island a principios de los 70. El matrimonio Warren, investigadores de renombre en el mundo de los fenómenos paranormales, acudieron a la llamada de esta familia aterrorizada por la presencia en su granja de un ser maligno.', 112, 13000000, 320400000, '2013-07-18', 'US', '', 151.388, 7.541, 11126, 'https://image.tmdb.org/t/p/original/aQCCpAIdWAp6wyFgjMry4okwrZo.jpg', 'https://image.tmdb.org/t/p/original/sKuHxkCogdk6YWzTyXYPoo9qd9n.jpg', ''),
(141052, 'Liga de la Justicia', 'Motivado por la fe que había recuperado en la humanidad e inspirado por la acción altruista de Superman, Bruce Wayne recluta la ayuda de su nueva aliada, Diana Prince, para enfrentarse a un enemigo aún mayor. Juntos, Batman y Wonder Woman se mueven rápidamente para intentar encontrar y reclutar un equipo de metahumanos que combata esta nueva amenaza. El problema es que a pesar de la formación de esta liga de héroes sin precedentes (Batman, Wonder Woman, Aquaman, Cyborg y Flash) puede que sea demasiado tarde para salvar el planeta de una amenaza de proporciones catastróficas.', 121, 300000000, 661327000, '2017-11-15', 'US', '', 300.777, 6.087, 12635, 'https://image.tmdb.org/t/p/original/2nyaeISu2xIxIgZYNpX4UayY8PN.jpg', 'https://image.tmdb.org/t/p/original/wUWqnavD8iGZ5F4xXhWlrtEzKjV.jpg', ''),
(152601, 'Her', 'En un futuro cercano, Theodore, un hombre solitario a punto de divorciarse que trabaja en una empresa como escritor de cartas para terceras personas, compra un día un nuevo sistema operativo basado en el modelo de Inteligencia Artificial, diseñado para satisfacer todas las necesidades del usuario. Para su sorpresa, se crea una relación romántica entre él y Samantha, la voz femenina de ese sistema operativo.', 126, 23000000, 47351300, '2013-12-18', 'US', 'http://www.herthemovie.com/', 132.865, 7.857, 13873, 'https://image.tmdb.org/t/p/original/sPPsR9f4K0movWVQ99u4uMqFzEL.jpg', 'https://image.tmdb.org/t/p/original/n1sY9uAsQKOus91A4FtvN3JdHYH.jpg', ''),
(157336, 'Interstellar', 'Narra las aventuras de un grupo de exploradores que hacen uso de un agujero de gusano recientemente descubierto para superar las limitaciones de los viajes espaciales tripulados y vencer las inmensas distancias que tiene un viaje interestelar.', 169, 165000000, 701729000, '2014-11-05', 'US', 'https://www.warnerbros.co.uk/movies/interstellar', 398.499, 8.434, 34298, 'https://image.tmdb.org/t/p/original/xJHokMbljvjADYdit5fK5VQsXEG.jpg', 'https://image.tmdb.org/t/p/original/nrSaXF39nDfAAeLKksRCyvSzI2a.jpg', ''),
(157433, 'Cementerio de animales', 'El doctor Louis Creed (Clarke) se muda con su mujer Racher (Seimetz) y sus dos hijos pequeños de Boston a un pueblecito de Maine, cerca del nuevo hogar de la familia descubrirá una terreno misterioso escondido entre los árboles. Cuando la tragedia llega, Louis hablará con su nuevo vecino, Jud Crandall (Lithgow), desencadenando una peligrosa reacción en cadena que desatará un mal de horribles consecuencias.', 105, 21000000, 113118000, '2019-04-04', 'US', '', 159.844, 5.737, 3092, 'https://image.tmdb.org/t/p/original/dMWVeuVce8ZLKLI0xpVevihEwm8.jpg', 'https://image.tmdb.org/t/p/original/ktEYyuUwreQgE3S8HMRcyxBHonC.jpg', ''),
(167073, 'Brooklyn', 'En los años 50, la joven Eilis Lacey decide abandonar Irlanda y viajar a los Estados Unidos, concretamente a Nueva York, donde conoce a un chico del que se enamora. Pero un día, a Eilis le llegan noticias de un grave problema familiar y tendrá que decidir entre quedarse en su nuevo país o volver a su tierra natal.', 111, 11000000, 62076100, '2015-10-20', 'IE', '', 179.398, 7.314, 3007, 'https://image.tmdb.org/t/p/original/2T4bqHgYfzXNQoALJsvhW40kDTg.jpg', 'https://image.tmdb.org/t/p/original/1I8PTNKB4ycreZ5Pgg2a0poSYU3.jpg', ''),
(168098, 'Conexión Mortal', 'Clayton Riddell es un famoso novelista que se encuentra en la cúspide de su carrera cómo escritor. Debe ir a Boston a presentar su última novela gráfica, aunque se encuentra melancólico debido a que su familia no ha podido acompañarle.  A la vuelta de la presentación, comienzan a ocurrir cosas extrañas a su alrededor. Unas estruendas señales móviles están conviertiendo a los seres humanos en unos devoradores de sangre. Ante este estrepitoso accidente, Ridell deberá buscar la manera de llegar a su hogar y salvar a su familia antes de que esta plaga acabe con ellos.Adaptación de la novela de Stephen King \"Cell\"; en la elaboración del guión intervino el propio King.', 98, 0, 1133030, '2016-07-06', 'US', '', 185.285, 4.678, 1013, 'https://image.tmdb.org/t/p/original/pprNvcLi63ATKIGMipUwH0xQIJg.jpg', 'https://image.tmdb.org/t/p/original/c721WxCCzeLJS99BOMBYAzicnJF.jpg', ''),
(188927, 'Star Trek: Más allá', 'El USS Enterprise, la nave insignia de la Flota Estelar, liderada por el capitán James T. Kirk, vuelve a surcar el universo, para proteger la Tierra y el resto de planetas aliados. Pero la tranquilidad durará poco y el peligro acecha. La primera etapa de su misión les llevará a un territorio desconocido, y su travesía pronto se convertirá en una carrera por la supervivencia, cuando se enfrenten a un nuevo y fiero enemigo, Krall, de una especie alienígena avanzada. A la vez que intentan encontrar el modo de volver a la Tierra, su objetivo será proteger el futuro de la raza humana y preservar la armonía entre especies...', 122, 185000000, 343500000, '2016-07-07', 'US', 'http://www.startrekmovie.com/', 149.015, 6.784, 6442, 'https://image.tmdb.org/t/p/original/m4F1KRK5jAoQHi2mKDFE2jFKEIb.jpg', 'https://image.tmdb.org/t/p/original/2yfbpstJY4Fan8DSfPFDl05jx9.jpg', ''),
(198184, 'Chappie', 'En un futuro cercano, la policía mecanizada controla el crimen. Cuando un droide de la policía, Chappie, es robado y se le da una nueva programación, se convierte en el primer robot con la capacidad de pensar y sentir por sí mismo.', 120, 49000000, 104400000, '2015-03-04', 'US', '', 286.121, 6.78, 7681, 'https://image.tmdb.org/t/p/original/qX5T5GVAcq2UKaaiAx5SZp1AtlY.jpg', 'https://image.tmdb.org/t/p/original/g2kVBpRljENCi8KskBi0tedK3UE.jpg', ''),
(198663, 'El corredor del laberinto', 'Thomas abre los ojos y se da cuenta que está en un ascensor. Lo extraño es que no recuerda nada, ni dónde está, ni quién es. Lo único que aún permanece intacto en su memoria es su nombre, y ya es mucho. Antes de que le dé tiempo a cuestionarse algo sobre sí mismo las puertas se abrirán y aparecerá ante él un extraño mundo. Todo lo que ve son chicos de su edad que tienen su mismo estado de amnesia. Una aventura fantástica que pronto destapará la dura realidad bajo ese velo de incertidumbre: todos ellos están atrapados en un laberinto. Si quieren tener alguna posibilidad de salir de allí y recuperar su antigua vida y aquello que no son capaces de recordar deberán unir fuerzas para escapar. Un mundo post-apocalíptico que les acorralará e irá un paso por delante será el desafío que tengan que pasar estos jóvenes por la libertad.', 113, 34000000, 348320000, '2014-09-10', 'US', '', 159.075, 7.181, 16491, 'https://image.tmdb.org/t/p/original/eTlcNXGv32zkVI7ZDHhfeaKHXKQ.jpg', 'https://image.tmdb.org/t/p/original/jt7SZYSnE9NHV4ZrDex1ilRyVIW.jpg', ''),
(206647, 'Spectre', 'Un críptico mensaje del pasado envía a James Bond a una misión secreta a México D.F. y luego a Roma, donde conoce a Lucía Sciarra, la hermosa viuda de un infame criminal. Bond se infiltra en una reunión secreta y descubre la existencia de una siniestra organización conocida como SPECTRE. Mientras tanto, en Londres, el nuevo director del Centro para la Seguridad Nacional cuestiona las acciones de Bond y pone en duda la importancia del MI6, encabezado por M. De modo encubierto Bond recluta a Moneypenny y Q para que le ayuden a buscar a Madeleine Swann, la hija de su antiguo archienemigo, el Sr. White, que quizá tenga la clave para desentrañar el misterio de SPECTRE. A medida que Bond avanza en su misión, descubre una estremecedora conexión entre él mismo y el enemigo que busca.', 148, 245000000, 880675000, '2015-10-26', 'US', '', 364.548, 6.543, 10221, 'https://image.tmdb.org/t/p/original/8lBViysvNJBPkl6zG1LVAaW3qhj.jpg', 'https://image.tmdb.org/t/p/original/8NCrCV6tR0Uafp8eVYiZbRsvrAv.jpg', ''),
(223702, 'La fiesta de las salchichas', 'La trama sigue el drama de una salchicha y sus amigos, otros productos de supermercado, cuando descubren que serán brutalmente asesinados al llegar a casa de sus compradores. Es entonces que necesitan encontrar una manera de regresar al supermercado y avisar a sus amigos de lo que realmente sucede con la comida.', 89, 19000000, 140705000, '2016-07-11', 'US', '', 144.463, 5.745, 7024, 'https://image.tmdb.org/t/p/original/uHTjgDGom9iOoUZke86gqMjBUgy.jpg', 'https://image.tmdb.org/t/p/original/4YiHAxavhMLaBqOzx7ZirmOwNkD.jpg', ''),
(262504, 'La serie Divergente: Leal', 'Tras las revelaciones trascendentales de \'Insurgente\', Tris debe escapar con Cuatro e ir más allá del muro que rodea Chicago. Por primera vez dejarán la única ciudad y familia que conocen. Una vez fuera, todo aquello que presuponían como cierto, pierde cualquier sentido tras la revelación de nuevas verdades. Tris y Cuatro deben decidir rápidamente en quién confiar mientras se inicia una guerra despiadada que amenaza a toda la humanidad. Para sobrevivir, Tris se verá forzada a tomar decisiones imposibles sobre el coraje, la lealtad, el sacrificio y el amor. Secuela de \"Insurgente\" (2015) y punto final a la saga iniciada por \"Divergente\" (2014). Dividida en dos partes, una estrenada en 2016 y otra en 2017.', 121, 110000000, 179247000, '2016-03-09', 'US', '', 181.452, 6.104, 6420, 'https://image.tmdb.org/t/p/original/qSP072apfe2EEcd5Qg9vGYy2OLw.jpg', 'https://image.tmdb.org/t/p/original/vuuTnHvqW860vsCFRt6OC6lvcDI.jpg', ''),
(263115, 'Logan', 'Sin sus poderes, por primera vez, Lobezno es verdaderamente vulnerable. Después de una vida de dolor y angustia, sin rumbo y perdido en el mundo donde los X-Men son leyenda, su mentor Charles Xavier lo convence de asumir una última misión: proteger a una joven que será la única esperanza para la raza mutante.', 137, 97000000, 619021000, '2017-02-28', 'US', '', 448.119, 7.817, 18674, 'https://image.tmdb.org/t/p/original/9X7YweCJw3q8Mcf6GadxReFEksM.jpg', 'https://image.tmdb.org/t/p/original/d0ktjN9eKww26HhM8or8iUB1I68.jpg', ''),
(264660, 'Ex Machina', 'Nathan, un programador multimillonario con fama de ermitaño, selecciona a Caleb, un joven empleado de su empresa, para que pase una semana con él en un lugar remoto en las montañas con el objetivo de realizar un test en el que está involucrada su última creación: Ava, un robot-mujer en el que la inteligencia artificial lo es todo.', 108, 15000000, 36869400, '2015-01-21', 'GB', 'http://www.exmachinamovie.co.uk/', 223.666, 7.573, 12847, 'https://image.tmdb.org/t/p/original/dlz8uzyl9mHPyHXbveXutzpx8jI.jpg', 'https://image.tmdb.org/t/p/original/mQohkAkV1m7yT43UnYkgvmyKUoa.jpg', ''),
(269149, 'Zootrópolis', 'La moderna metrópoli mamífera de Zootrópolis es una ciudad absolutamente única. Está compuesta de barrios con diferentes hábitats como la lujosa Plaza Sahara, el Distrito Selva Tropical y el gélido Distrito Tundra. Es un crisol donde los animales de cada entorno conviven, un lugar donde no importa lo que seas. De hecho puedes ser cualquier cosa, desde un elefante enorme hasta la musaraña más diminuta. Pero cuando llega la optimista agente Judy Hopps, descubre que ser la primera conejita de un cuerpo policial compuesto de animales duros y enormes no es nada fácil. Pero está decidida a demostrar su valía y se mete de cabeza en un caso, a pesar de que eso significa trabajar con Nick Wilde, un zorro parlanchín y estafador, para resolver el misterio.', 100, 150000000, 1023780000, '2016-02-11', 'US', '', 139.133, 7.747, 15816, 'https://image.tmdb.org/t/p/original/p2fRZzxla6NoRbIH2KOZq0gHb5S.jpg', 'https://image.tmdb.org/t/p/original/i3WnZpJkQYXXbSGplEGmyoyeskM.jpg', ''),
(271110, 'Capitán América: Civil War', 'Continúa la historia de “Avengers: Age of Ultron”, con Steve Rogers liderando un nuevo equipo de Vengadores en su esfuerzo por proteger a la humanidad. Tras otro incidente internacional relacionado con los Vengadores que ocasiona daños colaterales, la presión política fuerza a crear un sistema de registro y un cuerpo gubernamental para determinar cuándo se requiere los servicios del equipo. El nuevo status quo divide a los Vengadores mientras intentan salvar al mundo de un nuevo y perverso villano.', 147, 250000000, 1155050000, '2016-04-27', 'US', '', 137.855, 7.4, 22153, 'https://image.tmdb.org/t/p/original/kvRT3GwcnqGHzPjXIVrVPhUix7Z.jpg', 'https://image.tmdb.org/t/p/original/g6UTwUVFYWI8VPWo5GylnbZVhin.jpg', ''),
(281338, 'La guerra del planeta de los simios', 'César y sus monos son forzados a encarar un conflicto mortal contra un ejército de humanos liderado por un brutal coronel. Después de sufrir pérdidas enormes, César lucha con sus instintos más oscuros en una búsqueda por vengar a su especie. Cuando finalmente se encuentren, Cesar y el Coronel protagonizarán una batalla que pondrá en juego el futuro de ambas especies y el del mismo planeta. Tercera película de la nueva saga de El Planeta de los Simios.', 140, 150000000, 490700000, '2017-07-11', 'CA', '', 500.534, 7.179, 8466, 'https://image.tmdb.org/t/p/original/qdd5lrgBYL4fMSwYAhfLUwdJRu1.jpg', 'https://image.tmdb.org/t/p/original/4s51V3REPzdABoEDLC4TPDPkY3b.jpg', ''),
(282035, 'La momia', 'A pesar de estar enterrada en una tumba en lo más profundo del desierto, una antigua princesa (Sofia Boutella) cuyo destino le fue arrebatado injustamente, se despierta en la época actual, trayendo consigo una maldición que ha crecido hasta límites insospechados con el paso de miles de años.', 110, 125000000, 409232000, '2017-06-06', 'US', 'http://www.lamomia-lapelicula.es', 251.682, 5.51, 6976, 'https://image.tmdb.org/t/p/original/i4ZougHEyBAboDpi6jsaTUDTjUl.jpg', 'https://image.tmdb.org/t/p/original/6JEbMNds0ZRBD5AYcIIhCqRVgQU.jpg', ''),
(284052, 'Doctor Strange', 'La vida del famoso neurocirujano Stephen Strange cambia radicalmente cuando un accidente le impide el uso de sus manos y se ve forzado a buscar una cura en un misterioso enclave. Inmediatamente aprende que no solo es un sanatorio... es también el frente de batalla contra oscuras fuerzas, y debe elegir entre volver a su antigua vida o defender al mundo como el más poderoso hechicero del momento. Algunas secuencias o formas con luces parpadeantes pueden afectar a los espectadores fotosensibles.', 115, 180000000, 676343000, '2016-10-25', 'US', '', 342.68, 7.4, 21563, 'https://image.tmdb.org/t/p/original/3zvZ699gMW2RhWc0GisIukzq0Ls.jpg', 'https://image.tmdb.org/t/p/original/wJEZI3PWyMW7qcW6n9jyCh7Cclf.jpg', ''),
(284053, 'Thor: Ragnarok', 'Thor está preso al otro lado del universo sin su poderoso martillo y se enfrenta a una carrera contra el tiempo. Su objetivo es volver a Asgard y parar el Ragnarok porque significaría la destrucción de su planeta natal y el fin de la civilización Asgardiana a manos de una todopoderosa y nueva amenaza, la implacable Hela. Pero, primero deberá sobrevivir a una competición letal de gladiadores que lo enfrentará a su aliado y compañero en los Vengadores, ¡el Increíble Hulk!', 131, 180000000, 855302000, '2017-10-02', 'US', '', 428.837, 7.6, 20186, 'https://image.tmdb.org/t/p/original/kaIfm5ryEOwYg8mLbq8HkPuM1Fo.jpg', 'https://image.tmdb.org/t/p/original/pGtkLdk4rnF2A3Yz2BHiTgRwMU4.jpg', ''),
(284054, 'Black Panther', 'Después de los acontecimientos de \"Capitán América: Civil War\", T\'Challa vuelve a casa, la nación aislada y muy avanzada tecnológicamente de Wakanda, para ser proclamado Rey. Pero la reaparición de un viejo enemigo pone a prueba el temple de T\'Challa como Rey y Black Panther ya que se ve arrastrado a un conflicto que pone en peligro todo el destino de Wakanda y del mundo.', 134, 200000000, 1349930000, '2018-02-13', 'US', 'https://www.disney.es/peliculas/black-panther', 394.484, 7.385, 21649, 'https://image.tmdb.org/t/p/original/b6ZJZHUdMEFECvGiDpJjlfUWela.jpg', 'https://image.tmdb.org/t/p/original/lAPzezdc5E6DFnttJwCWXZ9A9C6.jpg', ''),
(287947, '¡Shazam!', 'Todos llevamos un superhéroe dentro, solo se necesita un poco de magia para sacarlo a la luz. Cuando Billy Batson, un niño de acogida de 14 años que ha crecido en las calles, grita la palabra \'SHAZAM!\' se convierte en el Superhéroe adulto Shazam, por cortesía de un antiguo mago. Dentro de un cuerpo musculoso y divino, Shazam esconde un corazón de niño. Pero lo mejor es que en esta versión de adulto consigue realizar todo lo que le gustaría hacer a cualquier adolescente con superpoderes: ¡divertirse con ellos! ¿Volar? ¿Tener visión de rayos X? ¿Disparar un rayo con las manos? ¿Saltarse el examen de sociales? Shazam va a poner a prueba los límites de sus habilidades con la inconsciencia propia de un niño. Pero necesitará dominar rápidamente esos poderes para luchar contra las letales fuerzas del mal que controla el Dr. Thaddeus Sivana.', 132, 80000000, 367799000, '2019-03-29', 'US', '', 285.5, 7.018, 9198, 'https://image.tmdb.org/t/p/original/o7JVhqMmrex1TPbmuxl8YXVlcfl.jpg', 'https://image.tmdb.org/t/p/original/4f5Rz8uYpcTvo1hHKcQRSaay0ek.jpg', ''),
(290859, 'Terminator: Destino oscuro', 'Sarah Connor une todas sus fuerzas con una mujer cyborg para proteger a una joven de un extremadamente poderoso y nuevo Terminator.', 120, 185000000, 261119000, '2019-10-23', 'US', '', 149.678, 6.453, 4879, 'https://image.tmdb.org/t/p/original/a6cDxdwaQIFjSkXf7uskg78ZyTq.jpg', 'https://image.tmdb.org/t/p/original/rw7oBLQlJM7l5LToAiBktnMvsMr.jpg', ''),
(293660, 'Deadpool', 'Basado en el anti-héroe menos convencional de la Marvel, Deadpool narra el origen de un ex-operativo de la fuerzas especiales llamado Wade Wilson, reconvertido a mercenario, y que tras ser sometido a un cruel experimento adquiere poderes de curación rápida, adoptando Wade entonces el alter ego de Deadpool. Armado con sus nuevas habilidades y un oscuro y retorcido sentido del humor, Deadpool intentará dar caza al hombre que casi destruye su vida.', 109, 58000000, 782837000, '2016-02-09', 'US', '', 437.83, 7.612, 29854, 'https://image.tmdb.org/t/p/original/en971MEXui9diirXlogOrPKmsEn.jpg', 'https://image.tmdb.org/t/p/original/3TUYy0XvhPQBhrXJwRIaOoYFOBO.jpg', ''),
(297762, 'Wonder Woman', 'Diana, princesa de las Amazonas, entrenada para ser una guerrera invencible, fue criada en una isla paradisíaca protegida, hasta que un día, un piloto norteamericano, que tuvo un accidente y acabó en sus costas, le habló de un gran conflicto existente en el mundo, la Primera Guerra Mundial. Diana decidió salir de la isla, convencida de que podía detener la terrible amenaza. Ahora lucha como Wonder Woman, junto a los hombres, en la guerra que acabará con todas las guerras y descubre todos sus poderes y su verdadero destino.', 141, 149000000, 823971000, '2017-05-30', 'US', '', 397.004, 7.229, 19495, 'https://image.tmdb.org/t/p/original/6iUNJZymJBMXXriQyFZfLAKnjO6.jpg', 'https://image.tmdb.org/t/p/original/js7cN75bbBnNeQScT0jTRfIkTAa.jpg', ''),
(297802, 'Aquaman', 'Arthur Curry, también conocido como Aquaman (Jason Momoa), es un habitante de un poderoso reino subacuático que recibe el nombre de la Atlántida. En esta película repleta de acción, aventura, e incluso partes de terror, conoceremos sus orígenes, desde que era un niño criado por un hombre humano y considerado un paria por los suyos, hasta que crece y debe hacer frente a los problemas que han aparecido en su mundo. Entonces, este hombre mitad humano y mitad atlante, emprenderá el viaje de su vida, en el que tendrá que descubrir quién es realmente y si es digno de ser un rey. Acompañado de Mera (Amber Heard), hará frente a este y otros retos, mientras le planta cara a Black Manta (Yahya Abdul-Mateen II) y a su propio hermanastro Orm (Patrick Wilson). ¿Será capaz de dirigir a su pueblo y convertirse en un héroe para el mundo?', 142, 160000000, 1152030000, '2018-12-07', 'US', '', 300.675, 6.9, 13661, 'https://image.tmdb.org/t/p/original/9QusGjxcYvfPD1THg6oW3RLeNn7.jpg', 'https://image.tmdb.org/t/p/original/hY2TaCAp5LDMB8l4757N7PjnedI.jpg', ''),
(298618, 'Flash', 'Cuando su intento de salvar a su familia altera sin darse cuenta el futuro, Barry Allen queda atrapado en una realidad en la que el General Zod ha regresado y no hay superhéroes a quienes recurrir. Para salvar el mundo en el que se encuentra y regresar al futuro que conoce, la única esperanza de Barry es correr por su vida. Pero, ¿será suficiente hacer el sacrificio máximo para restablecer el universo?', 144, 220000000, 271333000, '2023-06-13', 'US', '', 422.42, 6.743, 3871, 'https://image.tmdb.org/t/p/original/yF1eOkaYvwiORauRCPWznV9xVvi.jpg', 'https://image.tmdb.org/t/p/original/x9Qc86JEyYkAKsdzjDpS5kbaAB7.jpg', ''),
(299534, 'Vengadores: Endgame', 'Después de los eventos devastadores de \'Vengadores: Infinity War\', el universo está en ruinas debido a las acciones de Thanos. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles sean las consecuencias... Cuarta y última entrega de la saga \"Vengadores\".', 181, 356000000, 2800000000, '2019-04-24', 'US', 'https://www.marvel.com/movies/avengers-endgame', 251.715, 8.254, 24845, 'https://image.tmdb.org/t/p/original/7RyHsO4yDXtBv1zUU3mTpHeQ0d5.jpg', 'https://image.tmdb.org/t/p/original/br6krBFpaYmCSglLBWRuhui7tPc.jpg', ''),
(299536, 'Vengadores: Infinity War', 'El todopoderoso Thanos ha despertado con la promesa de arrasar con todo a su paso, portando el Guantelete del Infinito, que le confiere un poder incalculable. Los únicos capaces de pararle los pies son los Vengadores y el resto de superhéroes de la galaxia, que deberán estar dispuestos a sacrificarlo todo por un bien mayor. Capitán América e Ironman deberán limar sus diferencias, Black Panther apoyará con sus tropas desde Wakanda, Thor y los Guardianes de la Galaxia e incluso Spider-Man se unirán antes de que los planes de devastación y ruina pongan fin al universo. ¿Serán capaces de frenar el avance del titán del caos?', 156, 300000000, 2052410000, '2018-04-25', 'US', '', 304.776, 8.246, 28851, 'https://image.tmdb.org/t/p/original/mDfJG3LC3Dqb67AZ52x3Z0jU0uB.jpg', 'https://image.tmdb.org/t/p/original/ksBQ4oHQDdJwND8H90ay8CbMihU.jpg', ''),
(299537, 'Capitana Marvel', 'La historia sigue a Carol Danvers mientras se convierte en uno de los héroes más poderosos del universo, cuando la Tierra se encuentra atrapada en medio de una guerra galáctica entre dos razas alienígenas. Situada en los años 90, \'Capitana Marvel\' es una historia nueva de un período de tiempo nunca antes visto en la historia del Universo Cinematográfico de Marvel.', 125, 152000000, 1131420000, '2019-03-06', 'US', '', 409.507, 6.8, 15249, 'https://image.tmdb.org/t/p/original/qAzYK4YPSWDc7aa4R43LcwRIAyb.jpg', 'https://image.tmdb.org/t/p/original/5SPa7dZ85p54xa7E9tHRmfKq5ce.jpg', ''),
(301337, 'Una vida a lo grande', 'Paul es un hombre que se da cuenta de que tendría una vida mucho mejor si encogiese, pues todo lo que necesita en la vida lo tendría igualmente pero en abundancia. Así que decide reducir enormemente su tamaño, ahora que la tecnología lo permite.', 135, 68000000, 55003900, '2017-12-22', 'US', '', 279.113, 5.348, 3665, 'https://image.tmdb.org/t/p/original/rtr0l61RxLPkmZHbZj0WFlGx5G5.jpg', 'https://image.tmdb.org/t/p/original/hpOWb2nUHno4FBzpl6UWo0M1tFK.jpg', ''),
(310307, 'El fundador', 'Biopic del creador de McDonald\'s. En los años 50, un vendedor de Illinois llamado Ray Kroc conoció a los hermanos Richard y Maurice McDonald que llevaban una hamburguesería al sur de California. Impresionado por la velocidad del sistema de cocina de su hamburguesería de San Bernardino, Kroc visualizó el potencial de la franquicia y hábilmente se fue posicionando para arrebatárselo a los hermanos y crear el hoy imperio de un billón de dólares. Así nació McDonald’s.', 115, 15000000, 24121200, '2016-09-13', 'US', '', 142.718, 7.12, 4718, 'https://image.tmdb.org/t/p/original/5WparwIlAtSZW0tcWbK2NHEZJC6.jpg', 'https://image.tmdb.org/t/p/original/ca9V6iA0sk6Zc9aTvcgFidyVwDG.jpg', ''),
(315162, 'El Gato con Botas: El último deseo', 'El Gato con Botas se embarca en un viaje épico para encontrar al mítico Último Deseo y recuperar sus nueve vidas.', 103, 90000000, 484700000, '2022-12-07', 'US', 'https://www.universalpictures.es/micro/el-gato-con-botas-el-ultimo-deseo', 186.982, 8.238, 7248, 'https://image.tmdb.org/t/p/original/jr8tSoJGj33XLgFBy6lmZhpGQNu.jpg', 'https://image.tmdb.org/t/p/original/b5Jb7GoQaqIXy4VEdnQa0UrQZI.jpg', ''),
(315635, 'Spider-Man. Homecoming', 'Peter Parker comienza a experimentar su recién descubierta identidad como el superhéroe Spider-Man. Después de la experiencia vivida con los Vengadores, Peter regresa a casa, donde vive con su tía. Bajo la atenta mirada de su mentor Tony Stark, Peter intenta mantener una vida normal como cualquier joven de su edad, pero interrumpe en su rutina diaria el nuevo villano Vulture y, con él, lo más importante de la vida de Peter comenzará a verse amenazado.', 129, 175000000, 880167000, '2017-07-05', 'US', '', 292.595, 7.336, 21199, 'https://image.tmdb.org/t/p/original/fn4n6uOYcB6Uh89nbNPoU2w80RV.jpg', 'https://image.tmdb.org/t/p/original/yJfPC6pjSJ5VOsVyXhx5PXBe0mR.jpg', ''),
(320288, 'X-Men: Fénix oscura', 'Los X-Men se enfrentan a su enemigo más poderoso: uno de sus miembros, Jean Grey. Durante una misión de rescate en el espacio, Jean casi muere al ser alcanzada por una misteriosa fuerza cósmica. Cuando regresa a casa, esa radiación la ha hecho más poderosa, pero mucho más inestable. Mientras lucha con la entidad que habita en su interior, Jean desata sus poderes de formas que no puede controlar ni comprender. Jean cae en una espiral fuera de control haciendo daño a aquellos que más ama y empieza a destruir los lazos que mantienen unidos a los X-Men.', 116, 200000000, 252443000, '2019-06-05', 'US', '', 395.461, 5.978, 6243, 'https://image.tmdb.org/t/p/original/cjRUhKyt2Jo3V1KNzc5tpPNfccG.jpg', 'https://image.tmdb.org/t/p/original/rdByKDkfyVuVSrkllzxKYXiZmTd.jpg', ''),
(327331, 'The Dirt', 'En esta cruda biografía basada en el libro superventas de Mötley Crüe, cuatro inadaptados de Los Ángeles disfrutan de grandes éxitos y sufren las desgracias más atroces.', 108, 0, 0, '2019-03-22', 'US', '', 158.63, 7.462, 1187, 'https://image.tmdb.org/t/p/original/lFLwxSd9JReOBBxoUwQFBANcyIl.jpg', 'https://image.tmdb.org/t/p/original/xGY5rr8441ib0lT9mtHZn7e8Aay.jpg', ''),
(329865, 'La llegada', 'Unas misteriosas naves espaciales aterrizan por todo el mundo. Un equipo, liderado por la lingüista Louise Banks, intenta descifrar el motivo de su visita. A medida que la humanidad se tambalea al borde de la guerra, Louise y su equipo luchan contra el tiempo, llegando a poner en peligro su vida y, muy posiblemente, la del resto de la humanidad.', 116, 47000000, 203388000, '2016-11-10', 'US', '', 361.504, 7.602, 17240, 'https://image.tmdb.org/t/p/original/iTyh3hqTUjiRqQo8Uz1w1KtQti9.jpg', 'https://image.tmdb.org/t/p/original/tbVITeytclB4JKx2LxxasrCCmZx.jpg', ''),
(335983, 'Venom', 'Eddie Brock es un consolidado periodista y astuto reportero que está investigando una empresa llamada Fundación Vida. Esta fundación, dirigida por el eminente científico Carlton Drake, está ejecutando secretamente experimentos ilegales en seres humanos y realizando pruebas que involucran formas de vida extraterrestres y amorfas conocidas como simbiontes. Durante una visita furtiva a la central, el periodista quedará infectado por un simbionte. Comenzará entonces a experimentar cambios en su cuerpo que no entiende, y escuchará una voz interior, la del simbionte Venom, que le dirá lo que tiene que hacer. Cuando Brock adquiera los poderes del simbionte que le usa como huésped, Venom tomará posesión de su cuerpo, convirtiéndole en un despiadado y peligroso súpervillano.', 112, 116000000, 856085000, '2018-09-28', 'US', '', 314.32, 6.828, 15304, 'https://image.tmdb.org/t/p/original/VuukZLgaCrho2Ar8Scl9HtV3yD.jpg', 'https://image.tmdb.org/t/p/original/jMBTJQiHAyGlZR05J2sq5coA6ew.jpg', ''),
(338766, 'Comanchería', 'Un padre divorciado y su hermano, un ex presidiario recién salido de la cárcel, se dirigen al Oeste de Texas con el objetivo realizar una serie de robos en una serie de sucursales bancarias, con el fin de poder conseguir el dinero suficiente como para poder salvar la granja familiar.', 102, 12000000, 37600000, '2016-08-11', 'US', '', 113.418, 7.299, 4298, 'https://image.tmdb.org/t/p/original/GZx3RAiTJAhXOdhLLyCAbqRl11.jpg', 'https://image.tmdb.org/t/p/original/rGihwoxhAjPrnrjpTPowuIOU3jy.jpg', ''),
(338947, 'Hellraiser', 'Una joven que lucha contra la adicción se apodera de una antigua caja de rompecabezas, sin saber que su propósito es convocar a los Cenobitas, un grupo de sádicos seres sobrenaturales de otra dimensión.', 121, 14000000, 0, '2022-09-28', 'US', '', 161.19, 6.204, 736, 'https://image.tmdb.org/t/p/original/3r3tZgKTw1554hcFoUfydLHE38w.jpg', 'https://image.tmdb.org/t/p/original/gEFoo66nTFdF8YB79CQurtUyJfj.jpg', ''),
(339403, 'Baby Driver', 'Baby, un joven y talentoso conductor especializado en fugas, depende del ritmo de su banda sonora personal para ser el mejor en lo suyo. Cuando conoce a la chica de sus sueños, Baby ve una oportunidad de abandonar su vida criminal y realizar una huida limpia. Pero después de haber sido forzado a trabajar para un jefe del crimen, deberá dar la cara cuando un malogrado golpe amenaza su vida, su amor y su libertad.', 115, 34000000, 226945000, '2017-06-28', 'GB', '', 302.92, 7.45, 15184, 'https://image.tmdb.org/t/p/original/goCvLSUFz0p7k8R10Hv4CVh3EQv.jpg', 'https://image.tmdb.org/t/p/original/o2YToge3eBhxC89m87zkWKVEx2O.jpg', ''),
(339846, 'Baywatch: Los vigilantes de la playa', 'Mitch Buchannon, un estricto y esforzado socorrista de la antigua escuela, deberá trabajar codo con codo con el rebelde Matt Brody, un joven ex nadador olímpico caído en desgracia al que le gusta saltarse las normas. A pesar de tener personalidades opuestas, los dos socorristas deberán unir fuerzas y formar equipo. Juntos descubrirán una trama criminal, en torno a drogas y asesinos, que amenaza el futuro de la Bahía. Su objetivo será proteger la playa de su destrucción a manos de un magnate del petróleo.', 116, 69000000, 177900000, '2017-05-25', 'US', '', 346.313, 6.091, 7798, 'https://image.tmdb.org/t/p/original/t6TL7V9IsT4Ktx6YO8b1UYj3agd.jpg', 'https://image.tmdb.org/t/p/original/aPifsnK3ui76Cq7xMDe1AVlrA0k.jpg', ''),
(339988, 'El círculo', 'El día que Mae Holland es contratada para trabajar en el Círculo, la empresa de internet más influyente del mundo, sabe que se le ha concedido la oportunidad de su vida. A través de un innovador sistema operativo, el Círculo unifica direcciones de email, perfiles de redes sociales, operaciones bancarias y contraseñas de usuarios dando lugar a una única identidad virtual y veraz, en pos de una nueva era marcada por la transparencia.', 110, 18000000, 40651900, '2017-04-27', 'US', '', 142.859, 5.52, 4307, 'https://image.tmdb.org/t/p/original/hENBbG0J4zf4fFB3OVAC50poojR.jpg', 'https://image.tmdb.org/t/p/original/g44zcemcLlBEiCwiJ8C3zDbldqW.jpg', ''),
(341006, 'El experimento Belko', 'Un grupo de 83 americanos expatriados que trabajan en un edificio de Sao Paulo, Brasil, se ven atrapados en su lugar de trabajo mientras una voz les hace plantearse dudas morales sobre qué hacer en situaciones límites.', 95, 5000000, 10166800, '2016-03-17', 'US', '', 139.075, 6.17, 1379, 'https://image.tmdb.org/t/p/original/10OzC1HoKp2AwkaPktH3HsQM2u5.jpg', 'https://image.tmdb.org/t/p/original/a8InXd9y8Ld0cANq1QS7S3Eg9Wu.jpg', ''),
(343674, 'El juego de Gerald', 'Jessie (Carla Gugino) y Gerald (Bruce Greenwood) son un matrimonio maduro que viaja a una remota cabaña con la esperanza de revitalizar su deteriorada relación en un sitio apartado y tranquilo. Allí Gerald propone a su mujer un juego sexual: esposarla a la cama para incrementar las sensaciones. Pero cuando éste muere de un infarto, Jessie tendrá que luchar por su supervivencia.', 103, 0, 0, '2017-09-29', 'US', '', 169.86, 6.398, 3516, 'https://image.tmdb.org/t/p/original/t9HChjSJi8B1PXSVh5Ec3pcDsAM.jpg', 'https://image.tmdb.org/t/p/original/cvRahNCZKhGI0ip7gkQ3rSWUF3o.jpg', ''),
(345887, 'The Equalizer 2', 'Robert McCall imparte una justicia inquebrantable a los explotados y oprimidos, pero eso podría cambiar cuando se trata de un ser querido.', 120, 62000000, 190400000, '2018-07-19', 'US', '', 152.944, 6.7, 5096, 'https://image.tmdb.org/t/p/original/z7noaCJ4KtmhwHw7QcNtnMMo4Qy.jpg', 'https://image.tmdb.org/t/p/original/vK3jlzFcVDpKcesPEoZgHTPYCZn.jpg', ''),
(346698, 'Barbie', 'Barbie vive en Barbieland donde todo es ideal y lleno de música y color. Un buen día decide conocer el mundo real. Cuando el CEO de Mattel se entere, tratará de evitarlo a toda costa y devolver a Barbie a una caja.', 114, 145000000, 1445640000, '2023-07-19', 'US', 'https://www.warnerbros.es/peliculas/barbie', 448.654, 7.066, 8205, 'https://image.tmdb.org/t/p/original/ctMserH8g2SeOAnCw5gFjdQF8mo.jpg', 'https://image.tmdb.org/t/p/original/fNtqD4BTFj0Bgo9lyoAtmNFzxHN.jpg', ''),
(346910, 'Predator', 'Cuando el pequeño Rory (Jacob Tremblay) activa accidentalmente el regreso a la Tierra de los yautjas, desencadenará la vuelta de los cazadores más letales del universo, una especie extraterrestre caracterizada por convertir en su trofeo al resto de criaturas y por obtener su poder a través de la hibridación. Ahora, estos alienígenas han mejorado su ADN y ahora son aún más peligrosos, fuertes, inteligentes y mortales. Por eso, solo un grupo de exsoldados y una profesora de ciencias podrán evitar el fin de la humanidad.', 101, 88000000, 160542000, '2018-09-05', 'CA', '', 147.412, 5.631, 4455, 'https://image.tmdb.org/t/p/original/zGHdS1eLaU5wdYCJ6vY9QfQGCTo.jpg', 'https://image.tmdb.org/t/p/original/dyAGJ75aJXwDVDZqBWLWNxb82AA.jpg', ''),
(353081, 'Misión imposible: Fallout', 'En ocasiones, hasta las mejores intenciones pueden volverse en contra. Después de una misión fallida, Ethan Hunt y su equipo IMF, junto con algunos aliados conocidos, se enfrentarán a una nueva carrera contrarreloj.', 147, 178000000, 791700000, '2018-07-13', 'US', '', 155.998, 7.4, 7904, 'https://image.tmdb.org/t/p/original/3IzR3VhZAyhxVnuRRUHFLkfK4hT.jpg', 'https://image.tmdb.org/t/p/original/wokMJ7WJCJw32cMAzjSCMqvqj0e.jpg', ''),
(353491, 'La Torre Oscura', 'En un mundo extrañamente parecido al nuestro un cowboy de nombre Roland Deschain de Gilead persigue a su eterno enemigo, \"el hombre de negro\". Roland, solitario, quizá maldito, anda sin descanso a través de un paisaje triste y abandonado. Conoce a Jake, un chico de Nueva York pero venido de otro tiempo, y ambos unen sus destinos. Ante ellos están las montañas. Y mucho más allá, la Torre Oscura... Adaptación de la saga literaria de Stephen King.', 95, 60000000, 113231000, '2017-08-03', 'US', '', 136.907, 5.7, 4899, 'https://image.tmdb.org/t/p/original/pVVobDO8cezhVPvwD6EBUN0g3mt.jpg', 'https://image.tmdb.org/t/p/original/u2Mw9iR1sWEq3x2HPT40G4MHDRQ.jpg', ''),
(354912, 'Coco', 'Un joven aspirante a músico llamado Miguel se embarca en un viaje extraordinario a la mágica tierra de sus ancestros. Allí, el encantador embaucador Héctor se convierte en su inesperado amigo y le ayuda a descubrir los misterios detrás de las historias y tradiciones de su familia.', 109, 175000000, 800500000, '2017-10-27', 'US', '', 136.034, 8.212, 18765, 'https://image.tmdb.org/t/p/original/askg3SMvhqEl4OL52YuvdtY40Yb.jpg', 'https://image.tmdb.org/t/p/original/lUZZhYLLDU4g4XGQ5tvjYNVytxc.jpg', ''),
(359410, 'Road House (De profesión: duro)', 'Dalton es un exluchador de la UFC en horas bajas que acepta un trabajo como portero en un conflictivo bar de carretera de los Cayos de Florida, sólo para descubrir que este paraíso no es todo lo que parece... Remake de la película de 1989 con Patrick Swayze.', 114, 85000000, 0, '2024-03-08', 'US', 'https://www.primevideo.com/detail/0O70LSZ5KT12QBNQRUQGGRIWDP/ref=atv_nb_lcl_es_ES?ie=UTF8&language=es_ES', 573.288, 7, 1712, 'https://image.tmdb.org/t/p/original/whSveDUsHW8xz2jXN786GnWCPo.jpg', 'https://image.tmdb.org/t/p/original/wmnVOIaTsGcRpZ9rLv2msbtqi3C.jpg', ''),
(361743, 'Top Gun: Maverick', 'Después de más de 30 años de servicio como uno de los mejores aviadores de la Armada, Pete \"Maverick\" Mitchell se encuentra dónde siempre quiso estar, empujando los límites como un valiente piloto de prueba y esquivando el alcance en su rango, que no le dejaría volar emplazándolo en tierra. Cuando se encuentra entrenando a un destacamento de graduados de Top Gun para una misión especializada, Maverick se encuentra allí con el teniente Bradley Bradshaw, el hijo de su difunto amigo \"Goose\".', 131, 170000000, 1488730000, '2022-05-21', 'US', '', 140.686, 8.221, 8575, 'https://image.tmdb.org/t/p/original/AaV1YIdWKnjAIAOe8UUKBFm327v.jpg', 'https://image.tmdb.org/t/p/original/AlWpEpQq0RgZIXVHAHZtFhEvRgd.jpg', ''),
(369885, 'Aliados', 'Año 1942 durante la Segunda Guerra Mundial. Max es un espía del bando aliado que se enamora de Marianne, una compañera francesa, tras una peligrosa misión en el norte de África. La pareja comienza una relación amorosa hasta que a él le notifican que Marianne puede que sea una agente doble que trabaja para los nazis.', 124, 85000000, 119520000, '2016-11-17', 'GB', '', 280.085, 6.79, 4403, 'https://image.tmdb.org/t/p/original/gMssbddpo4thHGHMpQEZC00Sq9.jpg', 'https://image.tmdb.org/t/p/original/iMzra3eSIoSzVAzCY1jOUEAIgZ1.jpg', ''),
(370464, 'El Ángel Enmascarado', 'Un luchador profesional se convierte en pastor de una pequeña ciudad y en  vigilante enmascarado, luchando contra la injusticia. Mientras enfrenta su crisis en el hogar y en la iglesia, el pastor debe evadir a la policía y de alguna manera reconciliar su identidad secreta violenta con su yo como pastor.', 113, 0, 0, '2016-01-08', 'US', '', 142.084, 4.897, 39, 'https://image.tmdb.org/t/p/original/y9Dr6yCVYRmjKuDjOjNyWxVuGjp.jpg', 'https://image.tmdb.org/t/p/original/q4GxVv5vNt4M0RA2CUu8MAfXLH8.jpg', ''),
(373571, 'Godzilla: Rey de los Monstruos', 'Los criptozoólogos de la agencia Monarch se enfrentan a un grupo de enormes monstruos: Godzilla, Mothra, Rodan y el enemigo de la humanidad, King Ghidorah. Estas ancianas criaturas harán todo lo posible por sobrevivir, poniendo en riesgo la existencia del ser humano en el planeta.', 132, 170000000, 386600000, '2019-05-29', 'US', 'https://www.warnerbros.es/godzilla-rey-de-los-monstruos', 172.992, 6.692, 5899, 'https://image.tmdb.org/t/p/original/uovH5k4BAEPqXqxgwVrTtqH169g.jpg', 'https://image.tmdb.org/t/p/original/yQ59NPwzHE2XlYwU2VwHF9Wb0IJ.jpg', ''),
(378018, 'El vacío', 'Un policía traslada a un hombre herido a un pequeño hospital, y la violencia no tarda en desatarse. Los pocos médicos y pacientes que hay se ven rodeados por unos encapuchados y amenazados por una extraña criatura que crece dentro del hospital.', 85, 0, 151042, '2016-09-22', 'CA', '', 323.878, 5.9, 1163, 'https://image.tmdb.org/t/p/original/oZwwwezJFlHmQGBRJDLmENXwOIt.jpg', 'https://image.tmdb.org/t/p/original/h3lw4MBYQajGaMPu5jokE4QNASn.jpg', ''),
(381284, 'Figuras ocultas', 'Narra la historia nunca contada de tres brillantes mujeres científicas afroamericanas que trabajaron en la NASA a comienzos de los años sesenta (en plena carrera espacial, y asimismo en mitad de la lucha por los derechos civiles de los negros estadounidenses) en el ambicioso proyecto de poner en órbita al astronauta John Glenn.', 127, 25000000, 236000000, '2016-12-10', 'US', '', 133.172, 8.057, 9341, 'https://image.tmdb.org/t/p/original/rfkIeCaIHhN3K5wjJJqKmfUjYp8.jpg', 'https://image.tmdb.org/t/p/original/yiufjE3kfM9e0qIlEdGEmkUcXky.jpg', ''),
(381288, 'Múltiple', 'A pesar de que Kevin le ha demostrado a su psiquiatra de confianza, la Dra. Fletcher, que posee 23 personalidades diferentes, aún queda una por emerger, decidida a dominar a todas las demás. Obligado a raptar a tres chicas adolescentes encabezadas por la decidida y observadora Casey, Kevin lucha por sobrevivir contra todas sus personalidades y la gente que le rodea, a medida que las paredes de sus compartimentos mentales se derrumban.', 117, 9000000, 278454000, '2017-01-19', 'US', '', 352.241, 7.343, 16876, 'https://image.tmdb.org/t/p/original/9pkZesKMnblFfKxEhQx45YQ2kIe.jpg', 'https://image.tmdb.org/t/p/original/Ag51YF1ZTNTefjhVMVGBCFv8h5s.jpg', ''),
(383498, 'Deadpool 2', 'Wade Wilson (Ryan Reynolds), mejor conocido como Deadpool, su nombre de batalla e identidad antiheroica, está de regreso con Deadpool 2 y en esta ocasión su misión será salvar a un chico llamado Russell (Julian Dennison) de las manos de un poderoso rival llamado Cable (Josh Brolin). En aras de dar cumplimiento a su tarea el antihéroe formará un grupo al cual pondrá el nombre de X-Force. Secuela de la exitosa película (recaudó más de 780 millones de dólares en todo el mundo) parodia de los superhéroes mutantes del 2016, también protagonizada por Reynolds.', 123, 110000000, 785897000, '2018-05-10', 'US', '', 314.914, 7.488, 17043, 'https://image.tmdb.org/t/p/original/3P52oz9HPQWxcwHOwxtyrVV1LKi.jpg', 'https://image.tmdb.org/t/p/original/fgPTa4IS07Pygz0Q1WJnRgOP7r7.jpg', '');
INSERT INTO `pelicula` (`id`, `titulo`, `sinopsis`, `duracion`, `presupuesto`, `ganancias`, `fecha_estreno`, `pais_origen`, `web`, `popularidad`, `valoracion`, `total_votos`, `fondo`, `poster`, `adulto`) VALUES
(384521, 'The Cloverfield Paradox', 'Con la Tierra en guerra y en mitad de una crisis energética, un equipo de astronautas se encuentra en el espacio tratando de dar con una solución a los problemas del planeta. Pero durante una maniobra fallida, quedan flotando sin saber muy bien qué o cómo volver a su lugar de origen, y las cosas dentro de la nave ocultan una realidad mucho más terrorífica.', 102, 45000000, 0, '2018-02-04', 'US', 'https://www.netflix.com/title/80134431', 148.559, 5.601, 3125, 'https://image.tmdb.org/t/p/original/120mn0ZPhbDWISY2cmWSYUGWCzi.jpg', 'https://image.tmdb.org/t/p/original/u46Ff8Gg16qhnmrSBLpsdqlmCVO.jpg', ''),
(385687, 'Fast & Furious X', 'Durante numerosas misiones más que imposibles, Dom Toretto y su familia han sido capaces de ser más listos, de tener más valor y de ir más rápido que cualquier enemigo que se cruzara con ellos. Pero ahora tendrán que enfrentarse al oponente más letal que jamás hayan conocido: Un terrible peligro que resurge del pasado, que se mueve por una sangrienta sed de venganza y que está dispuesto a destrozar a la familia y destruir para siempre todo lo que a Dom le importa.', 141, 340000000, 704710000, '2023-05-17', 'US', 'https://www.universalpictures.es/micro/fast-y-furious-x', 546.261, 7.125, 5142, 'https://image.tmdb.org/t/p/original/4XM8DUTQb3lhLemJC51Jx4a2EuA.jpg', 'https://image.tmdb.org/t/p/original/x3zlm6VxPvVrYWE3bHkYUQMR798.jpg', ''),
(391713, 'Lady Bird', 'Una joven estudiante que se hace llamar Lady Bird (Saoirse Ronan) se muda al norte de California para pasar allí su último año de instituto. La joven, con inclinaciones artísticas y que sueña con vivir en la costa Este, tratará de ese modo encontrar su propio camino y definirse fuera de la sombra protectora de su madre (Laurie Metcalf).', 94, 10000000, 79000000, '2017-09-01', 'US', '', 297.464, 7.267, 8176, 'https://image.tmdb.org/t/p/original/pcWxKfFNCznTKYy0E8M9nG1cwL4.jpg', 'https://image.tmdb.org/t/p/original/kfst6DxzGXbdibQPawxQSSuDh09.jpg', ''),
(393519, 'Crudo', 'Justine, una joven de 16 años, vive en una familia donde todos son veterinarios y vegetarianos. Es una estudiante brillante y prometedora, pero al ingresar en la facultad de veterinaria descubre un mundo decadente, despiadado y peligrosamente seductor. Durante la primera semana, obsesionada por encajar con sus compañeros de clase, se aleja de los principios que le han inculcado su familia, y come carne cruda por primera vez. Las consecuencias no tardan en llegar, y la joven empezará a desvelar su verdadera naturaleza.', 99, 3500000, 4100000, '2016-11-11', 'FR', '', 127.736, 7.048, 3075, 'https://image.tmdb.org/t/p/original/qV1pUZAEdfX3sDb8jnkCjRQhXHG.jpg', 'https://image.tmdb.org/t/p/original/lGgrd3flAUimZLYvk5H4soqXbP4.jpg', ''),
(395458, 'Suburbicon', 'Un misterio criminal ambientado en un tranquilo pueblo familiar norteamericano durante los años 50, donde lo mejor y lo peor de la humanidad se ve reflejado en las vidas de la gente corriente. Cuando un allanamiento de morada se vuelve mortal, una familia aparentemente perfecta empezará a hacer uso del chantaje, la venganza y la traición.', 105, 25000000, 12751700, '2017-10-26', 'US', '', 251.872, 5.884, 1638, 'https://image.tmdb.org/t/p/original/dmgFJdivUmV4vGLkbPD49KVjlHx.jpg', 'https://image.tmdb.org/t/p/original/dL1GOIX3gs3GzZLDs4mg3fjjUOV.jpg', ''),
(395990, 'El justiciero', 'Paul Kersey (Bruce Willis) es un famoso cirujano que vive con su familia en Nueva York. Un día, su esposa (Elisabeth Shue) y su hija (Camila Morrone) son brutalmente atacadas en su casa. Paul, que siempre había sido un tipo tranquilo, siente cómo la sed de venganza va apoderándose de él. Con la policía sobrecargada de crímenes, decide tomar la justicia por su mano e ir en busca de los agresores de su familia y de paso enfrentarse a todo tipo de criminales de la Gran Manzana. A medida que las víctimas acaparan la atención de los medios, la ciudad se pregunta si este vengador es un ángel guardián... o un simple justiciero.', 107, 30000000, 34017000, '2018-03-02', 'US', '', 312.328, 6.16, 2469, 'https://image.tmdb.org/t/p/original/uQqQvmptJLPTcWDrZXn22p7j7s3.jpg', 'https://image.tmdb.org/t/p/original/3hkImCSIM8ROpTSA8EF2joYdBNd.jpg', ''),
(399170, 'La suerte de los Logan', 'Jimmy está desempleado, divorciado y no tiene un duro, Clyde perdió un brazo en la guerra de Irak y ahora trabaja de camarero en un antro, y Mellie es una peluquera obsesionada con los coches, los tres son hermanos y están empeñados en burlar una supuesta maldición familiar. Para ello van a robar la cámara acorazada del circuito de carreras Charlotte Motor Speedway, durante la celebración de la carrera Coca-Cola 600 en Carolina del Norte. Para poder llevar a cabo el plan necesitarán a un experto en demoliciones, Joe Bang. El único pequeño inconveniente es que está en la cárcel.', 119, 29000000, 48453600, '2017-08-17', 'US', '', 310.654, 6.73, 3363, 'https://image.tmdb.org/t/p/original/d3Y9L11tgnYIKhAaRWfbaKGCjcM.jpg', 'https://image.tmdb.org/t/p/original/6oRcVB1iFwfFkbL6qSgZYTxxpI7.jpg', ''),
(399579, 'Alita: Ángel de combate', 'Ido, un compasivo médico de cíborgs, encuentra a Alita abandonada en el desguace de Iron City. Cuando Alita despierta, no sabe quién es, ni reconoce el mundo en el que se encuentra, todo es nuevo para ella. Ido intentará proteger a Alita de su misterioso pasado, mientras que su nuevo amigo Hugo le ayudará a despertar sus recuerdos. En ese momento, Alita descubre que posee habilidades de combate extraordinarias, que podría usar para salvar a su nueva familia y amigos. Decidida a encontrar la verdad tras sus orígenes, Alita comienza un viaje que le enfrentará a las injusticias de un mundo oscuro y corrupto, descubriendo que sólo ella puede cambiarlo.', 122, 170000000, 405000000, '2019-01-31', 'US', '', 132.392, 7.231, 8824, 'https://image.tmdb.org/t/p/original/8RKBHHRqOMOLh5qW3sS6TSFTd8h.jpg', 'https://image.tmdb.org/t/p/original/quWP5VIzTUf0Hr8AJZLloM6js8I.jpg', ''),
(400106, 'Bright', 'Ambientada en un mundo en el que las criaturas fantásticas conviven con los humanos, y en el que la policía tiene un departamento especial dedicado a crímenes que involucran magia. Un policía humano (Will Smith) se ve obligado a trabajar con un orco (Joel Edgerton), el primero en entrar en el cuerpo de policía. En una de sus investigaciones, esta peculiar pareja de policías descubrirá un peligroso objeto por el que muchos matarían: una varita mágica que es capaz de conceder deseos, pero también es considerada un arma asesina. Los dos protagonistas se verán entonces envueltos en una guerra territorial.', 120, 90000000, 0, '2017-12-22', 'US', '', 253.628, 6.151, 5473, 'https://image.tmdb.org/t/p/original/hu4psJoKxDYezvvS4GlLF531fom.jpg', 'https://image.tmdb.org/t/p/original/4xWEhLPlP9yg3DJbkKaBayBN98V.jpg', ''),
(400928, 'Un don excepcional', 'Ambientada en un pueblo costero de Florida, Gifted cuenta la historia de Frank Adler, un hombre soltero que cría a su sobrina Mary tras el fallecimiento de su madre. La niña tiene una gran habilidad para las matemáticas y su abuela Evelyn lo sabe bien. Mientras que su tío intenta que la vida de la pequeña sea lo más normal posible y que disfrute de su infancia, Evelyn tiene otros planes para ella. Como consecuencia, Frank se verá obligado a luchar desesperadamente por su custodia.', 101, 7000000, 40300000, '2017-04-07', 'US', '', 359.028, 8.036, 5212, 'https://image.tmdb.org/t/p/original/6MmYsaK6poR8f4R8jsBnJBU5tfd.jpg', 'https://image.tmdb.org/t/p/original/vZFY7pMPpTrxucN2y0OaWedCHWx.jpg', ''),
(405774, 'A ciegas', 'Thriller posapocalíptico en el que una mujer y sus dos hijos, estos con los ojos vendados, navegan río abajo tras una sangrienta invasión alienígena de la Tierra intentando evitar a las criaturas extraterrestres. Cuando algo misterioso diezma la población mundial, solo se sabe una cosa: si lo ves, te suicidas. Malorie deberá huir junto a sus dos hijos por un caudaloso y traicionero río, rumbo al único sitio que parece ofrecer refugio. Pero para sobrevivir, deberán completar el peligroso viaje de dos días con los ojos vendados.', 124, 19800000, 0, '2018-12-13', 'US', '', 392.732, 6.844, 9582, 'https://image.tmdb.org/t/p/original/pDKFL1zcHzEpmz4MJA5JJnRbJeD.jpg', 'https://image.tmdb.org/t/p/original/mJXlEnJwIz3vOq51G3SrJlcr1yr.jpg', ''),
(407448, 'Detroit', 'En julio de 1967, graves disturbios raciales sacudieron la ciudad de Detroit, en el estado de Michigan. Todo comenzó con una redada de la policía en un bar nocturno sin licencia, que acabó convirtiéndose en una de las revueltas civiles más violentas de los Estados Unidos. Los incidentes más graves ocurrieron en el motel Algiers, cuando miembros de la policía y la Guardia Nacional acudieron ante unos disparos de un arma de fogueo.', 143, 34000000, 23400000, '2017-07-28', 'US', '', 245.258, 7.304, 1585, 'https://image.tmdb.org/t/p/original/zpkWkIXEwSErbIgOlh1NkwQ6Pyj.jpg', 'https://image.tmdb.org/t/p/original/6ue8SL4u2S7TFFNrWNq8FYk20Z9.jpg', ''),
(412656, 'Chaos Walking', 'Todd Hewitt es el último chico de Prentisstown, una pequeña comunidad cuya peculiaridad (aparte del hecho de que no hay mujeres) es que todos escuchan los pensamientos ajenos, lo que es definido como Ruido, un ruido que nunca cesa. Todd está contento porque sólo falta un mes para que sea su decimotercer cumpleaños y por fin, se convierta en hombre. Pero entonces, en uno de sus paseos por el bosque con su fiel perro, encuentra algo inesperado que cambiará su mundo para siempre: el silencio. O como lo define Todd: un agujero en el ruido.', 109, 125000000, 26508100, '2021-02-24', 'CA', '', 150.751, 6.602, 2180, 'https://image.tmdb.org/t/p/original/ovggmAOu1IbPGTQE8lg4lBasNC7.jpg', 'https://image.tmdb.org/t/p/original/k3zMduK3u1ckKt1HHcvPDbdhOap.jpg', ''),
(414906, 'Batman', 'Cuando un asesino se dirige a la élite de Gotham con una serie de maquinaciones sádicas, un rastro de pistas crípticas envía Batman a una investigación en los bajos fondos. A medida que las pruebas comienzan a acercarse a su casa y se hace evidente la magnitud de los planes del autor, Batman debe forjar nuevas relaciones, desenmascarar al culpable y hacer justicia al abuso de poder y la corrupción que durante mucho tiempo han asolado Gotham City.', 176, 185000000, 771000000, '2022-03-01', 'US', 'https://www.warnerbros.es/peliculas/batman', 464.959, 7.679, 9546, 'https://image.tmdb.org/t/p/original/tRS6jvPM9qPrrnx2KRp3ew96Yot.jpg', 'https://image.tmdb.org/t/p/original/mo7teil1qH0SxgLijnqeYP1Eb4w.jpg', ''),
(419430, 'Déjame salir', 'Un joven afroamericano visita a la familia de su novia blanca, un matrimonio adinerado. Para Chris y su novia Rose ha llegado el momento de conocer a los futuros suegros, por lo que ella le invita a pasar un fin de semana en el campo con sus padres, Missy y Dean. Al principio, Chris piensa que el comportamiento \"demasiado\" complaciente de los padres se debe a su nerviosismo por la relación interracial de su hija, pero a medida que pasan las horas, una serie de descubrimientos cada vez más inquietantes le llevan a descubrir una verdad inimaginable.', 103, 4500000, 255408000, '2017-02-24', 'US', 'http://www.dejamesalir.com', 245.775, 7.622, 16773, 'https://image.tmdb.org/t/p/original/o8dPH0ZSIyyViP6rjRX1djwCUwI.jpg', 'https://image.tmdb.org/t/p/original/xiMoqa0bmjuyuXYqKGwrTSJL8nI.jpg', ''),
(420817, 'Aladdín', 'Aladdin es un adorable pero desafortunado ladronzuelo enamorado de la hija del Sultán, la princesa Jasmine. Para intentar conquistarla, acepta el desafío de Jafar, que consiste en entrar a una cueva en mitad del desierto para dar con una lámpara mágica que le concederá todos sus deseos. Allí es donde Aladdín conocerá al Genio, dando inicio a una aventura como nunca antes había imaginado.', 128, 183000000, 1054300000, '2019-05-22', 'US', 'https://disney.es/peliculas/aladdin-2019', 164.504, 7.108, 9745, 'https://image.tmdb.org/t/p/original/rVqY0Bo4Npf6EIONUROxjYAJfmD.jpg', 'https://image.tmdb.org/t/p/original/trnyoKkkvvjZvRvCMrNDtSf25nH.jpg', ''),
(420818, 'El rey león', 'Simba es el hijo del rey de los leones, Mufasa, y heredero de todo el reino. Pero cuando su padre es brutalmente asesinado por su tío Scar, decidirá huir, dejando vía libre para que su tío tome el puesto de su padre como líder de la manada. En su camino, Simba se encuentra con el suricato  Timón y el jabalí Pumba, que le enseñarán a vivir la vida sin preocupaciones. Pero el joven león se verá obligado a decidir entre su vida libre de problemas o su destino como rey .', 118, 260000000, 1663000000, '2019-07-12', 'US', '', 262.919, 7.116, 9679, 'https://image.tmdb.org/t/p/original/1TUg5pO1VZ4B0Q1amk3OlXvlpXV.jpg', 'https://image.tmdb.org/t/p/original/eGfq90BF8QGCMpncF2ag0lGTgKk.jpg', ''),
(424121, 'El apóstol', 'Thomas Richardson llega de incógnito a una isla idílica con la intención de salvar a su hermana de la misteriosa secta que la ha secuestrado. Allí, encontrará una sociedad que tiene sus propias reglas y un secreto terrible. Tras revolucionar el cine de acción con The Raid, Gareth Evans traslada su mirada al Reino Unido de principios del siglo XX.', 130, 0, 0, '2018-09-21', 'GB', '', 139.441, 6.104, 1361, 'https://image.tmdb.org/t/p/original/tvGTSdLjKJgFHTcF4x9HSxoTIgW.jpg', 'https://image.tmdb.org/t/p/original/z4nesLMUtlGRKCAf3ItjCASQ66P.jpg', ''),
(424139, 'La noche de Halloween', 'Jamie Lee Curtis regresa a su papel icónico como Laurie Strode, quien llega a su enfrentamiento final con Michael Myers, la figura enmascarada que la ha perseguido desde que escapó por poco de su juerga de asesinatos en la noche de Halloween de hace cuatro décadas.', 109, 10000000, 259900000, '2018-10-18', 'US', '', 329.705, 6.554, 4524, 'https://image.tmdb.org/t/p/original/hO1oTBGNxO5fBKVEuWnSpICJH7c.jpg', 'https://image.tmdb.org/t/p/original/xbniRigN0Ao3KjH8ha7yySK1g2B.jpg', ''),
(426563, 'Holmes & Watson', 'Ha habido un asesinato en el Palacio de Buckingham y, dentro de cuatro días, la Reina Victoria será la próxima víctima si nadie puede evitarlo. Por suerte para ella, Sherlock Holmes (Will Ferrell) y John Watson (John C. Reilly) se pondrán manos a la obra para frenar de una vez a James Moriarty e impedir que lleve a cabo su terrible plan. O al menos lo intentarán, porque esta no es una historia convencional de Sherlock Holmes. Esto es Holmes & Watson.', 95, 42000000, 40500000, '2018-12-25', 'US', '', 253.332, 4.278, 816, 'https://image.tmdb.org/t/p/original/5Zvu4SrY3p9qgnITkCn4jAQwKvB.jpg', 'https://image.tmdb.org/t/p/original/61JOUNb35q6NRYoX4wgnrO3E3EH.jpg', ''),
(429617, 'Spider-Man. Lejos de casa', 'Peter Parker decide irse junto a Michelle Jones, Ned y el resto de sus amigos a pasar unas vacaciones a Europa después de los eventos ocurridos en Vengadores: EndGame. Sin embargo, el plan de Parker por dejar de lado sus superpoderes durante unas semanas se ven truncados cuándo es reclutado por Nick Fury para unirse a Mysterio (un humano que proviene de la Tierra 833, una dimensión del multiverso, que tuvo su primera aparición en Doctor Strange) para luchar contra los elementales (cuatro entes inmortales que vienen de la misma dimensión y que dominan los cuatro elementos de la naturaleza, el fuego, el agua, el aire y la tierra) . En ese momento, Parker vuelve a ponerse el traje de Spider-Man para cumplir con  su labor.', 135, 160000000, 1131930000, '2019-06-28', 'US', 'https://www.sonypictures.es/peliculas/spider-man-lejos-de-casa', 118.575, 7.4, 15132, 'https://image.tmdb.org/t/p/original/34jW8LvjRplM8Pv06cBFDpLlenR.jpg', 'https://image.tmdb.org/t/p/original/iKVR1ba3W1wCm9bVCcpnNvxQUWX.jpg', ''),
(436270, 'Black Adam', 'Casi 5000 años después de que los dioses antiguos le concediesen sus poderes y tras ser encarcelado, Black Adam queda liberado de su tumba terrenal y está listo para hacer justicia a su manera en el mundo moderno.', 124, 200000000, 393452000, '2022-10-19', 'US', '', 155.942, 6.9, 5950, 'https://image.tmdb.org/t/p/original/bQXAqRx2Fgc46uCVWgoPz5L5Dtr.jpg', 'https://image.tmdb.org/t/p/original/mPTzXksC8HcAj6EM6WjZFJVJEzF.jpg', ''),
(437557, '#SexPact', 'Tres padres tratan de impedir que sus hijas tengan relaciones sexuales en la noche del baile de graduación.', 102, 21000000, 94017300, '2018-03-14', 'US', '', 168.229, 6.3, 1930, 'https://image.tmdb.org/t/p/original/nfiyVEDIMRXoqoxlPL2DCoIAtnS.jpg', 'https://image.tmdb.org/t/p/original/ncqX1w8zDtn3mIPmdHE0iC4Rzx0.jpg', ''),
(438631, 'Dune', 'En un lejano futuro, la galaxia conocida es gobernada mediante un sistema feudal de casas nobles bajo el mandato del Emperador. Las alianzas y la política giran entorno a un pequeño planeta, Dune,  del que extrae la \"especia melange\", la materia prima que permite los viajes espaciales. La Casa Atreides, bajo el mandato del Duque Leto Atreides recibe el encargo de custodiar el planeta, relevando en la encomienda a sus históricos enemigos, los Harkonnen. Paul Atreides, hijo del duque, se verá atrapado en las intrigas políticas mientras descubre el destino que le deparan los desiertos de Dune.', 155, 165000000, 407574000, '2021-09-15', 'US', 'https://www.warnerbros.es/peliculas/dune', 521.781, 7.778, 11570, 'https://image.tmdb.org/t/p/original/lzWHmYdfeFiMIY4JaMmtR7GEli3.jpg', 'https://image.tmdb.org/t/p/original/hIEKzq0klqtz1H3S7QxzH4mMbvT.jpg', ''),
(438695, '¡Canta! 2', 'Buster Moon y sus amigos deben persuadir a la estrella del rock Clay Calloway para que se una a ellos en el estreno de un nuevo espectáculo.', 110, 85000000, 406000000, '2021-12-01', 'US', '', 152.146, 7.874, 4188, 'https://image.tmdb.org/t/p/original/6mJrgL7Mi13XjJeGYJFlD6UEVQw.jpg', 'https://image.tmdb.org/t/p/original/9iIDsw7RJHYU94z7k4mbYP5IlYT.jpg', ''),
(439079, 'La monja', 'Cuando una joven monja se suicida en una abadía de clausura en Rumanía, un sacerdote experto en posesiones demoniacas y una novicia a punto de tomar sus votos, son enviados por el Vaticano para investigar. Juntos descubren el profano secreto de la orden. Arriesgando no solo sus propias vidas sino su fe y hasta sus almas, se enfrentan a una fuerza maléfica en forma de monja demoníaca, en una abadía que se convierte en un campo de batalla de horror entre los vivos y los condenados....', 96, 22000000, 366083000, '2018-09-05', 'US', '', 270.517, 5.892, 6435, 'https://image.tmdb.org/t/p/original/fgsHxz21B27hOOqQBiw9L6yWcM7.jpg', 'https://image.tmdb.org/t/p/original/q2JFJ8x0IWligHyuLJbBjqNsySf.jpg', ''),
(446354, 'Los archivos del Pentágono', 'En junio de 1971, los principales periódicos de EE.UU., entre los que se encontraban \'The New York Times\' y \'The Washington Post\', tomaron una valiente posición en favor de la libertad de expresión, informando sobre los documentos del Pentágono y el encubrimiento masivo de secretos por parte del gobierno, que había durado cuatro décadas y cuatro presidencias estadounidenses. En ese momento, Katherine Graham, primera mujer editora del Post, y el director Ben Bradlee intentaban relanzar un periódico en decadencia. Juntos decidieron tomar la audaz decisión de apoyar al \'The New York Times\' y luchar contra el intento de la Administración Nixon de restringir la primera enmienda. Historia basada en los documentos del Post que recogían información clasificada sobre la Guerra de Vietnam.', 116, 50000000, 179769000, '2017-12-22', 'US', '', 132.774, 7.002, 4425, 'https://image.tmdb.org/t/p/original/h5jqLrIv1tlszezv2UEWq9KBuoj.jpg', 'https://image.tmdb.org/t/p/original/uhUoPnkR7aAJgkQ1fq1Rm3jaenH.jpg', ''),
(447200, 'El rascacielos', 'Un experto en seguridad tiene que infiltrarse en un rascacielos en llamas, a 225 pisos de altura, donde su familia está atrapada por un grupo de criminales.', 103, 125000000, 292400000, '2018-07-11', 'US', 'https://www.universalpictures.es/micro/el-rascacielos', 305.434, 6.316, 4806, 'https://image.tmdb.org/t/p/original/9bn8ApCTuqTb7rLoxzyGcyzjuFx.jpg', 'https://image.tmdb.org/t/p/original/iZewx4w2Fh8lBuKoOlJqfPC5uWs.jpg', ''),
(447332, 'Un lugar tranquilo', 'Evelyn y Lee Abbott son una pareja con tres hijos que vive en una granja aislada de toda civilización al norte de Nueva York. Esta familia ha sobrevivido durante meses en un mundo invadido y amenazado por mortales criaturas extraterrestres que se guían por el sonido para cazar. En este contexto en el que una palabra puede significar la muerte, la familia Abbott vive silenciosamente, andan descalzos y se comunican por medio del lenguaje de señas.', 96, 17000000, 341000000, '2018-04-03', 'US', '', 291.512, 7.398, 13568, 'https://image.tmdb.org/t/p/original/roYyPiQDQKmIKUEhO912693tSja.jpg', 'https://image.tmdb.org/t/p/original/bBcQiubPGb7LgcRgT2kwC8YOWVo.jpg', ''),
(455207, 'Crazy Rich Asians', 'Rachel Chu es profesora de economía en la Universidad de Nueva York, allí conoce a Nick Young -profesor de historia- y se enamoran. Ambos tienen que viajar a la ciudad natal de Nick, Singapur, para asistir a la boda de su mejor amigo. Es allí cuando Rachel descubre que su novio pertenece a una de las familias más ricas de Asia y que todas las solteras de clase alta están increíblemente celosas de ella. La joven tendrá que enfrentarse a todas ellas y demostrar a la familia de su novio que ella también es digna de estar con él.', 120, 30000000, 238539000, '2018-08-15', 'US', '', 151.451, 7.067, 3510, 'https://image.tmdb.org/t/p/original/bb362waz16FQtnTgEGDtdnFTUGW.jpg', 'https://image.tmdb.org/t/p/original/yufzXCB8h7GWBscRZgZoFM3Qsz2.jpg', ''),
(456740, 'Hellboy', 'La Agencia para la Investigación y Defensa Paranormal (AIDP) encomienda a Hellboy la tarea de derrotar a un espíritu ancestral: Nimue, conocida como \"La Reina de la Sangre\". Nimue fue la amante del mismísimo Merlín durante el reinado del Rey Arturo, de él aprendió los hechizos que la llevaron a ser una de las brujas más poderosas… Pero la locura se apoderó de ella y aprisionó al mago para toda la eternidad. Hace siglos consiguieron acabar con esta villana, enterrándola profundamente, pero ha vuelto de entre los muertos con la intención de destruir a la humanidad con su magia negra.', 125, 50000000, 55065300, '2019-04-10', 'US', '', 145.178, 5.6, 3272, 'https://image.tmdb.org/t/p/original/5BkSkNtfrnTuKOtTaZhl8avn4wU.jpg', 'https://image.tmdb.org/t/p/original/3dLwRfMIKvrufKiJADKbTGdAoqN.jpg', ''),
(464052, 'Wonder Woman 1984', 'En 1984, en plena guerra fría, Diana Prince, conocida como Wonder Woman se enfrenta al empresario Maxwell Lord y a su antigua amiga Barbara Minerva / Cheetah, una villana que posee fuerza y agilidad sobrehumanas.', 151, 200000000, 169601000, '2020-12-16', 'US', 'https://www.warnerbros.es/peliculas/wonder-woman-1984', 232.67, 6.4, 8161, 'https://image.tmdb.org/t/p/original/egg7KFi18TSQc1s24RMmR9i2zO6.jpg', 'https://image.tmdb.org/t/p/original/jIIjsExCEv6lsfQGHTXDPk3Q0M5.jpg', ''),
(466420, 'Los asesinos de la luna', 'Miembros de la tribu Osage de los Estados Unidos, son asesinados bajo misteriosas circunstancias en la década de 1920 provocando una importante investigación por el FBI involucrando a J. Edgar Hoover.', 206, 200000000, 156922000, '2023-10-18', 'US', '', 140.054, 7.492, 2857, 'https://image.tmdb.org/t/p/original/acvE3RWjDLgvbL2RtcyzkrsAyNV.jpg', 'https://image.tmdb.org/t/p/original/aZXHjmhSSGUshLEdgsNCTH9z7Ix.jpg', ''),
(467244, 'La zona de interés', 'El comandante de Auschwitz Rudolf Höss y su esposa Hedwig se esfuerzan en construir una vida de ensueño para su familia en una casa con jardín cerca del campo.', 105, 15000000, 37742600, '2023-12-15', 'US', 'https://elasticafilms.com/catalogofilms/la-zona-de-interes', 151.21, 7.2, 1251, 'https://image.tmdb.org/t/p/original/aPQsU3yLDUOhLJYnSqkhKRkQTAw.jpg', 'https://image.tmdb.org/t/p/original/olfQK9vJ0BIOfBuRTTdcn0RLraG.jpg', ''),
(467407, 'ココロとカラダ', '', 83, 0, 0, '2004-12-11', 'JP', '', 161.003, 7.5, 5, '', 'https://image.tmdb.org/t/p/original/tJSNalCgcqfI8mbI5xFveJGTQDv.jpg', ''),
(474350, 'It: Capítulo 2', 'Han pasado casi 30 años desde que el \"Club de los Perdedores\", formado por Bill, Beverly, Richie, Ben, Eddie, Mike y Stanley, se enfrentaran al macabro y despiadado Pennywise (Bill Skarsgård). En cuanto tuvieron oportunidad, abandonaron el pueblo de Derry, en el estado de Maine, que tantos problemas les había ocasionado. Sin embargo, ahora, siendo adultos, parece que no pueden escapar de su pasado. Todos deberán enfrentarse de nuevo al temible payaso para descubrir si de verdad están preparados para superar sus traumas de la infancia.', 169, 79000000, 473123000, '2019-09-04', 'US', '', 268.982, 6.845, 8399, 'https://image.tmdb.org/t/p/original/8moTOzunF7p40oR5XhlDvJckOSW.jpg', 'https://image.tmdb.org/t/p/original/9oERKIVyTWpHNum3STVsAGD4ojz.jpg', ''),
(475557, 'Joker', 'Arthur Fleck es un hombre ignorado por la sociedad, cuya motivación en la vida es hacer reír. Pero una serie de trágicos acontecimientos le llevarán a ver el mundo de otra forma. Película basada en Joker, el popular personaje de DC Comics y archivillano de Batman, pero que en este film toma un cariz más realista y oscuro.', 122, 55000000, 1078960000, '2019-10-01', 'US', '', 413.973, 8.161, 24544, 'https://image.tmdb.org/t/p/original/n6bUvigpRFqSwmPp1m2YADdbRBc.jpg', 'https://image.tmdb.org/t/p/original/v0eQLbzT6sWelfApuYsEkYpzufl.jpg', ''),
(480530, 'Creed II: La leyenda de Rocky', 'Adonis Creed se debate entre las obligaciones personales y el entrenamiento para su próxima gran pelea, con el desafío de su vida por delante. Enfrentarse a un oponente que tiene vínculos con el pasado de su familia solo intensifica su inminente batalla en el ring. Afortunadamente Rocky Balboa está a su lado a lo largo de todo el camino, y juntos se cuestionarán por lo que vale la pena luchar y descubrirán que nada es más importante que la familia...', 130, 50000000, 214200000, '2018-11-21', 'US', '', 264.359, 7.026, 5234, 'https://image.tmdb.org/t/p/original/9il7qNbeYnPMYlutsVYDsj4hRyb.jpg', 'https://image.tmdb.org/t/p/original/2t53WEu1Ck7qAMS3theMnQK2N2c.jpg', ''),
(484641, 'Anna', 'Bajo la hipnotizante belleza de Anna Poliatova yace un secreto que le permite desatar una imparable agilidad y fuerza y convertirse en una de las asesinas más temidas por los gobiernos del mundo.', 119, 34000000, 31627000, '2019-06-19', 'RU', '', 136.499, 6.712, 2579, 'https://image.tmdb.org/t/p/original/c1YQcpqsljC7lYEmTIeftcl22VS.jpg', 'https://image.tmdb.org/t/p/original/eLBq1ANzAHgVfQSK6urU0HaTGPS.jpg', ''),
(484718, 'El rey de Zamunda', '¡Akeem y Senmi han vuelto! Desde el exuberante reino de Zamunda, el recién coronado rey Akeem (Eddie Murphy) y su leal confidente Semmi (Arsenio Hall) emprenden una nueva y divertidísima aventura que les hará atravesar el mundo, desde su gran país en África hasta el barrio de Queens, en Nueva York, donde todo empezó.', 110, 60000000, 0, '2021-03-04', 'US', '', 173.937, 6.435, 2112, 'https://image.tmdb.org/t/p/original/vKzbIoHhk1z9DWYi8kyFe9Gg0HF.jpg', 'https://image.tmdb.org/t/p/original/jJFvY25lPaKlapYOeIH6N5aKcbh.jpg', ''),
(490132, 'Green Book', 'Años 60. Cuando Tony Lip, un rudo italoamericano del Bronx, es contratado como chófer del virtuoso pianista negro Don Shirley durante una gira de conciertos por el Sur de Estados Unidos, deberá confiar en \"El libro verde\", una guía de los pocos establecimientos seguros para los afroamericanos, para encontrar alojamiento. Son dos personas que tendrán que hacer frente al racismo y los prejuicios, pero a las que la bondad y el sentido del humor unirán, obligándoles a dejar de lado las diferencias para sobrevivir y prosperar en el viaje de su vida.', 130, 23000000, 319700000, '2018-11-16', 'US', '', 358.242, 8.244, 11165, 'https://image.tmdb.org/t/p/original/2Xe9lISpwXKhvKiHttbFfVRERQX.jpg', 'https://image.tmdb.org/t/p/original/od2A7qPtpimcYfqfKXkpHqoKyuS.jpg', ''),
(497698, 'Viuda negra', 'Natasha Romanoff, alias Viuda Negra, se enfrenta a las partes más oscuras de su historia cuando surge una peligrosa conspiración con vínculos con su pasado. Perseguida por una fuerza que no se detendrá ante nada para acabar con ella, Natasha debe enfrentarse a su historia como espía y a las relaciones rotas que dejó a su paso mucho antes de convertirse en una Vengadora.', 134, 200000000, 379751000, '2021-07-07', 'US', 'https://disney.es/peliculas/viuda-negra', 244.781, 7.3, 9787, 'https://image.tmdb.org/t/p/original/keIxh0wPr2Ymj0Btjh4gW7JJ89e.jpg', 'https://image.tmdb.org/t/p/original/oggEsESyLjVGD7jbIdBfa2hFUrx.jpg', ''),
(500475, 'Superfly', 'Remake del film  del 1972 \'Superfly\', en el que un traficante afroamericano se da cuenta de que dejar atrás su vida criminal es más difícil de lo que esperaba. Un traficante de cocaína decide hacer un último trato antes de dejar el negocio.', 120, 16000000, 20545100, '2018-06-13', 'US', '', 175.301, 6.771, 367, 'https://image.tmdb.org/t/p/original/fJKJXKiRSzDihp50c7j39zb3ILi.jpg', 'https://image.tmdb.org/t/p/original/fvzAtcrcp3CzcXPQhK2OZjavRS1.jpg', ''),
(504608, 'Rocketman', '\'Rocketman\' es la historia de Elton John, desde sus años como niño prodigio del piano en la Royal Academy of Music hasta llegar a ser una superestrella de fama mundial gracias a su influyente y duradera asociación con su colaborador y letrista Bernie Taupin.', 121, 40000000, 167300000, '2019-05-17', 'GB', '', 163.633, 7.323, 4476, 'https://image.tmdb.org/t/p/original/oAr5bgf49vxga9etWoQpAeRMvhp.jpg', 'https://image.tmdb.org/t/p/original/nTjYNe0kd18PGjKudRqP8mgVido.jpg', ''),
(505600, 'Súper empollonas', 'Dos excelentes estudiantes y grandes amigas, en la víspera de su graduación de su instituto, de repente se dan cuenta de que podrían haberse esforzado algo menos en clase y haberse divertido más. Así que deciden hacer algo al respecto para compensar tanto estudio y tan poca diversión: recuperar los años perdidos en una noche loca.', 105, 6000000, 24849000, '2019-05-24', 'US', '', 149.752, 7.044, 2514, 'https://image.tmdb.org/t/p/original/cheDSO3mYmsAFQlRM91o7MK6Wcc.jpg', 'https://image.tmdb.org/t/p/original/gOTCGleMERuAUhNAq2MIYybrgnC.jpg', ''),
(505948, 'I Am Mother', 'Una adolescente (Rugaard) es criada es un refugio subterráneo por una madre robot que ha sido diseñada para repoblar la Tierra en caso de que se produjese una catástrofe. El vínculo entre ambas se ve amenazado cuando la joven lleva a su casa a una desconocida ensangrentada (Swank) que pone en tela de juicio todo lo que su madre robótica le ha enseñado sobre el mundo exterior. La adolescente tendrá que averiguar cuál de las dos dice la verdad para poder tomar una decisión con respecto a su futuro.', 115, 0, 643593, '2019-06-07', 'AU', '', 266.598, 6.691, 2449, 'https://image.tmdb.org/t/p/original/8tqVlaXwF2vbMWMDa909IhdrTRc.jpg', 'https://image.tmdb.org/t/p/original/qnYBbh8MQLrvSbgp6uKRqy2HxEQ.jpg', ''),
(507086, 'Jurassic World: Dominion', 'Cuatro años después de la destrucción de Isla Nublar, los dinosaurios conviven – y cazan – con los seres humanos en todo el mundo. Este frágil equilibrio cambiará el futuro y decidirá, de una vez por todas, si los seres humanos seguirán en la cúspide de los depredadores en un planeta que comparten con los animales más temibles de la creación.', 147, 165000000, 1001980000, '2022-06-01', 'US', 'https://www.universalpictures.es/micro/jurassic-world-dominion', 154.206, 6.715, 5747, 'https://image.tmdb.org/t/p/original/698FjyzLdpgXmUSr63LaRwblTmx.jpg', 'https://image.tmdb.org/t/p/original/sXeWfpT1EhG7f4uBouqraOhmouH.jpg', ''),
(507089, 'Five Nights at Freddy\'s', 'Un guardia de seguridad con problemas comienza a trabajar en Freddy Fazbear\'s Pizza. Mientras pasa su primera noche en el trabajo, se da cuenta de que el turno de noche en Freddy\'s no será tan fácil de superar.', 109, 20000000, 294804000, '2023-10-25', 'US', 'https://www.universalpictures.es/micro/five-nights', 143.139, 7.641, 3600, 'https://image.tmdb.org/t/p/original/7NRGAtu8E4343NSKwhkgmVRDINw.jpg', 'https://image.tmdb.org/t/p/original/t6RSJ1z8bDEYpk4fLwxfkXciUak.jpg', ''),
(508947, 'Red', 'Mei Lee, una niña de 13 años un poco rara pero segura de sí misma, se debate entre ser la hija obediente que su madre quiere que sea y el caos propio de la adolescencia. Ming, su protectora y ligeramente exigente madre, no se separa nunca de ella lo que es una situación poco deseable para una adolescente. Y por si los cambios en su vida y en su cuerpo no fueran suficientes, cada vez que se emociona demasiado (lo que le ocurre prácticamente todo el tiempo), se convierte en un panda rojo gigante.', 100, 175000000, 21329000, '2022-03-10', 'US', '', 423.608, 7.391, 4940, 'https://image.tmdb.org/t/p/original/fOy2Jurz9k6RnJnMUMRDAgBwru2.jpg', 'https://image.tmdb.org/t/p/original/tYRd7O5Eht4jypJQrMWnCi26880.jpg', ''),
(513310, 'Muere otra vez', 'Un oficial retirado de las fuerzas especiales se ve obligado a revivir una y otra vez el mismo día.', 94, 45000000, 2000000, '2021-02-19', 'US', '', 153.753, 6.9, 1489, 'https://image.tmdb.org/t/p/original/1Yc5hIRh3skhsEKLbCHE7v1FBOa.jpg', 'https://image.tmdb.org/t/p/original/hlHAeVkX5xdfSw17j9sR2vChULc.jpg', ''),
(520763, 'Un lugar tranquilo 2', 'Tras los fatales acontecimientos sucedidos en la primera parte, la familia Abbot debe enfrentarse a los peligros del mundo exterior mientras luchan en silencio por sobrevivir. Forzados a aventurarse en lo desconocido, pronto se dan cuenta de que las criaturas que cazan orientadas por el sonido no son la única amenaza que acecha más allá del camino de arena. Secuela de la exitosa producción \"Un lugar tranquilo\" (A Quiet Place, 2018).', 97, 61000000, 297400000, '2021-05-21', 'US', '', 133.547, 7.495, 6063, 'https://image.tmdb.org/t/p/original/AsqUSUqXrK8JfH8WEQnCXVbIAv6.jpg', 'https://image.tmdb.org/t/p/original/6uRb5axnwAd17h4ak4ENHcJqHVr.jpg', ''),
(526896, 'Morbius', 'Peligrosamente enfermo de un extraño trastorno sanguíneo, y determinado a salvar a otras personas que padecen su mismo destino, el doctor Morbius intenta una apuesta desesperada. Lo que en un principio parece ser un éxito radical, pronto se revela como un remedio potencialmente peor que la enfermedad.', 109, 75000000, 167636000, '2022-03-30', 'US', 'https://www.sonypictures.es/peliculas/morbius', 353.871, 6.044, 4072, 'https://image.tmdb.org/t/p/original/gG9fTyDL03fiKnOpf2tr01sncnt.jpg', 'https://image.tmdb.org/t/p/original/4jcJHqIVsb4MFdYrDajXeEVlDvH.jpg', ''),
(531309, 'El hijo', 'Todo lo que los Breyer han querido siempre es algo teóricamente simple: un hijo. A pesar de sus intentos, ese deseo no parece hacerse realidad. Hasta que, una noche, algo cae en la granja en la que viven: una nave que lleva a un niño dentro. Conforme este va creciendo, descubre que tiene unas habilidades especiales que no le permiten encajar, unas habilidades que acaban sacando de él lo peor de sí mismo.', 91, 6000000, 33224700, '2019-05-09', 'US', '', 228.675, 6.129, 3001, 'https://image.tmdb.org/t/p/original/uHEI6v8ApQusjbaRZ8o7WcLYeWb.jpg', 'https://image.tmdb.org/t/p/original/bQmRemkGS3SMAexgZND6ey02lYW.jpg', ''),
(533535, 'Deadpool y Lobezno', '', 0, 250000000, 0, '2024-07-24', 'US', '', 180.266, 0, 0, 'https://image.tmdb.org/t/p/original/bjGg4B1hielJIyiMXmjWHqZbqtJ.jpg', 'https://image.tmdb.org/t/p/original/1eYXM7Md2a7VWbvjAT2bkTd8UNh.jpg', ''),
(545609, 'Tyler Rake', 'Tyler Rake, un intrépido mercenario que ofrece sus servicios en el mercado negro, emprende una peligrosa misión cuando es contratado para rescatar al hijo secuestrado de un señor del crimen de Bombay.', 116, 65000000, 0, '2020-04-24', 'US', 'https://www.netflix.com/es/title/80230399', 122.989, 7.342, 5836, 'https://image.tmdb.org/t/p/original/1R6cvRtZgsYCkh8UFuWFN33xBP4.jpg', 'https://image.tmdb.org/t/p/original/cNu6VozUfD9jjQUjGuGBRoMlpYA.jpg', ''),
(547012, 'Cómo escapar de Búfalo', 'Peg Dahl (Zoey Deutch) es una joven que sueña con conseguir el dinero suficiente para dejas atrás su vida en una de las zonas más pobres de su ciudad. Inteligente y mordaz, pasa los días esperando a que llegue la carta de aceptación de la Universidad a la que espera acudir. Sin embargo, cuando por fin llega la aceptación, Peg se da cuenta de que le será imposible permitirse el coste de sus estudios. Es entonces cuando decide comenzar a buscar vías de financiación que la llevarán a pasar por prisión y a conocer a un recolector de deudas que cambiará su vida para siempre.', 95, 0, 29118, '2020-02-14', 'US', '', 174.391, 6.726, 223, 'https://image.tmdb.org/t/p/original/vLI1uQuvk3lUnTWER0bJ9RSRnKM.jpg', 'https://image.tmdb.org/t/p/original/pWSWYYbJfCGjvIgO0nMTAjFk6Sk.jpg', ''),
(549053, 'Last Christmas', 'Kate es una mujer joven que suele tomar siempre la decisión menos acertada. ¿Su último error? Haber aceptado un trabajo como elfo de Santa Claus en un centro comercial. Sin embargo, el destino la lleva a conocer a Tom, circunstancia que cambia por completo su vida. Para Kate, todo es demasiado bueno para ser cierto.', 102, 30000000, 121600000, '2019-11-07', 'US', '', 168.997, 7.246, 2270, 'https://image.tmdb.org/t/p/original/vQYwarUtaeyDYgwmcaTJYX1yix2.jpg', 'https://image.tmdb.org/t/p/original/AcVAqTnPSiOtuWIj0zauw5WyjYp.jpg', ''),
(551115, 'La Viuda Negra', 'La Viuda Negra no está muerta... La Reina de las Drogas Carmen van Walraven se esconde en Canadá y lleva allí una vida anónima. Una tarde acosan a una compañera y Carmen la ayuda. En defensa propia, mata al perpetrador, es arrestada y extraditada a los Países Bajos. Mientras sus hijos están en estado de shock porque su madre todavía está viva, también hay algunas personas que todavía tienen que arreglar algo con Carmen. Todos son nuevamente arrastrados a una montaña rusa emocional. Carmen ahora tendrá que lidiar con su pasado para salvar a su familia.', 116, 0, 0, '2019-11-28', 'NL', '', 174.468, 7.295, 56, 'https://image.tmdb.org/t/p/original/iqqMJwvPlovftBfdHVrpP2B1IxE.jpg', 'https://image.tmdb.org/t/p/original/n0Fn9P84hvu4achxGIHBxIlBy7A.jpg', ''),
(560016, 'Monkey Man', 'Kid (Dev Patel) es un delincuente que acaba de salir de prisión y vive en la India, intentando adaptarse a un mundo marcado por la avaricia y carente de valores espirituales. Allí luchará por buscar venganza por la muerte de su madre y defender a las clases más desfavorecidas.', 121, 10000000, 33180700, '2024-04-03', 'US', '', 184.16, 7.214, 352, 'https://image.tmdb.org/t/p/original/lA6KdSkCTxwzvqzPqxch997RabQ.jpg', 'https://image.tmdb.org/t/p/original/kJhQfICVsZGeYGGRudgcqiD1zQY.jpg', ''),
(565770, 'Blue Beetle', 'Un adolescente mexicano encuentra un escarabajo alienígena que le proporciona una armadura superpoderosa.', 128, 104000000, 130788000, '2023-08-16', 'US', '', 165.478, 6.803, 2345, 'https://image.tmdb.org/t/p/original/xzdOIL7261CWehsHOk3lnP0xqam.jpg', 'https://image.tmdb.org/t/p/original/tf5Mqgoj1fFIeP7Ktfn8KGrYhup.jpg', ''),
(567609, 'Noche de bodas', 'Durante la noche de su boda, una mujer recibe la invitación por parte de la rica y excéntrica familia de su marido para participar en una tradición ancestral que se convierte en un juego letal de supervivencia.', 95, 6000000, 57600000, '2019-08-21', 'CA', '', 176.199, 7.06, 4162, 'https://image.tmdb.org/t/p/original/oJ1MIABA0WF0a7MDVQnnMvBdex8.jpg', 'https://image.tmdb.org/t/p/original/47BlTRVQ43NyzgMWPLOkKYYnHez.jpg', ''),
(568124, 'Encanto', 'Los Madrigal son una familia extraordinaria que vive en una casa mágica de un pueblo vibrante en las montañas de Colombia, escondidas en un \'Encanto\'. La magia ha bendecido a cada niño de la familia con un don único, desde la superfuerza hasta el poder de sanar. A todos, excepto Mirabel, quien desea ser tan especial como el resto de su familia.  Pero cuando la magia que rodea al Encanto está en peligro, Mirabel decide que ella, la única Madrigal sin ningún tipo de don único, puede ser la única esperanza de su excepcional familia.', 102, 50000000, 253000000, '2021-10-13', 'US', '', 157.178, 7.607, 9154, 'https://image.tmdb.org/t/p/original/3G1Q5xF40HkUBJXxt2DQgQzKTp5.jpg', 'https://image.tmdb.org/t/p/original/d1lrMNkg2EiIlcmcK92OGzO0Ptx.jpg', ''),
(574451, 'Mil veces hasta siempre', 'Una adolescente intenta resolver un misterio que rodea a un multimillonario fugitivo.', 111, 0, 0, '2024-04-27', 'US', '', 271.582, 7.761, 44, 'https://image.tmdb.org/t/p/original/yt5LbZJkZdnSQiLo3t892l7Rhr7.jpg', 'https://image.tmdb.org/t/p/original/vcrqc0Qh4SJd6TDCe1uWjqO9XJ6.jpg', ''),
(575264, 'Misión: Imposible - Sentencia mortal parte uno', 'Ethan Hunt (Tom Cruise) y la IMF emprenden la misión más peligrosa a la que nunca se han enfrentado: rastrear una nueva y aterradora arma que amenaza a toda la humanidad antes de que caiga en las manos de un enemigo todopoderoso y misterioso.', 163, 291000000, 567500000, '2023-07-08', 'US', 'https://www.misionimposible.es', 165.062, 7.544, 3379, 'https://image.tmdb.org/t/p/original/628Dep6AxEtDxjZoGP78TsOxYbK.jpg', 'https://image.tmdb.org/t/p/original/83sGKvCv2T2CulYbd40Aeduc7n2.jpg', ''),
(577922, 'Tenet', 'Armado solamente con una palabra, Tenet, el protagonista deberá luchar por la supervivencia del mundo entero y evitar la Tercera Guerra Mundial, en una historia de espionaje internacional. La misión se desplegará más allá del tiempo real. No son viajes en el tiempo, es inversión.', 155, 205000000, 365304000, '2020-08-22', 'US', 'https://www.warnerbros.es/peliculas/tenet/', 412.322, 7.182, 9365, 'https://image.tmdb.org/t/p/original/yY76zq9XSuJ4nWyPDuwkdV7Wt0c.jpg', 'https://image.tmdb.org/t/p/original/buSr2RIxzJ5Zh6dLaLBsqAdvz3I.jpg', ''),
(597891, 'Kate', 'Tras ser envenenada sin remedio, una implacable criminal tiene menos de 24 horas para vengarse de sus enemigos y, durante el proceso, se forma un vínculo inesperado con la hija de una de sus víctimas anteriores.', 95, 0, 0, '2021-09-10', 'US', '', 338.033, 6.648, 1422, 'https://image.tmdb.org/t/p/original/ufy3U0Kf9fvbgm6DEhJS68RERys.jpg', 'https://image.tmdb.org/t/p/original/uJgdT1boTSP0dDIjdTgGleg71l4.jpg', ''),
(601796, 'Alienoid', '‎Los gurús de finales de la dinastía Goryeo intentan obtener una espada legendaria y sagrada, y los humanos en 2022 persiguen a un prisionero alienígena que está encerrado en el cuerpo de un humano. Las dos partes se cruzan cuando se abre un portal de viajes en el tiempo.‎', 142, 24500000, 12600000, '2022-07-20', 'KR', '', 602.316, 6.824, 319, 'https://image.tmdb.org/t/p/original/7ZP8HtgOIDaBs12krXgUIygqEsy.jpg', 'https://image.tmdb.org/t/p/original/dwh2pqqWobsOmnDFsJkiLRLBQ94.jpg', ''),
(609681, 'The Marvels', 'Cuando sus obligaciones la envían a un agujero de gusano vinculado a un revolucionario kree, los poderes de Carol Danvers, la capitana Marvel, se entremezclan con los de Kamala Khan, también conocida como la Sra. Marvel y la sobrina de Carol, ahora astronauta de S.A.B.E.R., Monica Rambeau. Juntas, deberán salvar el universo como \"The Marvels\".', 105, 274800000, 207090000, '2023-11-08', 'US', '', 413.676, 6.151, 2278, 'https://image.tmdb.org/t/p/original/w4pRLYYbhHn3sh9kqRgPZM6GjyS.jpg', 'https://image.tmdb.org/t/p/original/vpuuFM032yiX8tox4L84Wl9MGjG.jpg', ''),
(609768, 'La maldición de David', '', 94, 0, 0, '2023-10-13', 'US', '', 179.705, 4.5, 40, 'https://image.tmdb.org/t/p/original/2rlt4cfqs7WZjWxpGiuCxio7mA8.jpg', 'https://image.tmdb.org/t/p/original/kT5tsoIWnXlLBaeOfkoso11dUgB.jpg', ''),
(615457, 'Nadie', 'Hutch Mansell, un padre de familia que aguanta con resignación y sin defenderse los golpes de la vida. Un don nadie.  Una noche, cuando dos ladrones entran en su casa, Hutch decide no actuar y no trata de defenderse ni al él mismo ni a su familia, convencido de que solo así evitará una escalada de violencia. Tras el ataque, su hija adolescente Blake no oculta su decepción, y su esposa Becca se aleja todavía más.', 92, 17000000, 61779300, '2021-02-26', 'US', '', 275.071, 7.971, 6711, 'https://image.tmdb.org/t/p/original/6zbKgwgaaCyyBXE4Sun4oWQfQmi.jpg', 'https://image.tmdb.org/t/p/original/ddO5a3tMPpQutSDQO1bESgLWadB.jpg', ''),
(615656, 'Megalodón 2: La fosa', 'Una exploración submarina en las profundidades del océano se convierte en una espiral de caos cuando una malévola operación minera amenaza la misión y obliga al equipo de investigación a librar una arriesgada batalla por la supervivencia. Secuela de \'The Meg\' (2018).', 116, 129000000, 384056000, '2023-08-02', 'US', 'https://www.warnerbros.es/peliculas/megalodon-2-la-fosa', 169.486, 6.571, 3114, 'https://image.tmdb.org/t/p/original/5mzr6JZbrqnqD8rCEvPhuCE5Fw2.jpg', 'https://image.tmdb.org/t/p/original/mBgynPDplmo5JTY9VfGqY35OjDu.jpg', ''),
(615777, 'Babylon', 'Ambientada en Los Angeles durante los años 20, cuenta una historia de ambición y excesos desmesurados que recorre la ascensión y caída de múltiples personajes durante una época de desenfrenada decadencia y depravación en los albores de Hollywood.', 188, 78000000, 63363600, '2022-12-22', 'US', '', 349.06, 7.411, 2784, 'https://image.tmdb.org/t/p/original/oCKZAdUROqdlTcUOstqJ1gM8JQt.jpg', 'https://image.tmdb.org/t/p/original/oLZULW6Kn5imFM427tWfqIPMLmP.jpg', ''),
(616037, 'Thor: Love and Thunder', 'El Dios del Trueno emprende un viaje que no se parece en nada a lo que se ha enfrentado hasta ahora: una búsqueda de la paz interior. Pero el retiro de Thor se ve interrumpido por un asesino galáctico conocido como Gorr el Carnicero de Dioses. Para hacer frente a la amenaza, Thor solicita la ayuda de Valkiria, de Korg y de su ex novia Jane Foster que, para sorpresa de Thor, empuña su martillo mágico, Mjolnir, como la Poderosa Thor. Juntos, se embarcan en una aventura cósmica en la que tendrán que descubrir el misterio de la venganza del Carnicero de Dioses y detenerlo antes de que sea demasiado tarde.', 119, 250000000, 760900000, '2022-07-06', 'US', '', 181.611, 6.5, 7145, 'https://image.tmdb.org/t/p/original/jsoz1HlxczSuTx0mDl2h0lxy36l.jpg', 'https://image.tmdb.org/t/p/original/z9ajF6E39Hg2pXUofmUYgZHvdX.jpg', ''),
(617127, 'Blade', 'Película protagonizada por Mahershala Ali, encarnando a Blade, el famoso cazavampiros de Marvel Comics, creado por el escritor Marv Wolfman y el dibujante Gene Colan, su primera aparición fue en el comic book La tumba de Drácula número 10 (julio de 1973) como un personaje secundario.', 0, 0, 0, '2025-11-05', 'US', '', 318.863, 0, 0, 'https://image.tmdb.org/t/p/original/hFtJz4TvoiJJcw2ZOMdhK22aU9P.jpg', 'https://image.tmdb.org/t/p/original/fKqA4rgVJwrM7Gb3tQ9TGHnu8Tr.jpg', ''),
(618588, 'Arthur', 'Mikael Lindnord, el capitán del equipo sueco de atletismo de aventura, tuvo un extraño encuentro durante la carrera de 400 millas en la jungla ecuatoriana, cuando en su camino se cruzó un perro callejero. Tras el momento en el que Lindnord le alimentó, el perro le siguió por el resto del recorrido, haciendo incluso los tramos más complicados del planeta. Tras finalizar la carrera, Lindnord decidió adoptar al perro, llamarlo Arthur y llevarlo con él a Suecia.', 107, 19000000, 31649900, '2024-03-15', 'US', '', 389.138, 6.9, 113, 'https://image.tmdb.org/t/p/original/vTlK3chwsEToSoQJYUcJaHlNhIf.jpg', 'https://image.tmdb.org/t/p/original/q1DDwFuWeQlwR0lcjFiEsM8iRkd.jpg', ''),
(619264, 'El hoyo', 'Un lugar misterioso, una prisión indescriptible, un agujero muy profundo. Un número desconocido de niveles. Dos reclusos viviendo en cada nivel. Una plataforma descendente que contiene alimentos para todos ellos. Una lucha inhumana por la supervivencia, pero también una oportunidad para ser solidario.', 95, 1203240, 1090120, '2019-11-08', 'ES', 'http://elhoyolapelicula.com', 165.377, 6.978, 6648, 'https://image.tmdb.org/t/p/original/3tkDMNfM2YuIAJlvGO6rfIzAnfG.jpg', 'https://image.tmdb.org/t/p/original/qv30R1uDDKTLWDlNc3qi6MRdRf0.jpg', ''),
(619979, 'Aguas profundas', 'Un marido adinerado, que permite que su esposa tenga relaciones extramatrimoniales para evitar el divorcio, se convierte en el principal sospechoso de la desaparición de los amantes de ella... Adaptación de la novela de Patricia Highsmith.', 115, 49000000, 0, '2022-03-18', 'US', '', 171.544, 5.795, 1273, 'https://image.tmdb.org/t/p/original/lcITbesmy0IBO6TXTAgQHJE6Asx.jpg', 'https://image.tmdb.org/t/p/original/aarAi6bp8Cl3RYXy2lpeLc1hGS7.jpg', ''),
(624860, 'Matrix Resurrections', 'En un mundo compuesto por dos realidades, lo cotidiano y lo oculto tras ella, Thomas Anderson se ve obligado de nuevo a ir tras el conejo blanco. Dicha elección continúa siendo la vía de acceso a Matrix, que esta vez es más poderosa e intrincada que en ocasiones anteriores.', 147, 190000000, 156497000, '2021-12-16', 'US', 'https://www.warnerbros.es/peliculas/matrix-resurrections', 157.565, 6.433, 5429, 'https://image.tmdb.org/t/p/original/eNI7PtK6DEYgZmHWP9gQNuff8pv.jpg', 'https://image.tmdb.org/t/p/original/dLIwpCTf4QoW01pp85KP9jcfTpu.jpg', ''),
(629176, 'Samaritan', 'Sam Cleary (Javon \"Wanna\" Walton), un joven de 13 años, sospecha que su misterioso y solitario vecino, el Sr. Smith (Sylvester Stallone), es en realidad un personaje legendario que se esconde a plena vista. Hace 20 años, el vigilante superpoderoso de Granite City, Samaritan, fue declarado muerto tras una batalla en un almacén con su rival, Némesis. La gente cree que Samaritan falleció en el incendio, pero algunos ciudadanos como Sam tienen la esperanza de que siga vivo. Con la delincuencia en aumento y la ciudad al borde del caos, Sam se propone sacar a su vecino de su escondite para salvar la ciudad de la ruina.', 102, 100000000, 0, '2022-08-25', 'US', '', 127.876, 6.733, 1892, 'https://image.tmdb.org/t/p/original/hYZ4a0JvPETdfgJJ9ZzyFufq8KQ.jpg', 'https://image.tmdb.org/t/p/original/4GVIfQVABjKuAWy3fvidPJZE52t.jpg', ''),
(634492, 'Madame Web', 'Cassandra Webb es una paramédica en Manhattan que podría tener habilidades clarividentes. Obligada a enfrentarse a sucesos que se han revelado de su pasado, crea una relación con tres jóvenes destinadas a tener un futuro poderoso... si consiguen sobrevivir a un presente mortal.', 116, 80000000, 100299000, '2024-02-14', 'US', '', 633.352, 5.617, 1249, 'https://image.tmdb.org/t/p/original/pwGmXVKUgKN13psUjlhC9zBcq1o.jpg', 'https://image.tmdb.org/t/p/original/blq050GHBt0Fzx1j9FvohaEuknJ.jpg', '');
INSERT INTO `pelicula` (`id`, `titulo`, `sinopsis`, `duracion`, `presupuesto`, `ganancias`, `fecha_estreno`, `pais_origen`, `web`, `popularidad`, `valoracion`, `total_votos`, `fondo`, `poster`, `adulto`) VALUES
(637649, 'Despierta la furia', 'H (Jason Statham) es el misterioso tipo que acaba de incorporarse como guardia de seguridad en una compañía de furgones blindados. Durante un intento de atraco a su camión, sorprende a sus compañeros mostrando habilidades propias de un soldado profesional, dejando al resto del equipo preguntándose quién es realmente y de dónde viene.', 119, 40000000, 103966000, '2021-04-22', 'GB', '', 135.979, 7.644, 5009, 'https://image.tmdb.org/t/p/original/70AV2Xx5FQYj20labp0EGdbjI6E.jpg', 'https://image.tmdb.org/t/p/original/fvqIv59EgwY7lJ5QfqSWpCxOFxK.jpg', ''),
(639720, 'Amigos imaginarios', 'Película sobre el viaje de una niña para redescubrir su imaginación.', 104, 70000000, 0, '2024-05-08', 'US', '', 153.81, 7.3, 8, 'https://image.tmdb.org/t/p/original/jTWllMddJzCb7hBVNZICtgKhYM9.jpg', 'https://image.tmdb.org/t/p/original/ntZrt2ubOuk791lFJygQv19ssnh.jpg', ''),
(639933, 'El hombre del norte', 'El príncipe Amleth está a punto de convertirse en hombre pero, en ese momento, su tío asesina brutalmente a su padre y secuestra a la madre del niño. Dos décadas después, Amleth es un vikingo que tiene la misión de salvar a su madre.', 137, 80000000, 69633100, '2022-04-07', 'US', '', 157.312, 7.063, 4017, 'https://image.tmdb.org/t/p/original/qZYvF1M7y8Gfp4S6OBHbYfB0Lgc.jpg', 'https://image.tmdb.org/t/p/original/rdx0bIkwxW3EHvWn5kxZBFUT1Am.jpg', ''),
(642885, 'El retorno de las brujas 2', 'Han pasado 29 años desde que alguien encendió la Vela de la Llama Negra y resucitó a las hermanas Sanderson del siglo XVII, y ahora buscan venganza. De tres estudiantes de secundaria depende impedir que las voraces brujas causen un nuevo tipo de estrago en Salem antes del amanecer el día de Halloween.', 105, 30000000, 0, '2022-09-30', 'US', '', 181.865, 7.261, 1569, 'https://image.tmdb.org/t/p/original/ml8YBTJq7UkALfI022FWscCQuQW.jpg', 'https://image.tmdb.org/t/p/original/gbbZNVuGSD6cPGZ4sfcrA59EKNY.jpg', ''),
(646207, 'Ice Road', 'Una remota mina de diamantes ha colapsado dejando atrapados a un grupo de mineros en una región lejana y helada de Canadá. Como parte de un equipo contratado para rescatarlos, el experimentado conductor de una quitahielos emprende un rescate imposible, teniendo que luchar contra una carretera helada, contra las aguas que están descongelándose y contra una amenaza que no ve venir.', 103, 0, 7502850, '2021-06-24', 'CA', '', 132.771, 6.848, 1603, 'https://image.tmdb.org/t/p/original/y9rrNKSLkS7imiR46hQWRnO0n2m.jpg', 'https://image.tmdb.org/t/p/original/axoP5tUVpZ7hLvH82WQ6mUpoEPH.jpg', ''),
(653346, 'El reino del planeta de los simios', 'Ambientada varias generaciones en el futuro tras el reinado de César, en la que los simios son la especie dominante que vive en armonía y los humanos se han visto reducidos a vivir en la sombra. Mientras un nuevo y tiránico líder simio construye su imperio, un joven simio emprende un angustioso viaje que le llevará a cuestionarse todo lo que sabe sobre el pasado y a tomar decisiones que definirán el futuro de simios y humanos por igual.', 145, 0, 0, '2024-05-08', 'US', '', 2758.18, 7.2, 178, 'https://image.tmdb.org/t/p/original/iHYh4cdO8ylA3W0dUxTDVdyJ5G9.jpg', 'https://image.tmdb.org/t/p/original/r8L3fUvftNeqPMCITdXJfiXbFBU.jpg', ''),
(663712, 'Terrifier 2', 'Después de ser resucitado por una entidad siniestra, Art the Clown regresa al condado de Miles, donde debe cazar y destruir a una adolescente y a su hermano menor en la noche de Halloween.', 138, 250000, 15100000, '2022-10-06', 'US', '', 143.85, 6.766, 1637, 'https://image.tmdb.org/t/p/original/cRdA9xjHBbobw4LJFsQ3j1CgpVq.jpg', 'https://image.tmdb.org/t/p/original/6ZfvF7ZS8MJXe0YwRkPAtXNpXrG.jpg', ''),
(670292, 'The Creator', 'En medio de una guerra futura entre la raza humana y las fuerzas de la inteligencia artificial, Joshua, un duro ex-agente de las fuerzas especiales que llora la desaparición de su esposa, es reclutado para cazar y matar al Creador, el escurridizo arquitecto de la IA avanzada que ha desarrollado una misteriosa arma con el poder de acabar con la guerra... y con la propia humanidad.', 133, 80000000, 104000000, '2023-09-27', 'US', '', 266.477, 7.099, 2628, 'https://image.tmdb.org/t/p/original/kjQBrc00fB2RjHZB3PGR4w9ibpz.jpg', 'https://image.tmdb.org/t/p/original/xddifbxtO46XClG8wdyUySUqJA4.jpg', ''),
(693134, 'Dune: Parte dos', 'Sigue el viaje mítico de Paul Atreides mientras se une a Chani y los Fremen en una guerra de venganza contra los conspiradores que destruyeron a su familia. Al enfrentarse a una elección entre el amor de su vida y el destino del universo conocido, Paul se esfuerza por evitar un futuro terrible que solo él puede prever.', 167, 190000000, 704300000, '2024-02-27', 'US', '', 1271.33, 8.209, 3799, 'https://image.tmdb.org/t/p/original/xOMo8BRK7PfcJv9JCnx7s5hj0PX.jpg', 'https://image.tmdb.org/t/p/original/6o5cJjA4srfvU52UKWaqPUuPPgl.jpg', ''),
(695721, 'Los Juegos del Hambre: Balada de pájaros cantores y serpientes', 'Ambientada en un Panem postapocalíptico, nos hace retroceder varias décadas antes del comienzo de las aventuras de Katniss Everdeen. El joven Coriolanus Snow será el mentor de Lucy Gray Baird, la niña seleccionada como tributo del empobrecido Distrito 12. La joven sorprenderá a todos al cantar en la ceremonia de inauguración de los Décimos Juegos del Hambre en los que Snow intentará aprovecharse de su talento y encanto para sobrevivir.', 157, 100000000, 337135000, '2023-11-15', 'US', '', 165.76, 7.165, 2160, 'https://image.tmdb.org/t/p/original/tfRyGlBlsfkCMXpRjMyxG53rbS9.jpg', 'https://image.tmdb.org/t/p/original/eaiUgabhNozGGmBb1wlUybWoBoQ.jpg', ''),
(699280, 'Becoming', 'Únase a la ex primera dama Michelle Obama en un documental íntimo que analiza su vida, esperanzas y conexión con los demás mientras gira con \"Becoming\".', 89, 0, 0, '2020-05-06', 'US', '', 349.314, 7.4, 146, 'https://image.tmdb.org/t/p/original/l6trIrFvJbQIvHYpaFCKuwqLUbS.jpg', 'https://image.tmdb.org/t/p/original/f0vo1yoEVlbpJ0Fkn0FgU7dTrO8.jpg', ''),
(719221, 'Tarot', 'Un grupo de amigos de la universidad comienzan a morir de maneras relacionadas con su fortuna después de que les lean los horóscopos.', 92, 8250000, 11867400, '2024-05-01', 'US', 'https://www.sonypictures.es/pelicula/tarot-la-pelicula', 273.599, 4.867, 30, 'https://image.tmdb.org/t/p/original/otfoeC96neoOdA4HqsX06OWuzE9.jpg', 'https://image.tmdb.org/t/p/original/mGuNJpSbaKcpsfDf05VAcN9h9vb.jpg', ''),
(720321, 'Breathe', 'El suministro de aire es escaso en un futuro cercano, lo que obliga a una madre y una hija a luchar para sobrevivir cuando dos extraños llegan desesperados por un refugio oxigenado.', 93, 0, 0, '2024-04-04', 'US', '', 513.512, 5.008, 66, 'https://image.tmdb.org/t/p/original/9wJO4MBzkqgUZemLTGEsgUbYyP6.jpg', 'https://image.tmdb.org/t/p/original/wTW2t8ocWDlHns8I7vQxuqkyK58.jpg', ''),
(748783, 'Garfield: La película', 'El mundialmente famoso Garfield, el gato casero que odia los lunes y que adora la lasaña, está a punto de vivir una aventura ¡en el salvaje mundo exterior! Tras una inesperada reunión con su largamente perdido padre – el desaliñado gato callejero Vic – Garfield y su amigo canino Odie se ven forzados a abandonar sus perfectas y consentidas vidas al unirse a Vic en un hilarante y muy arriesgado atraco.', 101, 0, 22000000, '2024-04-30', 'US', 'https://www.sonypictures.es/pelicula/garfield', 789.669, 6.5, 52, 'https://image.tmdb.org/t/p/original/v5XyXZe8FADw8iHupB4L7QOAwH9.jpg', 'https://image.tmdb.org/t/p/original/6QR2FOCQr41gSduN70WulRIhJb7.jpg', ''),
(760104, 'X', 'En 1979, un grupo de jóvenes cineastas se propusieron hacer una película para adultos en la zona rural de Texas, pero cuando sus anfitriones solitarios y ancianos los atrapan en el acto, el elenco pronto se encuentra en una lucha desesperada por sus vidas.', 105, 1000000, 14740900, '2022-03-17', 'US', '', 382.39, 6.731, 2756, 'https://image.tmdb.org/t/p/original/70Rm9ItxKuEKN8iu6rNjfwAYUCJ.jpg', 'https://image.tmdb.org/t/p/original/4pCSBPHUPia93rppHF3UX4cLQ9M.jpg', ''),
(762441, 'Un lugar tranquilo: Día uno', 'Tercera entrega de la saga \'Un lugar tranquilo\'. Precuela', 100, 0, 0, '2024-06-26', 'US', '', 174.23, 0, 0, 'https://image.tmdb.org/t/p/original/1XyIHrP7X7rn3UBkNy9hPb9vCUf.jpg', 'https://image.tmdb.org/t/p/original/jGOi939xU8BDRfAAhN6eiTSf3H8.jpg', ''),
(763144, 'El último soldado', 'Un veterano de la Segunda Guerra Mundial escapa de su hogar de ancianos en Irlanda del Norte y se embarca en un arduo pero inspirador viaje a Francia para asistir al 75 aniversario del desembarco del Día D, encontrando el coraje para enfrentar los fantasmas de su pasado.', 100, 0, 0, '2023-12-07', 'US', '', 132.17, 6.648, 27, 'https://image.tmdb.org/t/p/original/2GLZT6GA06lwj3YVX8t0vdCwUTX.jpg', 'https://image.tmdb.org/t/p/original/1DIP9QC0iwPLyADfBuVe9PnkMF.jpg', ''),
(763215, 'Damsel', 'La boda de una joven con un príncipe encantador se convierte en una encarnizada lucha por sobrevivir cuando la ofrecen como sacrificio a una dragona escupefuego.', 110, 60000000, 5000, '2024-03-07', 'US', 'https://www.netflix.com/es/title/80991090', 323.568, 7.139, 1759, 'https://image.tmdb.org/t/p/original/deLWkOLZmBNkm8p16igfapQyqeq.jpg', 'https://image.tmdb.org/t/p/original/6tJWxRfBKWGIPFkfLTod2CgCexU.jpg', ''),
(766507, 'Predator: La presa', 'Ambientada hace 300 años en la Nación Comanche. Naru es una joven guerrera, feroz y altamente hábil, que se crió a la sombra de algunos de los cazadores más legendarios que deambulan por las Grandes Llanuras. Cuando el peligro amenaza su campamento, se dispone a proteger a su gente. La presa a la que acecha y, en última instancia, se enfrenta, resulta ser un depredador alienígena evolucionado con un arsenal técnicamente avanzado, lo que deriva en un enfrentamiento cruel y aterrador entre los dos adversarios.', 100, 65000000, 0, '2022-08-02', 'US', 'https://www.disneyplus.com/es-es/movies/predator-la-presa/5Y0VIrKjUDWm', 320.711, 7.722, 6297, 'https://image.tmdb.org/t/p/original/udhU4oOPxAiNltoMVddSRq3lLAk.jpg', 'https://image.tmdb.org/t/p/original/sNAMqQ9T7YnXnvUSufeWzaRgK6Y.jpg', ''),
(784651, 'Fighter', '', 160, 30069500, 43160600, '2024-01-24', 'IN', '', 630.118, 5.3, 68, 'https://image.tmdb.org/t/p/original/keVfqCMKmJ55nHzmqR2Q5K7LwJt.jpg', 'https://image.tmdb.org/t/p/original/fy7cDkhCAER6a1i3SAiVvyLx5oO.jpg', ''),
(785084, 'La ballena', 'Un solitario profesor de inglés con obesidad severa intenta reconectar con su hija adolescente en una última oportunidad de redención.', 117, 3000000, 55101300, '2022-12-09', 'US', '', 159.317, 7.9, 3577, 'https://image.tmdb.org/t/p/original/46FRuCeAn6TrS4F1P4F9zhyCpyo.jpg', 'https://image.tmdb.org/t/p/original/l6Jbj5dnljC3qJ4Lkpzgu9tK13M.jpg', ''),
(787699, 'Wonka', 'Basada en el personaje que protagoniza \"Charlie y la fábrica de chocolate\", el libro infantil más emblemático de Roald Dahl y uno de los más vendidos de todos los tiempos, \"Wonka\" cuenta la historia de cómo el mayor inventor, mago y chocolatero del mundo se convirtió en el querido Willy Wonka que conocemos hoy en día.', 117, 125000000, 632302000, '2023-12-06', 'GB', '', 390.884, 7.184, 2950, 'https://image.tmdb.org/t/p/original/yyFc8Iclt2jxPmLztbP617xXllT.jpg', 'https://image.tmdb.org/t/p/original/6eHcR7zwvNSvkOl9jbctU0lvZQ1.jpg', ''),
(792307, 'Pobres criaturas', 'Bella Baxter es una joven revivida por el brillante y poco ortodoxo científico Dr. Godwin Baxter. Bajo la protección de Baxter, Bella está ansiosa por aprender. Hambrienta de la mundanidad que le falta, Bella se escapa con Duncan Wedderburn, un sofisticado y perverso abogado, en una aventura vertiginosa a través de los continentes. Libre de los prejuicios de su época, Bella se vuelve firme en su propósito de defender la igualdad y la liberación.', 141, 35000000, 117194000, '2023-12-07', 'US', '', 265.083, 7.789, 3322, 'https://image.tmdb.org/t/p/original/bQS43HSLZzMjZkcHJz4fGc7fNdz.jpg', 'https://image.tmdb.org/t/p/original/mm1M6CoN2qLy8BpnrmYEVToQHJR.jpg', ''),
(799583, 'El ministerio de la guerra', 'El ejército británico recluta a un pequeño grupo de soldados de élite para atacar a los nazis detrás de las líneas enemigas durante la Segunda Guerra Mundial.', 120, 60000000, 15916000, '2024-04-18', 'US', '', 156.428, 7.163, 95, 'https://image.tmdb.org/t/p/original/s5znBQmprDJJ553IMQfwEVlfroH.jpg', 'https://image.tmdb.org/t/p/original/x8Od47ZMDDT3ho3IRdXNmcjHknX.jpg', ''),
(804095, 'Los Fabelman', 'Al crecer en la era de Arizona posterior a la Segunda Guerra Mundial, un niño llamado Sammy Fabelman descubre un secreto familiar devastador y explora cómo el poder de las películas puede ayudarlo a ver la verdad. Película semiautobiográfica sobre la infancia y juventud de Steven Spielberg.', 151, 40000000, 45629900, '2022-11-11', 'US', '', 235.708, 7.651, 2120, 'https://image.tmdb.org/t/p/original/2OnmtVOEpCwt0sYtss5kNxyYM2W.jpg', 'https://image.tmdb.org/t/p/original/wcgPDyvKkgo2agNXcdE1eXLGzmf.jpg', ''),
