(866398, 'Beekeeper: El protector', 'La brutal campaña de venganza de Adam Clay adquiere tintes nacionales tras revelarse que es un antiguo agente de una poderosa organización clandestina conocida como \"Beekeeper\".', 105, 35000000, 151418000, '2024-01-08', 'US', '', 250.582, 7.428, 2287, 'https://image.tmdb.org/t/p/original/4MCKNAc6AbWjEsM2h9Xc29owo4z.jpg', 'https://image.tmdb.org/t/p/original/gBdhYoROX6SHE3vVnBfEHI7Ojma.jpg', ''),
