(929590, 'Civil War', 'En un futuro cercano donde América está sumida en una cruenta guerra civil, un equipo de periodistas y fotógrafos de guerra emprenderá un viaje por carretera en dirección a Washington DC. Su misión: llegar antes de que las fuerzas rebeldes asalten la Casa Blanca y arrebaten el control al presidente de los Estados Unidos.', 109, 50000000, 95684700, '2024-04-10', 'GB', '', 536.201, 7.417, 632, 'https://image.tmdb.org/t/p/original/uv2twFGMk2qBdyJBJAVcrpRtSa9.jpg', 'https://image.tmdb.org/t/p/original/qDU7PMMVMxtFI5w95mXS3BjpODG.jpg', ''),
(933131, 'Cazadores en tierra inhóspita', 'Después de un terremoto que convierte Seúl en una tierra inhóspita y sin ley, un cazador entra en acción para rescatar a una chica en manos de un médico trastornado.', 107, 0, 0, '2024-01-25', 'KR', 'https://www.netflix.com/es/title/81721676', 164.108, 6.8, 600, 'https://image.tmdb.org/t/p/original/pWsD91G2R1Da3AKM3ymr3UoIfRb.jpg', 'https://image.tmdb.org/t/p/original/jPGbcbMlzGUECukPhkEMVt1Kvs5.jpg', ''),
(934632, 'Rebel Moon (Parte Dos): La Guerrera Que Deja Marcas', 'Los rebeldes se preparan para luchar contra las implacables fuerzas del Mundomadre mientras se forjan vínculos inquebrantables, surgen nuevos héroes y nacen las leyendas.', 123, 83000000, 0, '2024-04-19', 'US', 'https://www.netflix.com/es/title/81624666', 901.006, 6.104, 710, 'https://image.tmdb.org/t/p/original/tpiqEVTLRz2Mq7eLq5DT8jSrp71.jpg', 'https://image.tmdb.org/t/p/original/ivhOeG5S2CzKjcKhureKAtfonHg.jpg', ''),
(935271, 'After the Pandemic', 'Ambientado en un mundo postapocalíptico donde una pandemia global transmitida por el aire ha acabado con el 90% de la población de la Tierra y solo los jóvenes e inmunes han sobrevivido como carroñeros. Para Ellie y Quinn, los desafíos diarios para mantenerse con vida se complican cuando son perseguidos por los despiadados Stalkers.', 84, 0, 0, '2022-03-01', 'US', '', 362.926, 4.793, 58, 'https://image.tmdb.org/t/p/original/9c0lHTXRqDBxeOToVzRu0GArSne.jpg', 'https://image.tmdb.org/t/p/original/cboUHkM1zA7m3SaCrf6dW5jGqqW.jpg', ''),
(938614, 'Late Night with the Devil', 'Una transmisión de televisión en vivo en 1977 sale terriblemente mal, desatando el mal en las salas de estar de la nación.', 93, 2000000, 11006700, '2024-03-19', 'US', '', 297.902, 7.376, 319, 'https://image.tmdb.org/t/p/original/4yrOyO3N55XazHQXXYoqiiPQd40.jpg', 'https://image.tmdb.org/t/p/original/x7phbLV4IpiOo3P8GUoGpz9Pjw0.jpg', ''),
(940551, 'Migración. Un viaje patas arriba', 'La familia Mallard se ha quedado \'estancada\'. Mientras papá Mack se siente realizado cuidando de su familia en su estanque de Nueva Inglaterra, mamá Pam se muere de ganas de vivir la vida y hacer descubrir a sus hijos –el adolescente Dax y la patita Gwen– el mundo en toda su amplitud. Después de que una familia de patos migratorios llegue a su estanque con maravillosas historias de lugares lejanos, Pam consigue convencer a Mack de que deben viajar a la tropical Jamaica pasando por Nueva York. Los Mallard emprenden el viaje hacia el sur para pasar el invierno, pero nada sale como estaba previsto. La experiencia les ayudará a descubrir horizontes desconocidos, a hacer nuevos amigos, a vivir experiencias que jamás imaginaron, y de paso, a conocerse mejor.', 83, 72000000, 297405000, '2023-12-06', 'US', 'https://www.universalpictures.es/micro/migracion', 636.327, 7.481, 1309, 'https://image.tmdb.org/t/p/original/2KGxQFV9Wp1MshPBf8BuqWUgVAz.jpg', 'https://image.tmdb.org/t/p/original/diEeiB2DmZZadHISkg24RO2n0rT.jpg', ''),
