(948549, 'Sangre en los labios', 'Jackie está decidida a triunfar como culturista y se dirige a Las Vegas para participar en una competición. En su camino, pasa por un pequeño pueblo de Nuevo México donde conoce a Lou, la solitaria gerente del gimnasio local. El padre de Lou es traficante de armas y lleva las riendas de un sindicato del crimen. Jackie y Lou se enamoran. Pero su relación provoca violencia y ambas se ven inmersas en las maquinaciones de la familia de Lou.', 104, 0, 8770950, '2024-03-08', 'US', 'http://www.avalon.me/distribucion/catalogo/sangre-en-los-labios', 313.848, 6.738, 160, 'https://image.tmdb.org/t/p/original/oMiKHO3H5RixfLsiU5Vumhlp5sj.jpg', 'https://image.tmdb.org/t/p/original/yEQKiZOVzVZquN7R6BRyY4n6JET.jpg', ''),
(951491, 'Saw X', 'Entre los acontecimientos de \"Saw\" y \"Saw II\", un enfermo y desesperado John Kramer viaja a México para someterse a un tratamiento médico arriesgado y experimental con la esperanza de encontrar una cura para su cáncer, pero descubre que todo forma parte de una operación con el fin de estafar a  los más desesperados.', 118, 13000000, 111822000, '2023-09-27', 'US', '', 246.035, 7.292, 1689, 'https://image.tmdb.org/t/p/original/uUJp5I4IbzuhdUiEx4R9OAoFpbz.jpg', 'https://image.tmdb.org/t/p/original/epN0x9JTf3esk1FO8DWkhlE4Ax5.jpg', ''),
