(976906, 'Spitfire Over Berlin', 'Agosto de 1944. Con la 8ª Fuerza Aérea Americana preparada para atacar sobre la Alemania Nazi, la Inteligencia Británica se entera de que podrían estar volando hacia una trampa mortal. Con solo horas de sobra, el teniente de vuelo Edward Barnes debe volar en una misión de vida o muerte sobre Berlín en su desarmado Spitfire para obtener pruebas fotográficas y salvar la vida de 1200 hombres.', 80, 0, 0, '2022-05-13', 'US', '', 636.5, 3.8, 18, 'https://image.tmdb.org/t/p/original/ilK1JRbMjo4sMJtNKLOKnqRf1RH.jpg', 'https://image.tmdb.org/t/p/original/syFEBhLY5rV9QlShUSphD134Rgx.jpg', ''),
(984249, 'Implacable', 'Un entrenador de secundaria, cuya hija adolescente fue asesinada, se toma la justicia por su mano al perseguir a los hombres que secuestran a uno de sus alumnos dentro de su red de tráfico de personas.', 93, 0, 0, '2023-12-14', 'US', '', 179.087, 6.5, 61, 'https://image.tmdb.org/t/p/original/kSdIVZu7Cv60o9hTbKBzcTrbMX8.jpg', 'https://image.tmdb.org/t/p/original/bGsagD1rvgqb0c59YuYzkCcj7bM.jpg', ''),
(984324, 'El salario del miedo', 'Para salvar a cientos de personas de la explosión de un pozo petrolífero, un equipo de expertos emprende una peligrosa travesía por el desierto con una carga de nitroglicerina.', 107, 0, 0, '2024-03-28', 'FR', 'https://www.netflix.com/es/title/81654966', 409.687, 5.758, 219, 'https://image.tmdb.org/t/p/original/qekky2LbtT1wtbD5MDgQvjfZQ24.jpg', 'https://image.tmdb.org/t/p/original/li9PN0QuQRbilaX1XOBmmkst5DX.jpg', ''),
(1006540, 'Bullet Train Down', 'En su carrera inaugural, el tren bala más rápido del mundo está equipado con una bomba que explotará si baja a menos de 200 mph. Producción bajo presupuesto de The Asylum lanzada al mercado doméstico en EEUU para aprovecharse del éxito de \"Bullet Train\", dirigida por David Leitch y protagonizada por Brad Pitt.', 86, 0, 0, '2022-08-01', 'US', '', 147.95, 5.438, 48, 'https://image.tmdb.org/t/p/original/mEoIDEiePnYj178H9znzbl9zvky.jpg', 'https://image.tmdb.org/t/p/original/5a7cocgyVuFjYV71neDIGVzD6Yq.jpg', ''),
(1008042, 'Háblame', 'La solitaria adolescente Mia se engancha a la emoción de invocar espíritus utilizando una mano embalsamada, pero cuando se enfrenta a un alma que dice ser su madre muerta, desata una plaga de fuerzas sobrenaturales y se debate entre decidir en quién puede confiar: en los vivos o en los muertos.', 95, 4500000, 92000000, '2023-07-26', 'AU', '', 135.413, 7.169, 2567, 'https://image.tmdb.org/t/p/original/46Os8U0DEPmI0OnvKDxucl6SLVZ.jpg', 'https://image.tmdb.org/t/p/original/rS8fjd6dYcf64v3ZhAE6fKrxoaF.jpg', ''),
(1011985, 'Kung Fu Panda 4', 'Po se prepara para ser el líder espiritual del Valle de la Paz, buscando un sucesor como Guerrero Dragón. Mientras entrena a un nuevo practicante de kung fu, enfrenta al villano llamado \"el Camaleón\", que evoca villanos del pasado, desafiando todo lo que Po y sus amigos han aprendido.', 94, 85000000, 520540000, '2024-03-02', 'US', '', 1295.47, 7.122, 1585, 'https://image.tmdb.org/t/p/original/kYgQzzjNis5jJalYtIHgrom0gOx.jpg', 'https://image.tmdb.org/t/p/original/zS8BSQdbOesql0EWbs17kPvLoAT.jpg', ''),
(1022789, 'Del revés 2 (Inside Out 2)', 'Las vocecillas dentro de la cabeza de Riley la conocen del derecho y del revés, pero el próximo verano todo cambiará cuando Del revés 2 de Disney y Pixar introduzca una nueva emoción: ansiedad.', 100, 0, 0, '2024-06-06', 'US', '', 298.73, 0, 0, 'https://image.tmdb.org/t/p/original/pI5jxew0I9kub4IXrtsOB8F40dw.jpg', 'https://image.tmdb.org/t/p/original/tMnOaOuKEdYzuXPjpoX8L4bVhQx.jpg', ''),
